CREATE TABLE `movie_streams` (
  `id` int(11) NOT NULL,
  `movie_id` int(11) DEFAULT NULL,
  `video_quality` tinyint(4) DEFAULT NULL,
  `full_movie` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `full_movie_url` text COLLATE utf8_unicode_ci,
  `thirdparty_url` varchar(250) COLLATE utf8_unicode_ci NOT NULL,
  `studio_id` int(11) DEFAULT NULL,
  `sdk_user_id` int(25) NOT NULL,
  `review_flag` int(11) NOT NULL DEFAULT '0',
  `episode_number` int(11) DEFAULT NULL,
  `episode_title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `episode_story` text COLLATE utf8_unicode_ci,
  `episode_date` date DEFAULT NULL,
  `is_episode` smallint(6) NOT NULL,
  `series_number` int(11) NOT NULL DEFAULT '1',
  `is_popular` smallint(6) DEFAULT '0',
  `id_seq` int(11) DEFAULT '0',
  `is_poster` smallint(6) NOT NULL DEFAULT '0',
  `is_active` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1->Active, 0->Disabled not viewable in frontend',
  `ip` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `last_updated_by` int(11) DEFAULT NULL,
  `last_updated_date` datetime DEFAULT NULL,
  `wiki_data` int(11) DEFAULT NULL,
  `upload_date` date DEFAULT NULL,
