  `embed_id` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `has_sh` tinyint(4) NOT NULL DEFAULT '0',
  `is_download_progress` tinyint(1) NOT NULL DEFAULT '0',
  `video_resolution` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `resolution_size` text COLLATE utf8_unicode_ci,
  `enable_ad` int(11) NOT NULL,
  `rolltype` int(11) NOT NULL COMMENT '1=>preroll, 2=>midroll',
  `roll_after` text COLLATE utf8_unicode_ci,
  `mail_sent_for_video` int(11) NOT NULL DEFAULT '0' COMMENT 'Email sent regarding video encodeing 0 -> E-mail not sent, 1->E-mail not sent',
  `upload_start_time` datetime DEFAULT NULL,
  `upload_end_time` datetime DEFAULT NULL,
  `upload_cancel_time` datetime DEFAULT NULL,
  `encoding_start_time` datetime DEFAULT NULL,
  `encoding_end_time` datetime DEFAULT NULL,
  `encode_fail_time` datetime DEFAULT NULL,
  `content_publish_date` datetime DEFAULT NULL,
  `original_file` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `converted_file` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `video_duration` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL,
  `video_management_id` int(11) NOT NULL,
  `encryption_key` text COLLATE utf8_unicode_ci NOT NULL,
  `content_key` text COLLATE utf8_unicode_ci NOT NULL,
  `is_demo` enum('1','0') COLLATE utf8_unicode_ci NOT NULL DEFAULT '0',
  `episode_parent_id` int(11) NOT NULL DEFAULT '0',
  `episode_language_id` int(11) NOT NULL DEFAULT '20',
  `custom_metadata_form_id` int(11) NOT NULL,
  `custom1` text COLLATE utf8_unicode_ci,
  `custom2` text COLLATE utf8_unicode_ci,
  `custom3` text COLLATE utf8_unicode_ci,
  `custom4` text COLLATE utf8_unicode_ci,
  `custom5` text COLLATE utf8_unicode_ci,
  `custom6` text COLLATE utf8_unicode_ci COMMENT 'Json data',
  `is_offline` int(11) NOT NULL DEFAULT '0',
  `mapped_stream_id` int(11) NOT NULL,
  `has_hls_feed` int(11) NOT NULL DEFAULT '1',
  `is_downloadable` tinyint(1) NOT NULL COMMENT '0=streaming,1=downloadable,2=both',
  `file_management_id` int(11) NOT NULL,
  `after_encoding` int(2) DEFAULT '0',
  `is_mobile_drm_disable` int(11) NOT NULL DEFAULT '0',
  `is_multibitrate_offline` int(11) NOT NULL DEFAULT '0',
  `encoding_time` int(11) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

