(46122, 20064, NULL, 'It_s_Always_Darkest.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheFall-S002E003-V2_en_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Nu de identiteit van de seriemoordenaar bekend is wordt Pauls huis onder bevel van Gibson bewaakt. Zowel Sally als Katie worden ondervraagd, maar beiden blijven hem beschermen. ', '2017-01-11', 1, 2, 0, 0, 1, 1, NULL, NULL, '2016-12-30 11:08:48', 3365, '2017-03-03 10:17:25', NULL, NULL, 1, '9092509bfb07bff91803b6a2db1dc642', 1, 0, '', '{"144":3100744.11}', 0, 0, NULL, 1, '2017-01-13 06:45:53', '2017-01-13 06:50:22', '0000-00-00 00:00:00', '2017-05-15 05:47:22', '2017-05-15 12:44:36', '0000-00-00 00:00:00', NULL, '0-0', '29506-6307.8043336868', '00:58:58', 20673, '53123708674953690302109223755657', '28350451435139831937739969956531', '0', 0, 20, 8, '2014', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
