(46134, 20065, NULL, 'Personskade___part_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Dicte-S001E001-V1_da_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Het is door een macabere vondst dat Dicte inspecteur Wagner leert kennen. Hij weet niet dat Dicte journaliste is, en geeft bij aanvang meer prijs dan hij kwijt wou. Een vastberaden Dicte bijt zich vast in de zaak en het heeft heel wat voeten in de aarde maar uiteindelijk ziet ook Wagner in dat zij een meerwaarde kan zijn voor hun onderzoek.', '2017-01-12', 1, 1, 0, 0, 1, 1, NULL, NULL, '2016-12-30 11:08:49', 3365, '2017-03-03 11:06:01', NULL, NULL, 1, '41ccf6d63155cae584db854adffaf830', 1, 0, '', '{"144":2529578.57}', 0, 0, NULL, 1, '2017-01-12 13:49:47', '2017-01-12 13:54:30', '0000-00-00 00:00:00', '2017-05-15 05:47:29', '2017-05-15 18:29:07', '0000-00-00 00:00:00', NULL, '0-0', '24122-7653.9526777267', '00:48:12', 20635, '94800109132580796301836178384053', '79247849120385251575449312747675', '0', 0, 20, 8, '2013', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46135, 20065, NULL, 'Personskade___part_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Dicte-S001E002-V1_da_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Na de ontvoering van Remza staat de politiek steeds meer onder druk. In Dicte vinden ze een zondebok en ook op de redactie heeft Dicte zich niet bepaald populair gemaakt. Maar de eigenwijze Dicte slaat de kritiek in de wind en gaat koppig verder met haar onderzoek. De zaak neemt een onverwachte wending wanneer Darko erbij betrokken raakt.', '2017-01-12', 1, 1, 0, 0, 1, 1, NULL, NULL, '2016-12-30 11:08:49', 3365, '2017-03-03 11:06:23', NULL, NULL, 1, 'c91d5eb1b3f05dc2e98aab23a7945181', 1, 0, '', '{"144":2358964.27}', 0, 0, NULL, 1, '2017-01-12 13:49:08', '2017-01-12 13:54:56', '0000-00-00 00:00:00', '2017-05-15 05:47:30', '2017-05-15 18:24:47', '0000-00-00 00:00:00', NULL, '0-0', '22506-6424.5363359451', '00:44:58', 20636, '67619077521262557092647743675078', '66072777764197365276379722321668', '0', 0, 20, 8, '2013', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
