(46220, 20069, NULL, 'Episode_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheYoungPope_S001E001-V1_en_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Na zijn verkiezing tot Paus, begint Lenny Belardo zich te navigeren door het politieke doolhof van Vaticaanstad. De nieuwe paus choqueert al snel zijn medewerkers met zijn eigenzinnige beleid en gedrag.', '2017-01-11', 1, 1, 0, 0, 1, 1, NULL, NULL, '2016-12-30 11:08:58', 3365, '2017-02-06 11:32:02', NULL, NULL, 1, '5e6c4da8e79f2e2b37856fc407901176', 1, 0, '', '{"144":2860848.98}', 0, 0, NULL, 1, '2017-01-13 07:19:06', '2017-01-13 07:24:40', '0000-00-00 00:00:00', '2017-05-15 05:48:24', '2017-05-15 14:55:57', '0000-00-00 00:00:00', NULL, '0-0', '27314-5696.6380290985', '00:54:35', 20683, '60577099817945626885616096215190', '27683461339038697388401614460713', '0', 0, 20, 8, '2016', 'English', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46221, 20069, NULL, 'Episode_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheYoungPope_S001E002-V1_en_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'De jonge Paus schokt de wereld door katholieken op te dragen hun hele lichaam en ziel te geven aan God, wat ook de gevolgen mogen zijn. Lenny verklaart zijn conservatieve, starre visie aan de hand van zijn ouders die hem op jonge leeftijd achterlieten om hun hedonistische levensstijl verder te kunnen zetten.', '2017-01-11', 1, 1, 0, 0, 1, 1, NULL, NULL, '2016-12-30 11:08:58', 3365, '2017-02-06 11:30:26', NULL, NULL, 1, '3aa2df8e4dcb2e18b8d1d094f579ff00', 1, 0, '', '{"144":2903650.16}', 0, 0, NULL, 1, '2017-01-13 07:18:47', '2017-01-13 07:23:27', '0000-00-00 00:00:00', '2017-05-15 05:48:24', '2017-05-15 14:51:18', '0000-00-00 00:00:00', NULL, '0-0', '27706-5634.1625108719', '00:55:22', 20684, '70979177243486844250211181588294', '26737036695210354892647252414058', '0', 0, 20, 8, '2016', 'English', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46222, 20069, NULL, 'Episode_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheYoungPope_S001E003-V1_en_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Paus Pius XIII toont snel dat hij niet eenvoudig te manipuleren is, in tegenstelling tot wat het Vaticaan had gehoopt. Ester, de vrouw van een \'Swiss Guard\', is de eerste persoon die de boodschap van de nieuwe Paus lijkt te begrijpen.', '2017-01-11', 1, 1, 0, 0, 1, 1, NULL, NULL, '2016-12-30 11:08:59', 3365, '2017-02-06 11:34:33', NULL, NULL, 1, '4161e625f532bf71b6919eba99dd0c25', 1, 0, '', '{"144":2976343.59}', 0, 0, NULL, 1, '2017-01-13 07:21:18', '2017-01-13 07:27:55', '0000-00-00 00:00:00', '2017-09-26 07:21:19', '2017-09-26 08:14:11', '0000-00-00 00:00:00', NULL, '0-0', '28314-5851.7931747437', '00:56:36', 20685, '27744094050759277839623311162414', '36766760504343711151301251175307', '0', 0, 20, 8, '2016', 'English', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
