(46411, 20101, NULL, 'La_mort_fait_partie_du_jeu.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_1___La_mort_fait_partie_du_jeu__00_00_00_00___00_50_38_00__1948613_536804.mp4', '', 3061, 0, 0, 3, 'La mort fait partie du jeu', 'Quand Grant est accusé d\'un crime qu’il n’a pas commis, le petit groupe prend la pleine mesure du pouvoir de nuisance du network. Condamnés à la clandestinité, Wilson Wilson et Becky se rapprochent de Milner, une femme agent du mi5, mais ont-ils raison de lui faire confiance ?', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:08:26', NULL, NULL, 1, 'e1f321a3bb511f3a25587df4ce020532', 1, 0, '', '{"144":1934291.03}', 0, 0, NULL, 1, '2017-02-27 08:58:47', '2017-02-27 09:03:23', '0000-00-00 00:00:00', '2017-05-17 04:59:06', '2017-05-19 01:26:19', '0000-00-00 00:00:00', NULL, '0-0', '25339-6121.8824691772', '00:50:38', 20954, '92013223779585121670607588604861', '43668086683736620337906763649859', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46412, 20101, NULL, 'Crimes_et_ch__timents.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_1___Crimes_et_chatiments__00_00_00_00___00_48_08_00__1948614_542560.mp4', '', 3061, 0, 0, 4, 'Crimes et châtiments', 'Ayant échappé de justesse à Arby, le tueur du Network, les membres du groupe se réfugient dans un manoir abandonné où ils tentent de déchiffrer le sens secret du manuscrit. Découvrir l’identité de Mr Rabbit leur permettra-t-il de retrouver leur vie d’avant ?', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:07:20', NULL, NULL, 1, 'b6ab25e26f747fb4282c742a98d892cb', 1, 0, '', '{"144":1776126.54}', 0, 0, NULL, 1, '2017-02-27 08:59:13', '2017-02-27 09:04:26', '0000-00-00 00:00:00', '2017-05-17 04:59:06', '2017-05-19 01:15:06', '0000-00-00 00:00:00', NULL, '0-0', '24091-5017.5500116348', '00:48:08', 20952, '49404706264270028631915268931082', '52767403722346602500421044856135', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46413, 20101, NULL, 'Trahisons.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_1___Trahisons__00_00_00_00___00_48_42_00__1948618_555609.mp4', '', 3061, 0, 0, 5, 'Trahisons', 'Becky, Ian et Wilson Wilson interrogent le membre du network qu’ils retiennent en otage. La femme de Dugdale permet à ce dernier, de façon surprenante, de reprendre l’ascendant sur ses maîtres chanteurs. Quant à Jessica, elle est bouleversée par les confessions d’Arby.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:08:45', NULL, NULL, 1, '7318634fbf3172a58af7c638ddc76184', 1, 0, '', '{"144":1808662.65}', 0, 0, NULL, 1, '2017-02-27 08:59:30', '2017-02-27 09:05:09', '0000-00-00 00:00:00', '2017-05-17 04:59:07', '2017-05-19 01:35:56', '0000-00-00 00:00:00', NULL, '0-0', '24371-5374.9012393951', '00:48:42', 20957, '49271366927297798510019082631672', '80775963939746869647071777787834', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46414, 20101, NULL, 'Fin_de_missions.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_1___Fin_de_mission__00_00_00_00___00_54_04_00__1948620_542637.mp4', '', 3061, 0, 0, 6, 'Fin de missions', 'Le temps presse. La bande doit trouver Mr Rabbit et donner un coup d’arrêt à la mise en œuvre du plan Janus par le Network. Piégé par le réseau, Grant est quant à lui tenté par les promesses qui lui sont faites… une question demeure : les vrais secrets d’Utopia seront-ils enfin révélés ?', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:09:05', NULL, NULL, 1, '4c7e845abad0efaee0c3c86c4c230999', 1, 0, '', '{"144":1897273.25}', 0, 0, NULL, 1, '2017-02-27 08:59:54', '2017-02-27 09:05:35', '0000-00-00 00:00:00', '2017-05-17 04:59:07', '2017-05-19 02:24:46', '0000-00-00 00:00:00', NULL, '0-0', '27059-6271.0139455795', '00:54:04', 20953, '37689901226492655248378848885415', '55094746486588021864917971223258', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46415, 20101, NULL, '_au_commencement.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_2___Au_commencement_1952247_967146.mp4', '', 3061, 0, 0, 1, ' au commencement', 'En fuite, Arby révèle à Ian et Becky que le Network cherche à tuer Donaldson. Quel secret dangereux peut-il détenir ? Avec l’aide d’un jeune hacker, ils découvrent la clé du plan du network : provoquer une épidémie mondiale de grippe russe pour justifier une campagne de vaccination à grande échelle. Pendant ce temps, Jessica est parvenue à s’évader.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:11:00', NULL, NULL, 1, 'baa44eaf29fa441ecc49f495f77f4aff', 1, 0, '', '{"144":1803183.49}', 0, 0, NULL, 1, '2017-02-27 09:00:19', '2017-02-27 09:06:09', '0000-00-00 00:00:00', '2017-05-17 04:59:08', '2017-05-19 02:04:30', '0000-00-00 00:00:00', NULL, '0-0', '26619-4652.803894043', '00:53:12', 20959, '85191603552768488932711531654493', '86274638656793309932910767908003', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46416, 20101, NULL, '_rechute.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_2___Rechute__00_00_00_00___00_50_52_01__1948635_972031.mp4', '', 3061, 0, 0, 2, ' rechute', 'Jessica est prisonnière de Milner, alias Mister Rabbit. Un échantillon de Janus a été extrait de son sang, mais Milner veut savoir quels ajustements lui a apportés Carvel pour pouvoir ensuite produire le vaccin. Dugdale est nommé à la tête de Corvadt. \r\nWilson a rejoint Milner au sein du network. Quant à Arby, il a changé de vie, mais une visite de son vieil acolyte Lee pourrait tout changer…\r\n\r\n', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:11:28', NULL, NULL, 1, 'e51c23226c8e20febd0c656a33711356', 1, 0, '', '{"144":1775250.71}', 0, 0, NULL, 1, '2017-02-27 09:00:32', '2017-02-27 09:06:24', '0000-00-00 00:00:00', '2017-05-17 04:59:09', '2017-05-19 02:43:03', '0000-00-00 00:00:00', NULL, '0-0', '25459-4467.9773855209', '00:50:52', 20963, '69082744861223436540737015593297', '56591513671628249574726253756301', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46417, 20101, NULL, 'duo_d___enfer.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_2___Duo_d_enfer__00_00_00_00___00_49_50_01__1948636_977851.mp4', '', 3061, 0, 0, 3, 'duo d’enfer', 'En fuite, Arby révèle à Ian et Becky que le Network cherche à tuer Donaldson. Quel secret dangereux peut-il détenir ? Avec l’aide d’un jeune hacker, ils découvrent la clé du plan du network : provoquer une épidémie mondiale de grippe russe pour justifier une campagne de vaccination à grande échelle. Pendant ce temps, Jessica est parvenue à s’évader.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:07', 3366, '2017-03-24 09:06:07', NULL, NULL, 1, '5612d8e312285c1879e33a26b40dd227', 1, 0, '', '{"144":1742853.71}', 0, 0, NULL, 1, '2017-02-27 09:01:07', '2017-02-27 09:06:58', '0000-00-00 00:00:00', '2017-05-17 04:59:09', '2017-05-19 03:39:42', '0000-00-00 00:00:00', NULL, '0-0', '24939-4646.427441597', '00:49:50', 20960, '88163832476119018197204873674768', '99992740403497967096468415740597', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46418, 20101, NULL, 'les_heureux___lus.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_2___Heureux_elus__00_00_00_00___00_49_28_01__1948637_975305.mp4', '', 3061, 0, 0, 4, 'les heureux élus', 'Les hallucinations de Becky empirent, mais Donaldson, qui lui fournit son traitement, reste introuvable. Il a été remis à Lee par Arby en échange de la sécurité de Tess et Amanda. Dugdale héberge Jessica, qui est à la recherche de Ian. \r\nLa tension est palpable entre Ian et Becky, qui doivent pourtant collaborer pour décrypter la mystérieuse prédiction d’Anton, alias Philip Carvel…\r\n', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 09:10:48', NULL, NULL, 1, '450b9ff6579ee8138f673984554e8a93', 1, 0, '', '{"144":1671013.81}', 0, 0, NULL, 1, '2017-02-27 08:56:22', '2017-02-27 08:59:51', '0000-00-00 00:00:00', '2017-05-17 04:59:10', '2017-05-19 03:45:14', '0000-00-00 00:00:00', NULL, '0-0', '24755-4207.9928598404', '00:49:28', 20961, '95935581517619531533592895970086', '34038675060074696205414473102790', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46419, 20101, NULL, 'amn__sie_partielle.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_2___Amnesie_partielle__00_00_00_00___00_49_27_01__1948638_975551.mp4', '', 3061, 0, 0, 5, 'amnésie partielle', 'Après avoir appris que son père était vivant, Jessica part à sa recherche avec Milner. Mais Arby a emmené Grant et Anton à la montagne dans un endroit isolé où il se réfugiait enfant. Ian et Becky veulent informer le Network que Janus est ségrégationniste, dans l’espoir de stopper leur projet, et contactent Wilson. Mais Leah découvre bientôt un secret encore plus terrifiant à propos de Janus.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 09:10:13', NULL, NULL, 1, '5bc2931447642c01fa45d3de7212abdd', 1, 0, '', '{"144":1669408.34}', 0, 0, NULL, 1, '2017-02-27 08:56:38', '2017-02-27 09:01:43', '0000-00-00 00:00:00', '2017-05-17 04:59:10', '2017-05-19 03:47:24', '0000-00-00 00:00:00', NULL, '0-0', '24747-4184.6112966537', '00:49:27', 20958, '24229832579771021443573653813585', '27653997167751938868616978564914', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46420, 20101, NULL, '_la_fin_justifie_les_moyens.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/UTOPIA_SEASON_2___La_fin_justifie_les_moyens__00_00_00_00___00_52_50_01__1948639_975463.mp4', '', 3061, 0, 0, 6, ' la fin justifie les moyens', 'La bande s’est réfugiée dans l’aile d’un hôpital désaffecté où Arby se remet de ses blessures. L’urgence est maintenant de savoir qui est chargé de diffuser la grippe, afin de l’arrêter avant un désastre sanitaire mondial. \r\nQuand ils retrouvent Dobri Gorski au fond d’une cellule de police, celui-ci, terrifié, leur donne les noms des trois personnes qu’il a formées pour disperser le virus.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 09:09:57', NULL, NULL, 1, '97bb6bebe0602bb94df8f8382b7df9c7', 1, 0, '', '{"144":1805422.73}', 0, 0, NULL, 1, '2017-02-27 08:56:53', '2017-02-27 09:03:26', '0000-00-00 00:00:00', '2017-05-17 04:59:11', '2017-05-19 04:06:06', '0000-00-00 00:00:00', NULL, '0-0', '26435-4495.4635181427', '00:52:50', 20962, '95480840935950760820056643566873', '84830699330593376611234546131717', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
