(46422, 20102, NULL, '1492.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___1492__00_00_00_00___00_54_02_18__1929418_923525.mp4', '', 3061, 0, 0, 1, '1492', 'Juan Borgia rentre d’Espagne en apportant à son père la nouvelle de la mort de Pedro Luis. Terrassé par la mort de son fils, le cardinal Borgia réunit immédiatement ses enfants, Juan, Cesare et Lucrezia. Il promet à Lucrezia de la marier bientôt, annonce à Juan qu’il deviendra duc de Gandie et à Cesare qu’il sera nommé évêque de Valence.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 10:19:40', NULL, NULL, 1, 'ce8d8333fc3f225ab596b0505fbdb2cf', 1, 0, '', '{"144":1951879.83}', 0, 0, NULL, 1, '2017-02-13 11:47:23', '2017-02-13 11:50:54', '0000-00-00 00:00:00', '2017-05-17 04:59:12', '2017-05-18 13:58:34', '0000-00-00 00:00:00', NULL, '0-0', '27051-5633.4337644577', '00:54:04', 20735, '89923948610240677236167014089153', '38545077524859304983930642676698', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46423, 20102, NULL, 'Ondata_di_calore.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___ondata_di_calore__00_00_00_00___00_53_38_14__1929419_923526.mp4', '', 3061, 0, 0, 2, 'Ondata di calore', 'Le pape Innocent VIII tombe dans le coma alors qu’une fièvre mortelle sévit à Rome. Les fiançailles de Lucrezia sont annulées afin de l’unir à un comte plus fortuné. Les adversaires de Borgia, Della Rovere et Colonna, échafaudent déjà des plans en vue du conclave. Mais le pape sort du coma et modifie son testament, ce qui provoque la fureur de Rodrigo Borgia. Mais bientôt la maladie l’emporte et Rome est en proie au chaos.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 10:19:49', NULL, NULL, 1, '11e2cf84863231d5e2fc5d5075a2dd4a', 1, 0, '', '{"144":1956269.46}', 0, 0, NULL, 1, '2017-02-13 11:48:10', '2017-02-13 11:51:58', '0000-00-00 00:00:00', '2017-05-17 04:59:13', '2017-05-18 14:02:48', '0000-00-00 00:00:00', NULL, '0-0', '26843-5859.847735405', '00:53:39', 20744, '61567785029524660911115969388682', '24474159255126813227005117764567', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46424, 20102, NULL, 'Un_v__u_sacr__.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___un_voeu_sacre__00_00_00_00___00_53_21_15__1929420_923529.mp4', '', 3061, 0, 0, 3, 'Un vœu sacré', 'Après l’enterrement du pape, les cardinaux sont enfermés pour le conclave. Borgia, qui tente pour la troisième fois de décrocher la tiare papale, combat l’alliance entre Della Rovere et Colonna. Ascanio Sforza qui cherche aussi à s’emparer du Saint-Siège, monte les deux parties l’une contre l’autre, mais Borgia flaire la manipulation.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 10:20:01', NULL, NULL, 1, 'fb414e2a21907d9aeb4e7d9715a92a00', 1, 0, '', '{"144":1952404.92}', 0, 0, NULL, 1, '2017-02-13 11:50:13', '2017-02-13 11:53:59', '0000-00-00 00:00:00', '2017-05-17 04:59:13', '2017-05-18 14:00:36', '0000-00-00 00:00:00', NULL, '0-0', '26707-5649.4312753677', '00:53:22', 20746, '66672306389964122198600896780796', '49560982567611906653752270703630', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46425, 20102, NULL, 'La_sagesse_du_Saint_Esprit.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___la_sagesse_du_saint_esprit__00_00_00_00___00_53_29_14__1929421_923528.mp4', '', 3061, 0, 0, 4, 'La sagesse du Saint-Esprit', 'Les premiers tours du scrutin ne permettent de dégager aucune majorité. A Pise, Cesare décide de sacrifier son fils nouveau-né pour obtenir la clémence de Dieu et pour que son père remporte l’élection. Rodrigo Borgia soudoie tous les cardinaux et conclut un marché avec Sforza, en lui promettant le poste d’archidiacre. Il est enfin élu pape sous le nom d’Alexandre VI.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 10:20:12', NULL, NULL, 1, 'bf959c64f2ebaa7aa642e0b5280bbdf6', 1, 0, '', '{"144":1934135.42}', 0, 0, NULL, 1, '2017-02-13 11:53:02', '2017-02-13 11:57:20', '0000-00-00 00:00:00', '2017-05-17 04:59:14', '2017-05-18 14:10:06', '0000-00-00 00:00:00', NULL, '0-0', '26771-5434.5368795395', '00:53:30', 20738, '42944755927767106749978716251705', '16885530450702965061448060686111', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46426, 20102, NULL, 'Les_liens_du_mariage.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___les_liens_du_mariage__00_00_00_00___00_53_47_09__1929423_923518.mp4', '', 3061, 0, 0, 5, 'Les liens du mariage', 'Le règne du pape Alexandre VI débute par une série de réformes destinées à lutter contre la corruption qui sévit au Vatican. Della Rovere se rend à Gênes pour arbitrer un litige entre Naples et la France. Alexandre VI doit faire un choix entre les deux parties. Alors que Juan est rappelé d’Espagne par son père, Cesare doit rester cantonné loin de Rome, ce qui le fait enrager. Pour la deuxième fois les fiançailles de Lucrezia sont annulées. Elle doit maintenant épouser Giovanni Sforza, mais sans consommer son mariage.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 10:20:34', NULL, NULL, 1, 'aa5abe4213de91189c56ffc3a087e685', 1, 0, '', '{"144":1992195.42}', 0, 0, NULL, 1, '2017-02-13 11:54:23', '2017-02-13 11:58:07', '0000-00-00 00:00:00', '2017-05-17 04:59:15', '2017-05-18 14:23:20', '0000-00-00 00:00:00', NULL, '0-0', '26923-5628.0238227844', '00:53:48', 20741, '19157915378026611301574959227790', '15618329061809509963770549822629', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46427, 20102, NULL, 'L__gitimit__.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___legitimite__00_00_00_00___00_53_54_10__1929424_923517.mp4', '', 3061, 0, 0, 6, 'Légitimité', 'Christophe Colomb vient de découvrir l’Amérique. Alexandre VI doit arbitrer le litige qui oppose l’Espagne et le Portugal. Pendant ce temps, Della Rovere convainc le roi de France d’envahir l’Italie et de destituer le pape. De son côté, Alexandre VI cherche à se protéger autant qu’il peut. Alessandro Farnese et Cesare sont nommés cardinaux, et peu après Alexandre VI reconnaît officiellement ses trois enfants sous la pression de Vannozza.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:08', 3366, '2017-03-24 10:20:54', NULL, NULL, 1, 'eb54c84cfe7e3adc6f6db7d7975fa3d3', 1, 0, '', '{"144":1940142.73}', 0, 0, NULL, 1, '2017-02-13 11:54:48', '2017-02-13 11:59:02', '0000-00-00 00:00:00', '2017-05-17 04:59:15', '2017-05-18 14:28:52', '0000-00-00 00:00:00', NULL, '0-0', '26979-5164.5926141739', '00:53:55', 20740, '10749695061231071540799489201431', '19588534690152428637134131841415', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46428, 20102, NULL, 'Man__uvres.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___manoeuvres__00_00_00_00___00_53_55_24__1929425_923521.mp4', '', 3061, 0, 0, 7, 'Manœuvres', 'Lucrezia supplie son père de l’autoriser à consommer son mariage. Mais au moment crucial, Sforza ne se montre pas à la hauteur. Juan revient avec Maria à Rome après leur lune de miel et devient chef de la garde papale. Une invasion française semble inévitable. Cesare, qui est tout sauf convaincu des aptitudes militaires de Juan, prie en vain son père de le laisser échanger sa calotte de cardinal contre un casque et une épée.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:17:30', NULL, NULL, 1, '2d879a9dc61db834e7597d21c9f65101', 1, 0, '', '{"144":1943923.75}', 0, 0, NULL, 1, '2017-02-13 11:55:29', '2017-02-13 12:00:12', '0000-00-00 00:00:00', '2017-05-17 04:59:16', '2017-05-18 16:21:25', '0000-00-00 00:00:00', NULL, '0-0', '26987-5437.9833469391', '00:53:56', 20742, '92925279882346136154729662010646', '98159107305735350334643870213281', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46429, 20102, NULL, 'Pr__lude____l___apocalypse.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___prelude_a_l_apocalypse__00_00_00_00___00_54_05_05__1929427_923522.mp4', '', 3061, 0, 0, 8, 'Prélude à l’apocalypse', 'La France déclare la guerre à l’Italie. Les duchés italiens s’engagent auprès des Français. Alexandre VI rallie les Turcs et Naples, espérant assurer ainsi la défense de Rome. Lucrezia exige de divorcer de Sforza. L’archidiacre trahit alors le pape et se range du côté des Français. Pour la première fois Alexandre est totalement désespéré. Il accepte de livrer Cesare aux Colonna en échange de leur loyauté. Soudoyée par les Français, la garde papale abandonne Rome aux mains des troupes qui arrivent.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:17:39', NULL, NULL, 1, '9d4614272961eadb8e650a04429aa880', 1, 0, '', '{"144":1911772.61}', 0, 0, NULL, 1, '2017-02-13 11:55:55', '2017-02-13 12:00:57', '0000-00-00 00:00:00', '2017-05-17 04:59:17', '2017-05-17 08:28:21', '0000-00-00 00:00:00', NULL, '0-0', '27067-5194.099770546', '00:54:06', 20745, '79641687823380063921888334051489', '75986707411630432197809909574623', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46430, 20102, NULL, 'L___invasion_de_Rome.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___l_invasion_de_Rome__00_00_00_00___00_53_50_13__1929430_923524.mp4', '', 3061, 0, 0, 9, 'L’invasion de Rome', 'Les Borgia se barricadent au château Saint-Ange, alors que Charles VIII entre triomphalement dans Rome. Des pourparlers s’engagent. Charles souhaite être couronné roi de Naples par Alexandre VI. Libéré, Cesare promet de se venger. De retour à Rome, le mari de Lucrezia, Giovanni Sforza, est informé que le mariage sera annulé pour cause d’impuissance. Sforza répand la rumeur que le pape abuse de sa propre fille.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:17:53', NULL, NULL, 1, 'afba8d857844affddbc32772d3a37db7', 1, 0, '', '{"144":1862759.44}', 0, 0, NULL, 1, '2017-02-13 11:56:25', '2017-02-13 12:01:56', '0000-00-00 00:00:00', '2017-05-17 04:59:18', '2017-05-17 08:35:36', '0000-00-00 00:00:00', NULL, '0-0', '26947-5486.4132509232', '00:53:51', 20737, '79558935667894093899011403092376', '19378492566636104132583260224367', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46431, 20102, NULL, 'Miracles.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___miracles__00_00_00_00___00_53_59_24__1929432_923523.mp4', '', 3061, 0, 0, 10, 'Miracles', 'Après avoir échappé aux troupes françaises, Cesare parvient à rejoindre Spolète. Naples tombe aux mains de la France. Alexandre VI met alors sur pied une sainte alliance avec l’Espagne, l’Allemagne, Venise et Milan. Charles VIII décide de rentrer en France. A leur arrivée à Rome, les troupes espagnoles sont acclamées par le peuple. Cesare rejoint enfin sa famille.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:18:05', NULL, NULL, 1, '9e30387be1bdc568dfca37927852dc94', 1, 0, '', '{"144":1979854.28}', 0, 0, NULL, 1, '2017-02-13 11:56:43', '2017-02-13 12:02:12', '0000-00-00 00:00:00', '2017-05-17 04:59:19', '2017-05-17 08:35:11', '0000-00-00 00:00:00', NULL, '0-0', '27019-5559.6591415405', '00:54:00', 20743, '43363188618509039046560036553364', '43329463149867179092883518584932', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46432, 20102, NULL, 'Le_Monstre_de_Dieu.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___le_monstre_divin__00_00_00_00___00_54_00_12__1929433_923520.mp4', '', 3061, 0, 0, 11, 'Le Monstre de Dieu', 'Charles VIII meurt soudainement. Le nouveau roi chasse de la cour Della Rovere, qu’un procès attend à Rome. Lucrezia s’éprend d’un soldat espagnol que son père a mis sur son chemin pour tester sa foi religieuse. Juan s’attribue les exploits d’un général espagnol, ce qui ne fait qu’accroître la haine de Cesare à l’égard de son frère.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:18:23', NULL, NULL, 1, 'b47fe896f07e0e8fdf6956ce0669e16e', 1, 0, '', '{"144":1913101.79}', 0, 0, NULL, 1, '2017-02-13 11:57:45', '2017-02-13 12:02:59', '0000-00-00 00:00:00', '2017-05-17 04:59:19', '2017-05-17 08:35:32', '0000-00-00 00:00:00', NULL, '0-0', '27027-5174.2838821411', '00:54:01', 20739, '22389560109635664920011436611911', '65960755110900104799335421139906', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46433, 20102, NULL, 'L___ascension_du_serpent.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_1___l_eveil_du_serpent__00_00_00_00___01_04_47_10__1929434_925579.mp4', '', 3061, 0, 0, 12, 'L’ascension du serpent', 'Désireux de rétablir la paix à Rome, Alexandre VI laisse à Della Rovere son cardinalat, apaisant ainsi les alliés de celui-ci. Enceinte, Lucrezia quitte le cloître. Alexandre jure d’écouter ce signe que Dieu lui envoie et d’éradiquer une fois pour toute la corruption de l’Eglise. Cesare persuade son père de le laisser renoncer au cardinalat afin de pouvoir bâtir son empire Borgia en tant que soldat.', '2017-03-24', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:18:36', NULL, NULL, 1, '1c4196d0ff7fe4e94bdca98fb251bc25', 1, 0, '', '{"144":2346331.79}', 0, 0, NULL, 1, '2017-02-13 11:59:08', '2017-02-13 12:05:05', '0000-00-00 00:00:00', '2017-05-17 04:59:20', '2017-05-17 08:47:00', '0000-00-00 00:00:00', NULL, '0-0', '32419-6506.7958164215', '01:04:48', 20736, '49827428191184654651310681575298', '42634314658887536777965876794808', '0', 0, 20, 12, '2011', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46434, 20102, NULL, 'Le_Temps_de_la_tendresse.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Juillet_1494_La_Saint_Alexis__00_00_00_00___00_52_41_19__1929514_369910.mp4', '', 3061, 0, 0, 1, 'Le Temps de la tendresse', 'Rodrigo Borgia pleure encore la mort de son fils Juan et est affaibli. Pendant toute sa grossesse, Lucrezia s\'est cachée dans la villa de sa mère. Déchiré entre son désir de monter sur le trône et ses obligations religieuses, Cesare souffre des affres d\'un amour non partagé.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:18:48', NULL, NULL, 1, '78cb63acd2888606f925551760b69f54', 1, 0, '', '{"144":2031753.41}', 0, 0, NULL, 1, '2017-02-15 06:23:42', '2017-02-15 06:27:22', '0000-00-00 00:00:00', '2017-05-17 04:59:21', '2017-05-17 08:36:58', '0000-00-00 00:00:00', NULL, '0-0', '26371-5540.3188257217', '00:52:42', 20751, '72210928182082396211753973158826', '45629006140741170220294433451646', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46435, 20102, NULL, 'Mercredi_des_Cendres.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___fevrier_1494_le_mercredi_des_cendres__00_00_00_00___00_54_03_15__1929506_353602.mp4', '', 3061, 0, 0, 2, 'Mercredi des Cendres', 'Les complots et les intrigues contre le pape se multiplient. A quelques jours de son accouchement, Lucrezia est tourmentée par l\'avenir de son enfant. A Naples, Cesare continue de faire la cour à Carlotta d\'Aragona mais son temps est compté…', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:18:59', NULL, NULL, 1, '7c3bf8ccf90b36eb118e9b95798708b2', 1, 0, '', '{"144":2049781.97}', 0, 0, NULL, 1, '2017-02-13 14:02:11', '2017-02-13 14:06:18', '0000-00-00 00:00:00', '2017-05-17 04:59:21', '2017-05-17 11:18:15', '0000-00-00 00:00:00', NULL, '0-0', '27051-5978.0400886536', '00:54:04', 20758, '87161201485961681558085649558856', '85325470088759566144733486753772', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46436, 20102, NULL, 'Dimanche_des_Rameaux.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Avril_1494_le_dimanche_des_Rameaux__00_00_00_00___00_53_07_24__1929507_362171.mp4', '', 3061, 0, 0, 3, 'Dimanche des Rameaux', 'A Florence, Frère Girolamo Savonarola blâme le pape Alexandre VI pour la décadence de la chrétienté qui ne cesse de s\'aggraver. Rodrigo envoie Cesare et Alessandro à Florence. Après deux mois loin de son fils, Lucrezia est déterminée à user de tous les moyens pour le récupérer.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:19:13', NULL, NULL, 1, 'b1fa0b6b06066d871b835fc80f71b3d0', 1, 0, '', '{"144":1908395.96}', 0, 0, NULL, 1, '2017-02-13 14:02:38', '2017-02-13 14:06:59', '0000-00-00 00:00:00', '2017-05-17 04:59:22', '2017-05-17 11:45:19', '0000-00-00 00:00:00', NULL, '0-0', '26587-5536.8100605011', '00:53:08', 20750, '54973260905533828869330049312951', '81499487025549221267600803173015', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46437, 20102, NULL, 'Pax_Vobiscum.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Avril_1494_Pax_Vobiscum__00_00_00_00___00_52_58_06__1929508_362158.mp4', '', 3061, 0, 0, 4, 'Pax Vobiscum', 'Profondément préoccupé, Rodrigo s\'interroge sur les perspectives de mariage de Lucrezia et prend des doses de plus en plus fortes de vitriolo. A Florence, Savonarola ne montre aucun signe de soumission au pape Borgia. Cesare, pour la première fois de sa vie, hésite à employer la force.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:09', 3366, '2017-03-24 10:19:24', NULL, NULL, 1, 'd9d091e2a4d0ad5090774d0790d99a9a', 1, 0, '', '{"144":1949227.28}', 0, 0, NULL, 1, '2017-02-13 14:02:58', '2017-02-13 14:08:14', '0000-00-00 00:00:00', '2017-05-17 04:59:23', '2017-05-17 11:52:11', '0000-00-00 00:00:00', NULL, '0-0', '26507-5797.4670190811', '00:52:59', 20749, '42668139379750231634691748533430', '57315634378700746390809615003605', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46438, 20102, NULL, 'L_Ascension.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Mai_1494_l_Ascension__00_00_00_00___00_52_46_02__1929510_372555.mp4', '', 3061, 0, 0, 5, 'L\'Ascension', 'Avec Alessandro Farnese et Juan Borgia Lanzol, Cesare retourne à Rome. La foule de paysans acclame Cesare pour sa victoire sur Savonarola. Mais Cesare est mué par de plus grandes ambitions. Sous une pression incessante, Rodrigo choisit finalement un mari pour Lucrezia.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:15:27', NULL, NULL, 1, '18042a74c3e57fabcf4e0980402ca1d4', 1, 0, '', '{"144":1945485.32}', 0, 0, NULL, 1, '2017-02-14 09:23:09', '2017-02-14 09:27:06', '0000-00-00 00:00:00', '2017-05-17 04:59:23', '2017-05-17 11:49:21', '0000-00-00 00:00:00', NULL, '0-0', '26403-5552.3098964691', '00:52:46', 20753, '61711774137447937673349375100754', '50197112447403716120369371763122', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46439, 20102, NULL, 'La_Pentec__te.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Mai_1494_la_Pentecote__00_00_00_00___00_52_41_00__1929511_374037.mp4', '', 3061, 0, 0, 6, 'La Pentecôte', 'Rodrigo souffre d\'hallucinations. Della Rovere conspire avec Riario-Sansoni pour éliminer les membres du premier cercle de Rodrigo. Suspectant que Vannozza et Lucrezia soient impliquées dans la disparition de Giovanni, Cesare accélère les recherches.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:15:38', NULL, NULL, 1, '0cf3631c283b4879e297fc213535dc12', 1, 0, '', '{"144":1950595.76}', 0, 0, NULL, 1, '2017-02-13 14:04:03', '2017-02-13 14:09:18', '0000-00-00 00:00:00', '2017-05-17 04:59:24', '2017-05-17 11:55:34', '0000-00-00 00:00:00', NULL, '0-0', '26363-5869.7673463821', '00:52:41', 20754, '42772169464687580973485341387517', '99220049425063967279360901314628', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0);
