(46440, 20102, NULL, 'Le_Dimanche_de_la_Trinit__.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Mai_1494_La_Sainte_Trinite__00_00_00_00___00_53_01_05__1929512_373295.mp4', '', 3061, 0, 0, 7, 'Le Dimanche de la Trinité', 'Les fortes doses de Vitriolo déforment gravement la réalité de Rodrigo. La famille Farnese côtoie aussi bien la mort que la vie. Riario-Sansoni continue de renforcer sa position au Vatican. A Lyon, le roi Charles lance un pari qui déterminera l\'avenir de Cesare.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:15:50', NULL, NULL, 1, '8b1cccf5369d9db9bc92a9f1a6ec825b', 1, 0, '', '{"144":1963563.14}', 0, 0, NULL, 1, '2017-02-13 14:11:39', '2017-02-13 14:15:28', '0000-00-00 00:00:00', '2017-05-17 04:59:25', '2017-05-17 11:53:51', '0000-00-00 00:00:00', NULL, '0-0', '26531-5571.4474639893', '00:53:02', 20752, '61418485599422610602904682970777', '22088735005942639688961607954195', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46441, 20102, NULL, 'Une_Moralit__.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___fevrier_1494_la_fete_de_la_st_valentin__00_00_00_00___00_56_46_19__1929504_355251.mp4', '', 3061, 0, 0, 8, 'Une Moralité', 'Rodrigo subit une tentative d\'assassinat. Perdant patience face à l\'immobilisme d\'Alessandro, Giulia va elle-même voir le pape pour qu\'il lui trouve un mari. Lucrezia découvre que Di Calabria ment. Le Roi de France demande une faveur au Pape.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:16:00', NULL, NULL, 1, 'f915b080d7ebf5043c7a6c718df9f392', 1, 0, '', '{"144":2156806.07}', 0, 0, NULL, 1, '2017-02-15 06:23:16', '2017-02-15 06:28:29', '0000-00-00 00:00:00', '2017-05-17 04:59:25', '2017-05-17 13:05:54', '0000-00-00 00:00:00', NULL, '0-0', '28419-6626.7301368713', '00:56:48', 20757, '43992784578211548718122045443277', '38012721969129472997046293834480', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46442, 20102, NULL, 'La_Transfiguration.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Aout_1494_La_Transfiguration__00_00_00_00___00_52_52_24__1929516_391257.mp4', '', 3061, 0, 0, 9, 'La Transfiguration', 'Giulia intensifie sa recherche d\'un mari. En France, une succession de déceptions poussent Cesare à agir. A Rome, Alessandro est témoin d\'un nouveau conflit à l\'intérieur du Vatican. Après des débuts difficiles à Spoleto, Lucrezia commence à se plaire dans sa nouvelle maison.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:16:11', NULL, NULL, 1, 'e79b743519dc083a9d431d0f6cc9724e', 1, 0, '', '{"144":1937448.33}', 0, 0, NULL, 1, '2017-02-14 09:24:33', '2017-02-14 09:28:06', '0000-00-00 00:00:00', '2017-05-17 04:59:26', '2017-05-17 14:50:56', '0000-00-00 00:00:00', NULL, '0-0', '26467-5800.8697929382', '00:52:53', 20748, '74557701917843300304446409409400', '22526801422220440366833674446577', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46443, 20102, NULL, 'L_Assomption.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Aout_1494_L_Assomption__00_00_00_00___00_52_49_16__1929517_391346.mp4', '', 3061, 0, 0, 10, 'L\'Assomption', 'Giulia prend conscience du danger que sa démarche entraîne pour sa famille. Alessandro bafoue l\'un des Dix Commandements. Le Roi de France fait une offre à Cesare. A Spotelo, Lucrezia fait face aussi bien au triomphe qu\'à la défaite', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:16:18', NULL, NULL, 1, '19ffc09943f1dffb251cef5a0b71c183', 1, 0, '', '{"144":1959599.31}', 0, 0, NULL, 1, '2017-02-14 09:24:59', '2017-02-14 09:28:57', '0000-00-00 00:00:00', '2017-05-17 04:59:27', '2017-05-17 14:57:44', '0000-00-00 00:00:00', NULL, '0-0', '26435-5529.6455001831', '00:52:50', 20747, '33765174137294473649721010885677', '55415035753549641063311863653849', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46444, 20102, NULL, 'Les_Sept_Douleurs.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Septembre_1494_Les_Sept_Douleurs__00_00_00_00___00_52_52_23__1929518_391345.mp4', '', 3061, 0, 0, 11, 'Les Sept Douleurs', 'Rodrigo déclare la guerre. Cesare se met en route vers Milan avec 300 soldats. Lucrezia, après avoir appris certains secrets passés, lutte pour réunir la famille Borgia. Alessandro attend de savoir s\'il devra enterrer une fois de plus un être cher.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:16:29', NULL, NULL, 1, '82f4ec0886a346b2e2b220e1e805b22f', 1, 0, '', '{"144":1955201.14}', 0, 0, NULL, 1, '2017-02-14 09:21:41', '2017-02-14 09:25:05', '0000-00-00 00:00:00', '2017-05-17 04:59:28', '2017-05-17 15:04:12', '0000-00-00 00:00:00', NULL, '0-0', '26459-5851.775182724', '00:52:53', 20756, '40295833121547181882121777726021', '28683439630193863172834768871340', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46445, 20102, NULL, 'Qui_est_comme_Dieu.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_2___Septembre_1494_La_Saint_Michel__00_00_00_00___00_55_48_23__1929519_394302.mp4', '', 3061, 0, 0, 12, 'Qui est comme Dieu', 'Après s\'être réunis, le destin pousse les Borgia à se séparer de nouveau. Cesare continue sa conquête de l\'Italie. Rodrigo fait face à une vérité dérangeante. Lucrezia sort de l\'ombre de sa famille.', '2017-03-24', 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:16:39', NULL, NULL, 1, '49324aa17bffaf1a43a8613a2de9db4d', 1, 0, '', '{"144":2055584.91}', 0, 0, NULL, 1, '2017-02-16 11:47:45', '2017-02-16 11:59:04', '0000-00-00 00:00:00', '2017-05-17 04:59:28', '2017-05-17 15:07:52', '0000-00-00 00:00:00', NULL, '0-0', '27931-5790.6868286133', '00:55:49', 20755, '13635182619738380972999040779731', '18068679056381633666299613051407', '0', 0, 20, 12, '2012', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46446, 20102, NULL, '1495.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1495__00_00_00_00___00_52_58_13__1929545_905541.mp4', '', 3061, 0, 0, 1, '1495', 'Juan Borgia rentre d\'Espagne en apportant à son père la nouvelle de la mort de Pedro Luis. Terrassé par la mort de son fils, le cardinal Borgia réunit immédiatement ses enfants, Juan, Cesare et Lucrezia. Il promet à Lucrezia de la marier bientôt, annonce à Juan qu\'il deviendra duc de Gandie et à Cesare qu\'il sera nommé évêque de Valence.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:10', 3366, '2017-03-24 10:16:49', NULL, NULL, 1, '6bcf5c355dac3e11aaad6202d366df53', 1, 0, '', '{"144":1947949.49}', 0, 0, NULL, 1, '2017-02-14 09:25:20', '2017-02-14 09:29:52', '0000-00-00 00:00:00', '2017-05-17 04:59:29', '2017-05-17 15:05:54', '0000-00-00 00:00:00', NULL, '0-0', '26507-5761.6944284439', '00:52:59', 20759, '33122374465373131616061392552331', '33266999905302156843999764297595', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46447, 20102, NULL, '1496.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1496__00_00_00_00___00_53_54_18__1929546_905539.mp4', '', 3061, 0, 0, 2, '1496', 'Le pape Innocent VIII tombe dans le coma alors qu\'une fièvre mortelle sévit à Rome. Les fiançailles de Lucrezia sont annulées afin de l\'unir à un comte plus fortuné. Les adversaires de Borgia, Della Rovere et Colonna, échafaudent déjà des plans en vue du conclave. Mais le pape sort du coma et modifie encore une fois son testament, ce qui provoque la fureur de Rodrigo Borgia. Lorsque le pape s\'effondre en pleine messe, on convoque une armada de médecins à son chevet, mais il est déjà trop tard. Le pape meurt et Rome est en proie au chaos.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:09:59', NULL, NULL, 1, 'ddf22c927d3f99e95403afefc4501a8d', 1, 0, '', '{"144":2008999.91}', 0, 0, NULL, 1, '2017-02-13 12:23:10', '2017-02-13 12:27:08', '0000-00-00 00:00:00', '2017-05-17 04:59:29', '2017-05-17 15:20:13', '0000-00-00 00:00:00', NULL, '0-0', '26979-5658.418255806', '00:53:55', 20760, '25291039871411957646134231205711', '28369568000058212727710887166824', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46448, 20102, NULL, '1497.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1497__00_00_00_00___00_53_53_09__1929547_917195.mp4', '', 3061, 0, 0, 3, '1497', 'Après l\'enterrement du pape, les cardinaux sont enfermés pour le conclave. Borgia, qui tente pour la troisième fois de décrocher la tiare papale, combat l\'alliance entre Della Rovere et Colonna. Ascanio Sforza, qui cherche aussi à s\'emparer du Saint-Siège, monte les deux parties l\'une contre l\'autre. Mais Borgia flaire la manipulation.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:10:22', NULL, NULL, 1, '05ede5cedad6c61ef99376296b0699ef', 1, 0, '', '{"144":1936641.23}', 0, 0, NULL, 1, '2017-02-13 12:23:25', '2017-02-13 12:28:01', '0000-00-00 00:00:00', '2017-05-17 04:59:30', '2017-05-17 17:30:37', '0000-00-00 00:00:00', NULL, '0-0', '26963-5474.9020023346', '00:53:54', 20761, '92708551404298036109529184473352', '93515083088042623274121264369986', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46449, 20102, NULL, '1498.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1498__00_00_00_00___00_53_52_24__1929548_908536.mp4', '', 3061, 0, 0, 4, '1498', 'Les premiers tours de scrutin du conclave ne permettent de dégager aucune majorité. A Pise, Cesare décide de sacrifier son fils nouveau-né pour obtenir la clémence de Dieu et pour que son père remporte l\'élection. Rodrigo Borgia soudoie tous les cardinaux et conclut un marché avec Sforza, en lui promettant le poste d\'archidiacre. Il finit par être élu pape sous le nom d\'Alexandre VI. Lucrezia sort miraculeusement de sa fièvre délirante et fait le vœu de devenir nonne.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:10:34', NULL, NULL, 1, 'f073b7fd2381edc2a53d4430b43fc526', 1, 0, '', '{"144":1906301.46}', 0, 0, NULL, 1, '2017-02-13 12:23:33', '2017-02-13 12:29:48', '0000-00-00 00:00:00', '2017-05-17 04:59:31', '2017-05-17 18:11:57', '0000-00-00 00:00:00', NULL, '0-0', '26963-5613.6000537872', '00:53:53', 20762, '45110847057329662474476204427015', '52067000144851570572732033925568', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46450, 20102, NULL, '1499.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1499__00_00_00_00___00_53_53_20__1929550_911175.mp4', '', 3061, 0, 0, 5, '1499', 'Le règne du pape Alexandre VI débute par une série de réformes destinées à lutter contre la corruption qui sévit au Vatican. Della Rovere se rend à Gênes pour arbitrer un litige entre Naples et la France. Alexandre VI doit faire un choix entre les deux parties. Alors que Juan est rappelé d\'Espagne par son père, Cesare doit rester cantonné loin de Rome, ce qui le fait enrager. Pour la deuxième fois, les fiançailles de Lucrezia sont annulées. Elle doit maintenant épouser Giovanni Sforza, mais sans consommer le mariage.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:10:54', NULL, NULL, 1, 'eaa29aaf42805f3108d2e9cf9fdfc562', 1, 0, '', '{"144":1930419.07}', 0, 0, NULL, 1, '2017-02-13 12:23:39', '2017-02-13 12:29:31', '0000-00-00 00:00:00', '2017-05-17 04:59:31', '2017-05-17 18:26:16', '0000-00-00 00:00:00', NULL, '0-0', '26971-5584.7709493637', '00:53:54', 20763, '92680913162503427893715407298518', '65627942725701508441580966340451', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46451, 20102, NULL, '1500.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1500__00_00_00_00___00_53_54_21__1929553_911184.mp4', '', 3061, 0, 0, 6, '1500', 'Christophe Colomb vient de découvrir l\'Amérique. Alexandre VI doit arbitrer le litige qui oppose l\'Espagne et le Portugal. Pendant ce temps, Della Rovere convainc le roi de France, Charles VIII, d\'envahir l\'Italie et de destituer le pape. De son côté, Alexandre VI cherche à se protéger autant qu\'il peut. Alessandro Farnese et Cesare sont nommés cardinaux, et peu après Alexandre VI reconnaît officiellement ses trois enfants – Goffredo également –, sous la pression de Vannozza.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:11:16', NULL, NULL, 1, '91a8f8847ee097f0be9c70c3255afad8', 1, 0, '', '{"144":1961562.42}', 0, 0, NULL, 1, '2017-02-13 12:23:49', '2017-02-13 12:30:13', '0000-00-00 00:00:00', '2017-05-17 04:59:32', '2017-05-17 18:26:06', '0000-00-00 00:00:00', NULL, '0-0', '26979-5359.6429262161', '00:53:55', 20764, '76910239909240154476465644156325', '57841187399439797461658829825282', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46452, 20102, NULL, '1501.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1501__00_00_00_00___00_53_55_04__1929554_930640.mp4', '', 3061, 0, 0, 7, '1501', 'Lucrezia supplie son père de l\'autoriser à consommer son mariage. Mais au moment crucial, Sforza ne se montre pas à la hauteur. Juan revient avec Maria à Rome après leur lune de miel et devient chef de la garde papale. Une invasion française semble inévitable. Cesare, qui est tout sauf convaincu des aptitudes militaires de Juan, prie en vain son père de le laisser échanger sa calotte de cardinal contre un casque et une épée. On marie Goffredo à la princesse de Naples afin de renforcer l\'alliance. Mais Juan la séduit avant même que son frère ait eu le temps de faire ses preuves en tant que mari. Au palais apostolique, Giulia donne naissance à une petite fille.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:11:40', NULL, NULL, 1, '4a0a330f3fe04fab7704255c4230dc6d', 1, 0, '', '{"144":1954741.34}', 0, 0, NULL, 1, '2017-02-13 12:23:56', '2017-02-13 12:31:23', '0000-00-00 00:00:00', '2017-05-17 04:59:33', '2017-05-17 18:32:27', '0000-00-00 00:00:00', NULL, '0-0', '26979-5362.9582624435', '00:53:56', 20765, '34920341678477425625866738358359', '63473537550040322650554854394290', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46453, 20102, NULL, '1502.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1502__00_00_00_00___00_53_54_24__1929555_924028.mp4', '', 3061, 0, 0, 8, '1502', 'La France déclare la guerre à l\'Italie. Les duchés italiens s\'engagent auprès des Français. Alexandre VI rallie les Turcs et Naples, espérant assurer ainsi la défense de Rome. Lucrezia exige de divorcer de Sforza. L\'archidiacre trahit alors le pape et se range du côté des Français. Giulia est capturée par les troupes françaises alors qu\'elle tentait de fuir Rome. Pour la première fois, Alexandre est totalement désespéré. Il accepte de livrer Cesare aux Colonna en échange de leur loyauté. Soudoyée par les Français, la garde papale abandonne Rome aux mains des troupes en marche.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:11:50', NULL, NULL, 1, 'c1ca185ea0fad2ac9c1e9bf8e21c793e', 1, 0, '', '{"144":1940314.46}', 0, 0, NULL, 1, '2017-02-13 12:24:06', '2017-02-13 12:31:11', '0000-00-00 00:00:00', '2017-05-17 04:59:33', '2017-05-17 18:31:22', '0000-00-00 00:00:00', NULL, '0-0', '26979-5459.8569068909', '00:53:55', 20766, '76661111341189918764699258404098', '20663352856267081531292053795577', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46454, 20102, NULL, '1503.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1503_1ere_partie__00_00_00_00___00_53_54_22__1929557_929530.mp4', '', 3061, 0, 0, 9, '1503', 'Les Borgia se barricadent au château Saint-Ange alors que Charles entre triomphalement dans Rome. Des pourparlers s\'engagent. Charles souhaite être couronné roi de Naples par Alexandre VI. Libéré, Cesare jure de se venger. De retour à Rome, le mari de Lucrezia, Giovanni Sforza, est informé que son mariage sera annulé pour cause d\'impuissance. Sforza répand la rumeur que le pape abuse de sa propre fille. Afin de stabiliser l\'alliance fragile avec la France, Cesare est à nouveau livré comme otage, cette fois aux Français.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:12:04', NULL, NULL, 1, 'fa757d4df53d4143d09ec8064b630ac0', 1, 0, '', '{"144":1937324.6}', 0, 0, NULL, 1, '2017-02-13 12:26:36', '2017-02-13 12:32:07', '0000-00-00 00:00:00', '2017-05-17 04:59:34', '2017-05-17 19:29:19', '0000-00-00 00:00:00', NULL, '0-0', '26979-5409.720492363', '00:53:55', 20767, '45297561002750379270757475678042', '79717213391956391711777465796067', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46455, 20102, NULL, '1503.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1503_2eme_partie__00_00_00_00___00_53_54_24__1929558_973979.mp4', '', 3061, 0, 0, 10, '1503', 'Après avoir échappé aux troupes françaises, Cesare parvient à rejoindre Spolète, en Italie. Lucrezia aide Maria Enriquez à fuir la ville avec son bébé, ce qui met Juan hors de lui. Mais pour Alexandre il est temps d\'admettre que Lucrezia est devenue une personnalité forte et indépendante. Lucrezia veut toujours devenir nonne, alors que son père lui a déjà trouvé une série de nouveaux époux, ce qui déclenche un conflit et une brouille. Naples tombe aux mains de la France. Alexandre VI met alors sur pied une sainte alliance avec l\'Espagne, l\'Allemagne, Venise et Milan. Charles VIII décide de rentrer en France. A leur arrivée à Rome, les troupes espagnoles sont acclamées par le peuple. Cesare rejoint enfin sa famille.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:12:19', NULL, NULL, 1, '1fdfb6f89419a6d2e520339bfea2d0bb', 1, 0, '', '{"144":1914780.87}', 0, 0, NULL, 1, '2017-02-13 12:26:40', '2017-02-13 12:32:33', '0000-00-00 00:00:00', '2017-05-17 04:59:35', '2017-05-17 21:04:07', '0000-00-00 00:00:00', NULL, '0-0', '26979-5176.458656311', '00:53:55', 20768, '51665489009066692201665168052176', '76114313494202078096852976192441', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46456, 20102, NULL, '1504.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1504__00_00_00_00___00_53_49_24__1929559_941915.mp4', '', 3061, 0, 0, 11, '1504', 'Charles VIII meurt soudainement. Le nouveau roi chasse de la cour Della Rovere, qu\'un procès attend à Rome. Lucrezia s\'éprend d\'un soldat espagnol que son père a mis sur son chemin pour tester sa foi religieuse. Juan s\'attribue les exploits d\'un général espagnol, ce qui ne fait qu\'accroître la haine de Cesare à l\'égard de son frère. Alexandre envoie Cesare à Florence pour proposer une charge de cardinal à Savonarole. Celui-ci refuse ; il est excommunié. Cesare se ligue avec les franciscains contre lui. Les Florentins révoltés pendent et brûlent Savonarole.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:11', 3366, '2017-03-24 10:12:36', NULL, NULL, 1, '92732d8798add606646430bbd6748bfd', 1, 0, '', '{"144":1958962.2}', 0, 0, NULL, 1, '2017-02-13 12:26:51', '2017-02-13 12:33:08', '0000-00-00 00:00:00', '2017-05-17 04:59:35', '2017-05-17 21:41:49', '0000-00-00 00:00:00', NULL, '0-0', '26939-5522.2344255447', '00:53:50', 20769, '57321156770223597243927361560947', '64605101913237973091920904480578', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46457, 20102, NULL, '1505.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1505__00_00_00_00___00_53_52_00__1929561_941195.mp4', '', 3061, 0, 0, 12, '1505', 'Désireux de rétablir la paix à Rome, Alexandre VI laisse à Della Rovere son cardinalat, apaisant ainsi les alliés de celui-ci. Enceinte, Lucrezia quitte le cloître. Juan est assassiné en pleine rue. Bien qu\'il soit considéré comme le principal suspect, Cesare dirige les investigations. Ébranlé, Alexandre jure d\'écouter ce signe que Dieu lui envoie et d\'éradiquer une fois pour toute la corruption de l\'Église. Cesare persuade son père de le laisser renoncer au cardinalat afin de pouvoir bâtir son empire Borgia en tant que soldat.', '2017-03-24', 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-02-10 11:51:12', 3366, '2017-03-24 10:09:37', NULL, NULL, 1, '8b63b93bbe10e6712a7ecfc86c7c735e', 1, 0, '', '{"144":1986167.72}', 0, 0, NULL, 1, '2017-02-13 12:22:50', '2017-02-13 12:26:20', '0000-00-00 00:00:00', '2017-05-17 04:59:36', '2017-05-17 21:40:52', '0000-00-00 00:00:00', NULL, '0-0', '26955-5578.5619602203', '00:53:52', 20770, '31145382606453787679049588547588', '71156530878128735895408665933190', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
