(46506, 20099, NULL, 'Episode_1_.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/ENGRENAGES___Saison_5___Episode_1__00_00_00_00___00_56_15_18__1942431_962650.mp4', '', 3061, 0, 0, 1, 'Episode 1 ', 'Après la mort de Sami, Laure Berthaud découvre qu’elle est enceinte sans savoir si l’enfant est de lui ou de Brémont. L’enquête sur la mort d’une mère et de sa petite-fille la renvoie sans cesse à cette grossesse qu’elle est incapable d’assumer. Les recherches policières s’orientent vers un drame familial, d’autant que Stéphane Jaulin, le mari et père des victimes, reste introuvable. ', '2017-03-24', 1, 5, 0, 0, 1, 1, NULL, 3366, '2017-02-15 00:00:00', 3366, '2017-03-24 07:31:35', NULL, NULL, 1, '45086577787a4a3234e5f020568abd93', 1, 0, '', '{"144":1912235.1}', 0, 0, NULL, 1, '2017-02-16 10:21:24', '2017-02-16 10:25:01', '0000-00-00 00:00:00', '2017-05-17 05:00:01', '2017-05-18 06:10:12', '0000-00-00 00:00:00', NULL, '0-0', '28155-5937.5503892899', '00:56:16', 20845, '26525927365779665906459444185399', '80173732935002929630124025422433', '0', 0, 20, 12, '2014', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
