(46584, 20102, NULL, '1506.mp4', 'http://d3rwslp88bd1jt.cloudfront.net/videogallery/BORGIA___SAISON_3___1506__00_00_00_00___00_53_52_00__1929562_941363.mp4', '', 3061, 0, 0, 13, '1506', 'Cesare, qui s\'était évadé de prison, est finalement capturé par les gardes du roi Ferdinand d\'Espagne. Lui qui pensait être sorti d\'affaire comprend vite que le ressentiment du souverain à son égard pourrait lui coûter la vie. Malgré l\'insistance de Lucrezia, Alfonso d\'Este refuse catégoriquement de soutenir Cesare. Il envisage même de se séparer de sa femme pour éviter le courroux du Saint-Père, mais son épouse n\'a pas son pareil pour se montrer persuasive...', NULL, 1, 3, 0, 0, 1, 1, NULL, 3366, '2017-03-02 00:00:00', NULL, '2017-03-02 09:35:29', NULL, NULL, 1, 'faed96d01a34b82bbf7d9cc5fd0e6e78', 1, 0, '', '{"144":2012341.82}', 0, 0, NULL, 1, '2017-03-02 09:37:00', '2017-03-02 09:39:42', '0000-00-00 00:00:00', '2017-05-17 05:00:34', '2017-05-18 18:46:43', '0000-00-00 00:00:00', NULL, '0-0', '26955-5702.9914455414', '00:53:52', 20771, '13640632057222298665870658260155', '13326874406113209829711045050841', '0', 0, 20, 12, '2013', 'Français', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
