(46846, 20124, NULL, 'Aflevering_3.mp4', 'https://d2685ys9aufw68.cloudfront.net/videogallery/MidnightSun_S01E03_sv_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Nieuw bewijsmateriaal doet vermoeden dat de dader iemand van het Samivolk is, maar Anders Harnesk, zelf half-Sami, twijfelt daar sterk aan. Ook privé gaat het hem niet voor de wind. Hij worstelt met zijn verborgen relatie. Sparen krijgt een vreemd telefoontje.', '0000-00-00', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-03-10 12:08:04', NULL, '2017-03-10 12:08:04', NULL, NULL, 1, 'bd4bca1e5c7f6a0bf5d5bef566d34042', 1, 0, '', '{"144":2780664.02}', 0, 0, NULL, 1, '2017-03-14 06:35:39', '2017-03-14 06:43:06', '0000-00-00 00:00:00', '2017-05-15 05:48:55', '2017-05-16 23:50:36', '0000-00-00 00:00:00', NULL, '0-0', '26602-6666.6990222931', '00:53:10', 21034, '25524754883040851790038982975227', '20035503180286869967090418197013', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46847, 20124, NULL, 'Aflevering_4.mp4', 'https://d2685ys9aufw68.cloudfront.net/videogallery/MidnightSun_S01E04_sv_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Kimmo krijgt een gruwelijk videofilmpje op zijn telefoon aan. Iemand weet duidelijk waar hij en de anderen mee bezig zijn. Een avondje uit tussen Kahina en Thor neemt een vreemde wending. Tot ze onverwachts een telefoontje krijgt van de politie in verband met haar zoon Nadji...', '0000-00-00', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-03-10 12:08:04', NULL, '2017-03-10 12:08:04', NULL, NULL, 1, 'eed2c82361d3923a13a3dba8d10e8715', 1, 0, '', '{"144":2874136.49}', 0, 0, NULL, 1, '2017-03-14 06:35:49', '2017-03-14 06:43:55', '0000-00-00 00:00:00', '2017-05-15 05:48:55', '2017-05-17 00:14:49', '0000-00-00 00:00:00', NULL, '0-0', '27298-6922.1382389069', '00:54:34', 21035, '84910484494708842858083276542400', '93938749532801231405911409077315', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(46848, 20124, NULL, 'Aflevering_5.mp4', 'https://d2685ys9aufw68.cloudfront.net/videogallery/MidnightSun_S01E05_sv_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Sparen staat stil bij de dood van zijn zoon Johan, tien jaar geleden. De politie vindt een spoor dat richting Elmen leidt, terwijl Anders intussen alles in het werk zet om Kahina op te sporen. Nadji, haar zoon, krijgt eindelijk de volledige waarheid te horen.', '0000-00-00', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-03-10 12:08:04', NULL, '2017-03-10 12:08:04', NULL, NULL, 1, '66a18289224fcaca68694426ede468a0', 1, 0, '', '{"144":2851663.69}', 0, 0, NULL, 1, '2017-03-14 06:32:51', '2017-03-14 06:40:28', '0000-00-00 00:00:00', '2017-05-15 05:48:56', '2017-05-17 00:22:08', '0000-00-00 00:00:00', NULL, '0-0', '27226-6690.6718330383', '00:54:24', 21036, '54191968688224845907565225587710', '88167148872442711107875846949833', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
