(47047, 20231, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheCode_S01E01_en_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Bij een botsing tussen een terreinwagen en een truck in het afgelegen Lindara raken twee Aboriginal jongeren gewond, Clarence en Sheyna. Terwijl Clarence hulp gaat zoeken, verdwijnt Sheyna. Geen spoor van de truckchauffeur. Ned Banks, een journalist, krijgt filmmateriaal van het ongeval in handen en vraagt hulp aan zijn broer Jesse om het beschadigde bestand te herstellen. Nadat Ned de video online heeft geplaatst wordt hij bedreigd. Ook de overheid probeert Neds aandacht van de zaak af te wenden.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:27', NULL, '2017-05-30 11:44:27', NULL, NULL, 1, 'ad56836cff90c98033e051cc2042e321', 1, 0, '', '{"144":2893901.94}', 0, 0, NULL, 1, '2017-05-31 09:15:15', '2017-05-31 09:22:49', '0000-00-00 00:00:00', '2017-05-31 09:25:02', '2017-05-31 20:20:52', '0000-00-00 00:00:00', NULL, '0-0', '5906-8084.9382724762', '00:56:03', 21240, '48082919300776517950343632975531', '67175032079301316809030068442652', '0', 0, 20, 8, '2014', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
