(47050, 20231, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheCode_S01E04_en_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Na hun aanval op Andy vlucht Jesse alleen weg, teleurgesteld verlaat hij Hani. Lyndon blijft haar onder druk zetten om te blijven werken voor de AFP. Ned en Jesse vinden een link tussen de verslechterde gezondheidstoestand van Clarence en de dood van Sheyna. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:27', NULL, '2017-05-30 11:44:27', NULL, NULL, 1, 'dfac52cc4901fea9c14e8389caf1bd58', 1, 0, '', '{"144":2874530.55}', 0, 0, NULL, 1, '2017-05-31 09:15:57', '2017-05-31 09:25:09', '0000-00-00 00:00:00', '2017-05-31 09:30:03', '2017-06-01 01:41:18', '0000-00-00 00:00:00', NULL, '0-0', '5869-8420.2023916245', '00:55:40', 21243, '32608680409050718467935071313479', '50736406431565090611677556290103', '0', 0, 20, 8, '2014', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
