(47055, 20232, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheTeam_S01E01_da_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Onderzoekers uit Denemarken, Duitsland en België werken samen om de moord op drie jonge prostituees in Kopenhagen, Berlijn en Antwerpen op te lossen. Ze zijn alle drie door hun linkeroog geschoten en ze missen een vinger. Dit gebeurde slechts uren nadat de Belgische journalist Jean Louis Poquelin bij hen op bezoek was geweest.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:28', NULL, '2017-05-30 11:44:28', NULL, NULL, 1, 'c08845406b78842b7ee7f3339c31cef6', 1, 0, '', '{"144":2985055.18}', 0, 0, NULL, 1, '2017-05-31 09:18:48', '2017-05-31 09:26:52', '0000-00-00 00:00:00', '2017-05-31 09:30:05', '2017-06-01 03:42:44', '0000-00-00 00:00:00', NULL, '0-0', '6051-8287.8059129715', '00:57:26', 21246, '58639124245903282894383551464950', '18829331852398728711996178438378', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47056, 20232, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheTeam_S01E02_da_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'De Litouwse miljardair Marius Loukauskis wordt verdacht in de zaak van de drie prostituees. Loukauskis is waarschijnlijk het hoofd van een internationaal crimineel netwerk en zit in de mensenhandel en zet mensen aan tot dwangarbeid. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:28', NULL, '2017-05-30 11:44:28', NULL, NULL, 1, '59a45a36b4c91e4c80904ce5dffd75eb', 1, 0, '', '{"144":3055591.73}', 0, 0, NULL, 1, '2017-05-31 09:19:09', '2017-05-31 09:28:45', '0000-00-00 00:00:00', '2017-05-31 09:30:05', '2017-06-01 04:00:58', '0000-00-00 00:00:00', NULL, '0-0', '6205-9664.6712369919', '00:58:55', 21247, '38098136308786486059049833947628', '23213664323716434694608506328174', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
