(47058, 20232, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheTeam_S01E04_da_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Pooier Theo Janke en zijn dochter zijn doodgeschoten. Het net rond miljardair Loukauskis sluit steeds verder wanneer het spoor naar de moorden naar Bruno Koopman leidt, de persoonlijke beveiliger van de miljardair. Harald zoekt contact op met een underover agent die werkt in de organisatie van Loukauskis. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:28', NULL, '2017-05-30 11:44:28', NULL, NULL, 1, 'cade2aee3b1062fe9c6314856ba263e7', 1, 0, '', '{"144":3123983.54}', 0, 0, NULL, 1, '2017-05-31 09:19:45', '2017-05-31 09:31:40', '0000-00-00 00:00:00', '2017-05-31 09:35:02', '2017-06-01 07:17:34', '0000-00-00 00:00:00', NULL, '0-0', '6331-8559.3069400787', '01:00:04', 21249, '56640544863054431521110957568836', '99383276306186040294272411253974', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47059, 20232, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheTeam_S01E05_da_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Terwijl ze op weg is naar haar afspraak met Iris Gabler, wordt Jackie aangevallen en neergeschoten door een gemaskerde man. Ze ligt zwaargewond in het ziekenhuis in Berlijn. Van de dader ontbreekt ieder spoor en er lijkt geen verband te zijn met de criminele praktijken van Loukauskis.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:28', NULL, '2017-05-30 11:44:28', NULL, NULL, 1, 'b7e21bd47130fce0c917dda4c3e6e30f', 1, 0, '', '{"144":3117879.5}', 0, 0, NULL, 1, '2017-05-31 09:19:57', '2017-05-31 09:32:14', '0000-00-00 00:00:00', '2017-05-31 09:35:03', '2017-06-01 07:45:09', '0000-00-00 00:00:00', NULL, '0-0', '6317-9150.7158298492', '00:59:57', 21250, '59337639421236595356653779370354', '69093019137447721956705879836301', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47060, 20232, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheTeam_S01E06_da_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Wanneer de Deense politie aankomt bij de illegale kippenboerderij, blijkt het gebouw in brand te staan. Vele dwangarbeiders die daar werden opgesloten zijn gestorven. De mogelijke aanwijzingen zijn allemaal opgegaan in de vlammen, dus het enige aanknopingspunt is het materiaal van journalist Jean Louis. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:28', NULL, '2017-05-30 11:44:28', NULL, NULL, 1, '4140fe6a9358de3c9d660225c4c2fcb4', 1, 0, '', '{"144":3007631.15}', 0, 0, NULL, 1, '2017-05-31 09:20:15', '2017-05-31 09:32:27', '0000-00-00 00:00:00', '2017-05-31 09:35:04', '2017-06-01 07:42:15', '0000-00-00 00:00:00', NULL, '0-0', '6093-8396.3211898804', '00:57:51', 21251, '96161125511310683287059690224858', '35135567395856885388120674818400', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47061, 20232, NULL, 'Aflevering_7.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheTeam_S01E07_da_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Loukauskis weet te ontsnappen, maar de politie heeft een internationaal opsporingsbevel uitgevaardigd. Ze hebben namelijk bewijs gevonden dat hij Maria, de dochter van Iris Gabler, heeft verkracht toen ze veertien was. Ondertussen blijkt dat Jean Louis helemaal geen stoornis heeft en zijn eigen plan maakt om Loukauskis te ontmaskeren.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:29', NULL, '2017-05-30 11:44:29', NULL, NULL, 1, '216d47b84e01adc02b49eead5b32f9e0', 1, 0, '', '{"144":2994378.27}', 0, 0, NULL, 1, '2017-05-31 09:17:53', '2017-05-31 09:28:59', '0000-00-00 00:00:00', '2017-05-31 09:30:06', '2017-06-01 04:36:50', '0000-00-00 00:00:00', NULL, '0-0', '6074-8139.613325119', '00:57:36', 21252, '81149009130824309565022837917471', '24224541767870399881632894715266', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
