(47109, 20235, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S05E01_sv_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Denise, een jonge vrouw van 18, wordt dood aangetroffen in een hotelkamer in Stockholm. De kamer werd betaald met de creditkaart van een zekere Peter Ahre, uit de welgestelde buitenwijk van Djursholm. Wanneer Gunvald en Oskar opduiken om Ahre te verhoren, beweert hij dat zijn auto en portefeuille de vorige nacht zijn gestolen. Martin Beck brengt een bezoek aan de ouders van Denise en haar vriend Anders. Tal van mogelijke moordenaars passeren de revue, maar wie is nu de werkelijke dader?', NULL, 1, 5, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:40', NULL, '2017-05-30 11:44:40', NULL, NULL, 1, '4832215be72e7fa0ff6539453731b5b3', 1, 0, '', '{"144":4556123.95}', 0, 0, NULL, 1, '2017-05-31 09:07:22', '2017-05-31 09:13:48', '0000-00-00 00:00:00', '2017-05-31 09:15:03', '2017-05-31 14:45:04', '0000-00-00 00:00:00', NULL, '0-0', '9336-14020.632583618', '01:28:41', 21198, '98484643806660044224360083680665', '81823505612415098809129396878270', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47110, 20235, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S05E02_sv_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'De crimineel Zlatko Lozanovic wordt in zijn huis doodgeschoten door een sluipschutter. Hij sterft voor de ogen van zijn vrouw, kinderen en schoonvader. Het Beck-team stelt een lijst op van alle vijanden van Zlatko, die bijna de hele onderwereld van Stockholm bevat. Wie is de sluipschutter en wie heeft hem de opdracht gegeven om Zlatko te vermoorden?', NULL, 1, 5, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:41', NULL, '2017-05-30 11:44:41', NULL, NULL, 1, 'f6a55a2a55a160ba72bb9acdfccf164e', 1, 0, '', '{"144":4681929.93}', 0, 0, NULL, 1, '2017-05-31 09:05:47', '2017-05-31 09:11:49', '0000-00-00 00:00:00', '2017-05-31 09:15:04', '2017-05-31 17:14:52', '0000-00-00 00:00:00', NULL, '0-0', '9551-14857.43467617', '01:30:47', 21199, '67609807111059967302758109267928', '35608460843155702020816827788535', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47111, 20235, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S05E03_sv_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Er worden twee lijken gevonden buiten Stockholm. Ze blijven voor een lange tijd ongeïdentificeerd. Wanneer een andere vermoorde man wordt gevonden in een verlaten auto, gelooft het Beck team dat de twee het slachtoffer kunnen zijn van een internationaal conflict binnen een Islamitische terroristische groep. ', NULL, 1, 5, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:41', NULL, '2017-05-30 11:44:41', NULL, NULL, 1, 'e0bcbf50b9afa71ee130b94dfe8bcf2e', 1, 0, '', '{"144":4601092.44}', 0, 0, NULL, 1, '2017-05-31 09:06:04', '2017-05-31 09:13:18', '0000-00-00 00:00:00', '2017-05-31 09:15:05', '2017-05-31 19:09:49', '0000-00-00 00:00:00', NULL, '0-0', '9392-14603.842538834', '01:29:14', 21200, '77907523744716979706199499347322', '49909403852491217804837565861737', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47112, 20235, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S05E04_sv_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Oncoloog Johan Fors wordt beschuldigd van moord door de zoon van een overleden kankerpatiënt. Martin Beck en zijn team nemen de zaak op zich, al zijn ze niet enthousiast: de chronisch zieke vrouw was 80 jaar oud, en de zoon blijkt geestesziek. Toch lijkt het erop dat de vrouw is vermoord. Na een eerste interview met Johan Fors lijkt hij echt geschokt door de resultaten van de autopsie. Maar dan wordt Johan dood aangetroffen na een val van het dak van het hospitaal…', NULL, 1, 5, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:41', NULL, '2017-05-30 11:44:41', NULL, NULL, 1, '715735a90f4b1c43c73170b1343a65d2', 1, 0, '', '{"144":4356893.05}', 0, 0, NULL, 1, '2017-05-31 09:06:18', '2017-05-31 09:15:29', '0000-00-00 00:00:00', '2017-05-31 09:20:04', '2017-05-31 19:36:19', '0000-00-00 00:00:00', NULL, '0-0', '8851-13887.67329216', '01:24:07', 21201, '21784896151780813385160387121311', '25121039829702808311529927883163', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47113, 20235, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S06E01_sv_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Een onderzoeksjournalist wordt dood aangetroffen in zijn huis, waar ook de vingerafdrukken van een beruchte crimineel worden gevonden. Wanneer de zaak een onverwachte en vreselijke wending neemt, staat er plots meer op het spel dan enkel de zoektocht naar de moordenaar. Martin Beck en zijn collega’s moeten meer dan ooit het evenwicht tussen hun persoonlijke en professionele leven beschermen.', NULL, 1, 6, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:42', NULL, '2017-05-30 11:44:42', NULL, NULL, 1, 'dee39f3a5ab881ab30a36b0ee71300aa', 1, 0, '', '{"144":4656539.42}', 0, 0, NULL, 1, '2017-05-31 09:04:33', '2017-05-31 09:11:54', '0000-00-00 00:00:00', '2017-05-31 09:15:06', '2017-05-31 19:06:11', '0000-00-00 00:00:00', NULL, '0-0', '9537-13203.796482086', '01:30:39', 21202, '35258508939445040365198516822671', '19402660293893912598339640067516', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47114, 20235, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S06E02_sv_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Er wordt een ongeïdentificeerd lichaam gevonden in een afgebrande trailer. De eigenares van de caravan, een jonge drugsverslaafde, is spoorloos, maar is zij werkelijk het slachtoffer? En wat is de rol van de zogenaamde buurtpreventie? Intussen krijgt Beck - zonder inspraak - een nieuwe sidekick, de charismatische Noorse rechercheur Steinar Hovland, met een machtstrijd tot gevolg…', NULL, 1, 6, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:42', NULL, '2017-05-30 11:44:42', NULL, NULL, 1, 'f7db266a262974afa84ca5ab4fdb5c2b', 1, 0, '', '{"144":4736649.63}', 0, 0, NULL, 1, '2017-05-31 09:04:52', '2017-05-31 09:18:32', '0000-00-00 00:00:00', '2017-05-31 09:20:04', '2017-05-31 22:23:56', '0000-00-00 00:00:00', NULL, '0-0', '9677-14219.640231133', '01:31:59', 21203, '95354359085835392194251587729756', '32069016405441064007379582999035', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47115, 20235, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S06E03_sv_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Er worden drie brutale moorden gepleegd in een huis in een rustige buurt. De slachtoffers zijn een vroegere politieagent, zijn vrouw en hun zoon van 10. Becks team ontdekt een geheime kamer met gestolen wapens in het huis, en vingerafdrukken van een crimineel die 4 jaar eerder een overval pleegde, zijn mededaders vermoordde en spoorloos verdween met 6,3 miljoen. Hoe kwamen deze wapens bij de politieman terecht, en hoe is hij verbonden met de dieven? De zaak weekt sterke reacties los in het hoofdkwartier…. ', NULL, 1, 6, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:42', NULL, '2017-05-30 11:44:42', NULL, NULL, 1, 'fe1e7a6ec9a1b0684752d2f5c02677dd', 1, 0, '', '{"144":4707970.69}', 0, 0, NULL, 1, '2017-05-31 09:05:13', '2017-05-31 09:19:13', '0000-00-00 00:00:00', '2017-05-31 09:20:05', '2017-05-31 22:13:42', '0000-00-00 00:00:00', NULL, '0-0', '9593-12885.415106773', '01:31:10', 21204, '79520261637375647811449787115139', '49412915127776049666740850203352', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47116, 20235, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Beck_S06E04_sv_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Twee agenten proberen een auto die te snel rijdt tegen te houden. Wanneer de bestuurder eindelijk aan de kant gaat, stapt hij uit en schiet hij één van de agenten koelbloedig dood. Er wordt een opsporingsbericht verspreid, en het Beck team neemt de leiding in de zaak. Een camerabeeld van de nummerplaat leidt hen naar het appartement van de eigenaar van de auto, waar ze deze dood aantreffen… De eerste zomerdag is een lange dag voor het team, want de dader heeft nog meer slachtoffers op zijn lijst… ', NULL, 1, 6, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:42', NULL, '2017-05-30 11:44:42', NULL, NULL, 1, 'dd82d58268453ca1c56996aa87e97fca', 1, 0, '', '{"144":4529175.6}', 0, 0, NULL, 1, '2017-05-31 09:05:29', '2017-05-31 09:21:50', '0000-00-00 00:00:00', '2017-05-31 09:25:08', '2017-06-01 03:24:35', '0000-00-00 00:00:00', NULL, '0-0', '9280-13275.932887077', '01:28:11', 21205, '63863719999598993215130426835145', '21820740893403731422951969937100', '0', 0, 20, 8, '2016', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
