(47118, 20236, NULL, 'REBECKA_MARTINSSON.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/20min_RebeckaMartinsson_S01E01_sv_1080p25.mp4', '', 3060, 0, 0, 0, 'REBECKA MARTINSSON GRATIS 20min', 'Bekijk gratis de eerste 20 minuten', '2017-06-05', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:43', 3365, '2017-08-09 07:14:34', NULL, NULL, 1, '3ad892bdaabb05ff82f38cf0a0744a47', 1, 0, '', '{"144":788480.39}', 0, 0, NULL, 1, '2017-06-05 07:05:09', '2017-06-05 07:07:47', '0000-00-00 00:00:00', '2017-06-05 07:10:03', '2017-06-05 08:17:37', '0000-00-00 00:00:00', NULL, '0-0', '2127-2678.264462471', '00:20:02', 21257, '63378016797189883098150779805450', '78570717317865254693105461018471', '0', 0, 20, 8, '2017', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47119, 20236, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/RebeckaMartinsson_S01E01_sv_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Op midzomernacht wordt in het noorden van Zweden de feministische predikante Mildred Nilsson dood aangetroffen. Ze is opgehangen aan haar voeten, in de kerk. Nilsson, een lokale herrieschopper, had veel vijanden. Zowel met haar werkgever, de mannen in het dorp en de jachtvereniging was ze in conflict geraakt. Toch loopt het politieonderzoek vast. Als een paar maanden later juriste Rebecka Martinssons belastend materiaal vindt en dat aan de politie overhandigt, blaast zij onbedoeld het vuur terug aan.  ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:43', NULL, '2017-05-30 11:44:43', NULL, NULL, 1, '5867a6d760feb3565835e7287ca18469', 1, 0, '', '{"144":4560244.88}', 0, 0, NULL, 1, '2017-05-31 08:58:59', '2017-05-31 09:04:21', '0000-00-00 00:00:00', '2017-05-31 09:05:02', '2017-05-31 14:01:36', '0000-00-00 00:00:00', NULL, '0-0', '9145-13177.60504818', '01:26:53', 21206, '14513869435721292936133636960916', '15995403607588972659871076399508', '0', 0, 20, 8, '2017', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47120, 20236, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/RebeckaMartinsson_S01E02_sv_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Midden in de winter vindt een visser in het Noord-Zweedse Torneträsk het lijk van een vrouw in de hut van zijn buurman. De vrouw, Inna, heeft een steekwond in haar borst, maar haar kapotgebeten tong wijst erop dat ze voor haar dood in shock was. Juriste Rebecka Martinsson, verdiept zich met tweelokale inspecteurs in de zaak. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:43', NULL, '2017-05-30 11:44:43', NULL, NULL, 1, 'e0d757928d10391526f903dc027a8b8f', 1, 0, '', '{"144":4575064.44}', 0, 0, NULL, 1, '2017-05-31 08:59:15', '2017-05-31 09:05:10', '0000-00-00 00:00:00', '2017-05-31 09:10:03', '2017-05-31 14:02:16', '0000-00-00 00:00:00', NULL, '0-0', '9196-11232.340447426', '01:27:21', 21207, '77675006135867575488532310249242', '22972483349627186803748127337520', '0', 0, 20, 8, '2017', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47121, 20236, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/RebeckaMartinsson_S01E03_sv_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'In het meer Vittangijärvi, ten Noorden van Zweden, gaan een jongen en een meisje op zoek naar een vliegtuigwrak . Hun duiktocht loopt fataal af. In het voorjaar vindt de politie in een rivier het lijk van een meisje, het blijkt de vermiste duikster te zijn. Van de jongen ontbreekt nog ieder spoor. De twee lokale inspecteurs gaan samen met Rebecka Martinsson de zaak onderzoeken. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:44', NULL, '2017-05-30 11:44:44', NULL, NULL, 1, '202cda7404e3c7fc6e569544b94bd069', 1, 0, '', '{"144":4425689}', 0, 0, NULL, 1, '2017-05-31 08:59:53', '2017-05-31 09:07:39', '0000-00-00 00:00:00', '2017-05-31 09:10:03', '2017-05-31 14:16:45', '0000-00-00 00:00:00', NULL, '0-0', '8888-12363.984968185', '01:24:24', 21208, '32802125957310598684861047749910', '39708176063829090153595100707268', '0', 0, 20, 8, '2017', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47122, 20236, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/RebeckaMartinsson_S01E04_sv_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Rebecka Martinsson leidt het onderzoek naar een gruwelijke moord in Kiruna. Het slachtoffer is Soll. Britt en zij besluiten te zorgen voor haar negenjarige kleinzoon Marcus, die getuige was van de moord. Hoe dieper Rebecka in de zaak duikt, hoe meer bizarre sterfgevallen bovenkomen die met elkaar te maken hebben en die Marcus in gevaar brengen.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-05-30 11:44:44', NULL, '2017-05-30 11:44:44', NULL, NULL, 1, 'd69b9159a37a710d16b67c5e61e2e219', 1, 0, '', '{"144":4541142.09}', 0, 0, NULL, 1, '2017-05-31 09:00:09', '2017-05-31 09:06:58', '0000-00-00 00:00:00', '2017-05-31 09:10:04', '2017-05-31 14:28:47', '0000-00-00 00:00:00', NULL, '0-0', '9089-13241.124389648', '01:26:21', 21209, '46943549076218912919450614297998', '72679639060953473987003176585947', '0', 0, 20, 8, '2017', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
