(47154, 20256, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Millennium_Ep01_SV_LtRt_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Mikael wordt benaderd door oud-zakenman Henrik Vanger. Veertig jaar geleden is de zestienjarige Harriët Vanger op mysterieuze wijze verdwenen en vermoedelijk vermoord. De zaak is echter nooit opgelost en inmiddels verjaard. Toch wil Henrik Vanger graag dat Mikael zich hier nog eens op stort. Aanvankelijk lijkt het onderzoek nergens op uit te lopen. Totdat Mikael met hulp van Lisbeth op een spoor stuit dat rechtstreeks naar een zeer duister en bloedig familiegeheim voert...\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-07-10 00:00:00', NULL, '2017-07-10 06:19:21', NULL, NULL, 1, '208bd4626f1f1b6fec10960707871ec2', 1, 0, '', '{"144":4664943.39}', 0, 0, NULL, 1, '2017-07-10 06:40:29', '2017-07-10 06:48:39', '0000-00-00 00:00:00', '2017-07-10 06:50:02', '2017-07-10 13:48:27', '0000-00-00 00:00:00', NULL, '0-0', '9406-17932.035329819', '01:29:23', 21291, '88035293673462130691552446859213', '93420748366979897451142511842521', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
