(47156, 20256, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Millennium_Ep03_SV_LtRt_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Drie moorden, één avond. De slachtoffers zijn twee journalisten die voor Millennium werkten aan een publicatie over mensensmokkel, en de voogd van Lisbeth Salander. Op het moordwapen worden de vingerafdrukken aangetroffen van Lisbeth, maar die blijkt onvindbaar. Journalist Mikael Blomkvist, overtuigd van haar onschuld, ontdekt een verband tussen de moorden en het artikel over vrouwenhandel. Salander zelf volgt intussen een spoor naar de mysterieuze bendeleider Zala. Het draait uit op een brutale en bloedige confrontatie met haar verleden...\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-07-10 00:00:00', NULL, '2017-07-10 06:20:43', NULL, NULL, 1, 'd269d2879d38da48991e43c3d3b66664', 1, 0, '', '{"144":4676917.13}', 0, 0, NULL, 1, '2017-07-10 06:40:06', '2017-07-10 06:49:36', '0000-00-00 00:00:00', '2017-07-10 06:50:04', '2017-07-10 15:43:59', '0000-00-00 00:00:00', NULL, '0-0', '9434-30581.074416161', '01:29:36', 21293, '90473028081463427183953947913597', '70424127805913537997371555765567', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
