(47158, 20256, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Millennium_Ep05_SV_LtRt_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Nadat Lisbeth Salander een levensbedreigende aanslag heeft overleefd, wordt ze in kritieke toestand naar het ziekenhuis gebracht, evenals de man die verantwoordelijk is voor haar duistere, pijnlijke verleden : Alexander Zalachenko. Salander wordt gezocht voor moord en door de media is ze neergezet als een psychopaat, moordenaar en satanist. Alleen Blomkvist is overtuigd van haar onschuld. Hij ontdekt de relatie tussen de vrouwenhandel, het verleden van Salander en de Zweedse veiligheidsdienst en wil daarover in zijn blad Millennium publiceren. Vooralsnog vertrouwt Salander niemand en zeker Blomkvist niet, die haar als enige veel te goed kent. Uiteindelijk moet ze voor de rechtbank verschijnen. Zal het recht zegevieren?\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-07-10 00:00:00', NULL, '2017-07-10 06:21:40', NULL, NULL, 1, '31415e86b6cfa88ee7580b08922c0dca', 1, 0, '', '{"144":4630452.28}', 0, 0, NULL, 1, '2017-07-10 06:39:35', '2017-07-10 06:50:40', '0000-00-00 00:00:00', '2017-07-10 06:55:03', '2017-07-10 15:48:28', '0000-00-00 00:00:00', NULL, '0-0', '9341-30023.920203209', '01:28:45', 21295, '37093238503002422906729702286411', '87275452599935006863086184606200', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
