(47162, 20257, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E001-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Op een mooie zomerochtend besluit Nora Linde samen met haar 2 kinderen naar het strand te gaan. Maar hun leuke familie-uitje wordt verstoord wanneer Nora een lichaam op het water ziet drijven. Op het eerste zicht lijkt het een ongeluk, maar volgens inspecteur Thomas Andreasson is er meer aan de hand. Nora denkt informatie te hebben en wil de politie helpen, maar dat ziet haar man Henrik dan weer niet zitten.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:16', NULL, '2017-07-11 10:58:16', NULL, NULL, 1, 'eeb09655187345d8cec4b994779d02e2', 1, 0, '', '{"144":2216936.56}', 0, 0, NULL, 1, '2017-07-17 06:22:20', '2017-07-17 06:27:40', '0000-00-00 00:00:00', '2017-07-17 06:30:03', '2017-07-17 10:04:18', '0000-00-00 00:00:00', NULL, '0-0', '4478-10583.544574738', '00:42:26', 21361, '11494606493164754321671562078532', '41246811369370474237278671961160', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47163, 20257, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E002-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Het onderzoek gaat verder en de politie heeft een verdachte. Nora blijft zich mengen in de zaak, tot ergernis van haar man Henrik. Wanneer ze, geheel toevallig, inspecteur Andreasson tegen het lijf loopt, helpt ze hem opnieuw verder met z\'n onderzoek. En dat leidt tot nieuwe onthullingen in de zaak.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:16', NULL, '2017-07-11 10:58:16', NULL, NULL, 1, '045ce2e6853c2a1183f06fb5c0ed0850', 1, 0, '', '{"144":2305273.81}', 0, 0, NULL, 1, '2017-07-17 06:22:58', '2017-07-17 06:28:11', '0000-00-00 00:00:00', '2017-07-17 06:30:04', '2017-07-17 10:10:53', '0000-00-00 00:00:00', NULL, '0-0', '4651-11015.520235062', '00:44:06', 21362, '33471052128029186342634920382387', '28880815181315286775390222906631', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47164, 20257, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E003-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Henriks ouders kijken uit naar hun 40ste huwelijksverjaardag. Terwijl de voorbereidingen volop aan gang zijn, gaan de kinderen met hun grootouders naar het strand. Maar de feeststemming slaat helemaal om wanneer de kinderen vermist raken. Tijdens de zoekactie wordt een macabere ontdekking gedaan. De inspecteurs zijn verplicht om in hun archieven te graven om weer verder te kunnen met het onderzoek. Ondertussen koestert Nora steeds meer gevoelens voor inspecteur Thomas. Ze gaat te rade bij haar vriendin Signe.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:16', NULL, '2017-07-11 10:58:16', NULL, NULL, 1, '3d6e8cdf62c3b687501808cc1203704d', 1, 0, '', '{"144":2323275.18}', 0, 0, NULL, 1, '2017-07-17 06:23:15', '2017-07-17 06:28:40', '0000-00-00 00:00:00', '2017-07-17 06:30:05', '2017-07-17 10:06:31', '0000-00-00 00:00:00', NULL, '0-0', '4702-10542.069139481', '00:44:34', 21363, '65545426746506322996380063141846', '74051979800019373135295688809789', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47165, 20257, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E004-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Nora Linde heeft iedereen uitgenodigd om vanop haar terras het einde van de \'Round Gotland\' zeilrace te bekijken. Samen met haar gasten kijkt Nora vol spanning toe hoe twee grote jachten strijden om de overwinning. Dat Henrik, Nora\'s echtgenoot, aan boord is van het winnende jacht is natuurlijk reden te meer om te feesten. Iedereen is door het dolle heen, maar het noodlot slaat toe wanneer de kapitein plots neervalt. ', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:17', NULL, '2017-07-11 10:58:17', NULL, NULL, 1, 'e19ca372bf6eed81fbf6dfc59ce9c625', 1, 0, '', '{"144":2270065.38}', 0, 0, NULL, 1, '2017-07-17 06:23:34', '2017-07-17 06:29:33', '0000-00-00 00:00:00', '2017-07-17 06:30:05', '2017-07-17 09:56:37', '0000-00-00 00:00:00', NULL, '0-0', '4576-8662.1426181793', '00:43:21', 21364, '34826200546689110045018563735290', '53224189360957112500417024379934', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47166, 20257, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E005-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Inspecteur Thomas Andreasson en zijn collega Mia Holmgren onderzoeken de moord op de bekende advocaat Oscar Juliander. De man ontving anonieme dreigbrieven en het onderzoek kan alle kanten uit. Worden de brieven verstuurd door zijn familie? Of door een collega van de raad van bestuur van KSSS? Ondertussen lijkt iemand ingetrokken te zijn in het leegstaande huis naast dat van Nora Linde. Henrik weigert onder ogen te zien dat Nora wil scheiden en doet zijn uiterste best om haar op andere gedachten te brengen.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:17', NULL, '2017-07-11 10:58:17', NULL, NULL, 1, '00532c4adc6d5dadb6d58e9de817b59a', 1, 0, '', '{"144":2304086.84}', 0, 0, NULL, 1, '2017-07-17 06:23:46', '2017-07-17 06:30:26', '0000-00-00 00:00:00', '2017-07-17 06:35:03', '2017-07-17 09:51:45', '0000-00-00 00:00:00', NULL, '0-0', '4646-8014.4978609085', '00:44:02', 21365, '89382473586244914685382052445132', '36553240415311402534294281306789', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47167, 20257, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E006-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Wanneer nog een KSSS-bestuurslid wordt vermoord zoekt de politie een link tussen de twee moorden. Heeft iemand het gemunt op de raad of is er een ander motief in het spel? Gaat het om dezelfde dader? Nora raakt, als juriste bij de bank, betrokken bij het onderzoek en beseft dat ze dichter bij de dader staat dan ze vermoedde. Ondertussen twijfelt Henrik nog steeds over het finaliseren van de echtscheiding, maar hij beseft wel dat hij Nora waarschijnlijk niet meer terug kan winnen.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:17', NULL, '2017-07-11 10:58:17', NULL, NULL, 1, 'dedaeedfd0cbd8920d5bffb550d1de2b', 1, 0, '', '{"144":2289776.28}', 0, 0, NULL, 1, '2017-07-17 06:24:00', '2017-07-17 06:30:39', '0000-00-00 00:00:00', '2017-07-17 06:35:04', '2017-07-17 10:44:01', '0000-00-00 00:00:00', NULL, '0-0', '4637-8288.5223608017', '00:43:58', 21366, '15491295825354546301929336352697', '19353006514382041840766070905186', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47168, 20257, NULL, 'Aflevering_7.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E007-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Spelende kinderen doen in het bos een macabere ontdekking. Inspecteur Thomas Andreasson en zijn collega Mia Holmgren vermoeden dat deze zaak gelinkt is aan de verdwijning van een jong meisje een jaar eerder. Zou de gevonden arm van haar kunnen zijn? Het onderzoek gaat verder, maar de aanwijzingen liggen niet dik bezaaid.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:18', NULL, '2017-07-11 10:58:18', NULL, NULL, 1, '245f51ac69a8f9b4e2b16052b832a1f6', 1, 0, '', '{"144":2283349.46}', 0, 0, NULL, 1, '2017-07-17 06:24:11', '2017-07-17 06:31:56', '0000-00-00 00:00:00', '2017-07-17 06:35:04', '2017-07-17 12:45:58', '0000-00-00 00:00:00', NULL, '0-0', '4604-8709.6496648788', '00:43:36', 21367, '40720653897002966897317722829678', '10637492566143389897438717311470', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47169, 20257, NULL, 'Aflevering_8.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E008-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'Opnieuw raakt een jong meisje vermist. Haar fiets wordt gevonden bovenop de klif en iedereen vreest meteen het ergste. Nora denkt een spoor te hebben dat van belang kan zijn bij het onderzoek. Nora’s privéleven staat ook niet stil: Thomas heeft een afspraak gehad met z\'n ex-vrouw en Nora voelt zich aangetrokken tot haar zeilinstructeur.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:18', NULL, '2017-07-11 10:58:18', NULL, NULL, 1, '36fa774e2070c58cdc2ddb03d8645356', 1, 0, '', '{"144":2263957.84}', 0, 0, NULL, 1, '2017-07-17 06:24:27', '2017-07-17 06:31:38', '0000-00-00 00:00:00', '2017-07-17 06:35:05', '2017-07-17 12:58:05', '0000-00-00 00:00:00', NULL, '0-0', '4567-8677.6136922836', '00:43:17', 21368, '31678011494684048912707166502443', '17104073150351406319513567115865', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47170, 20257, NULL, 'Aflevering_9.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S001E009-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Inspectrice Mia Holmgren wordt neergeslagen. Is het dezelfde dader als degene die achter de verdwijning van de twee meisjes zit? De politie doet echter nog meer lugubere ontdekkingen. En er zijn verschillende verdachten zonder sluitend alibi. Nora raakt nu ook persoonlijk betrokken bij het onderzoek.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:18', NULL, '2017-07-11 10:58:18', NULL, NULL, 1, 'cf911f83947bf6be88b36a02b5512288', 1, 0, '', '{"144":2254893.36}', 0, 0, NULL, 1, '2017-07-17 06:24:46', '2017-07-17 06:32:29', '0000-00-00 00:00:00', '2017-07-17 06:35:06', '2017-07-17 13:18:09', '0000-00-00 00:00:00', NULL, '0-0', '4562-9190.6119127274', '00:43:16', 21369, '99801456565902207562277477891658', '22437072451070360736342974382400', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47171, 20257, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S002E001-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'De idyllische zomer in Sandhamn wordt brutaal verstoord wanneer student Marcus Nielsen dood wordt aangetroffen. Zijn moeder gelooft in geen geval in zelfmoord. Detective Thomas Andreasson en zijn partner Mia Holmgren onderzoeken de zaak in samenwerking met de lokale politie en ontdekken een link met de universiteit waar Marcus studeerde. De rector wordt ondervraagd maar lijkt meer te weten dan hij op het eerste zicht wilt lossen…', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:19', NULL, '2017-07-11 10:58:19', NULL, NULL, 1, '2f843a53f189c8c1e267615f76689e85', 1, 0, '', '{"144":2297728.36}', 0, 0, NULL, 1, '2017-07-17 06:25:15', '2017-07-17 06:32:38', '0000-00-00 00:00:00', '2017-07-17 06:35:07', '2017-07-17 13:07:18', '0000-00-00 00:00:00', NULL, '0-0', '4632-8158.6273822784', '00:43:53', 21370, '96813883690837006263978644038871', '82332303592186026676769274125286', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47172, 20257, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S002E002-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Thomas en Mia zetten hun onderzoek verder. Marcus, die psychologie studeerde, bleek verschillende afspraken te hebben gemaakt met ex-mariniers. Hij wilde met hen praten over groepspsychologie en hun tijd bij de special forces. Alle sporen lijken te leiden naar een groep commando’s die in de jaren ’80 hun training afgerond hebben. Hebben zij iets te verbergen?', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:19', NULL, '2017-07-11 10:58:19', NULL, NULL, 1, 'c3764ab3fed8fbf556c87fdeaea744a9', 1, 0, '', '{"144":2316080.22}', 0, 0, NULL, 1, '2017-07-17 06:25:27', '2017-07-17 06:33:45', '0000-00-00 00:00:00', '2017-07-17 06:35:07', '2017-07-17 13:15:57', '0000-00-00 00:00:00', NULL, '0-0', '4665-8613.4606246948', '00:44:14', 21371, '20668400785169072894202406713293', '82819937851672177613712251577044', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47173, 20257, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S002E003-V2_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Thomas en Mia proberen alle mariniers te vinden die in het onderzoek genoemd worden. Al snel blijkt dat de officier Cronwall vermist is. Uit gesprekken met zijn verdrietige vrouw, blijkt dat Cronwall toch gesproken had met Marcus. Het onderzoek leidt terug naar Korsö, waar de opwindende achtervolging op de moordenaar zijn finale ontknoping kent…', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:19', NULL, '2017-07-11 10:58:19', NULL, NULL, 1, '14cb4025dd2c4c63b76f1f5795e293eb', 1, 0, '', '{"144":2304005.31}', 0, 0, NULL, 1, '2017-07-17 06:25:41', '2017-07-17 06:34:34', '0000-00-00 00:00:00', '2017-07-17 06:35:08', '2017-07-17 13:31:21', '0000-00-00 00:00:00', NULL, '0-0', '4660-7971.5295209885', '00:44:09', 21372, '83374068922362552267859742712273', '28656222473869013206419371195761', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47174, 20257, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S002E004-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Midzomerweekend in Sandhamn. Jonge mensen feesten er op los, de muziek knalt uit de boxen en de alcohol vloeit rijkelijk. Sandhamn wordt echter wakker met een geweldige kater wanneer een toerist de volgende dag tijdens het zwemmen het lijk van een tiener vindt op een rotspunt. Inspecteur Thomas Andreasson onderzoekt de zaak met Mia Holmgren, maar het wordt er niet eenvoudiger op wanneer alle getuigen een ander verhaal vertellen.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:20', NULL, '2017-07-11 10:58:20', NULL, NULL, 1, '7314392b54a1e2534396137849028a07', 1, 0, '', '{"144":2280651.48}', 0, 0, NULL, 1, '2017-07-17 06:25:58', '2017-07-17 06:35:45', '0000-00-00 00:00:00', '2017-07-17 06:40:02', '2017-07-17 14:42:17', '0000-00-00 00:00:00', NULL, '0-0', '4609-9209.8317546844', '00:43:40', 21373, '57920102998800239227072000565483', '94547554653321896092818231410977', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47175, 20257, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S002E005-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Inspecteur Thomas Andreasson en Mia Holmgren zetten hun onderzoek verder en het wordt steeds duidelijker dat één van de jongeren bewust liegt.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:20', NULL, '2017-07-11 10:58:20', NULL, NULL, 1, 'f5baaf0afe419681731ec3d30dafd954', 1, 0, '', '{"144":2300278.89}', 0, 0, NULL, 1, '2017-07-17 06:26:12', '2017-07-17 06:34:44', '0000-00-00 00:00:00', '2017-07-17 06:35:08', '2017-07-17 14:32:26', '0000-00-00 00:00:00', NULL, '0-0', '4651-8184.5475387573', '00:44:04', 21374, '37696579547775824642597780220890', '31915788005029425876105814271486', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47176, 20257, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TheSandhamnMurders-S002E006-V1_sv_20_LtRt_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Thomas en Mia krijgen een nieuwe tip in de zoektocht naar Victors moordenaar: een stukje stof van een reflecterende politiejas wordt gevonden nabij de plaats van de moord. Is het mogelijk dat een politieagent met de zaak te maken heeft? Tijdens de ondervragingen komt naar boven dat Victors beste vriend Tobbe ter plaatse was op het moment van de moord, en dat Victor samen met Felicia drugs had genomen. Ondertussen worden Victors vader en moeder radeloos en dreigen ze zelf initiatief te nemen.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:20', NULL, '2017-07-11 10:58:20', NULL, NULL, 1, 'bce0a32a3e9c97452437b7e63a04eddc', 1, 0, '', '{"144":2322517.19}', 0, 0, NULL, 1, '2017-07-17 06:26:28', '2017-07-17 06:35:38', '0000-00-00 00:00:00', '2017-07-17 06:40:03', '2017-07-17 14:44:40', '0000-00-00 00:00:00', NULL, '0-0', '4693-8410.1488389969', '00:44:28', 21375, '26053604638128440125502624078234', '39413529653012798609812023714870', '0', 0, 20, 8, '2015', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
