(47178, 20258, NULL, 'BORGEN.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/20min_Borgen_S01E01.mp4', '', 3060, 0, 0, 0, ' BORGEN GRATIS 20min', 'Bekijk gratis de eerste 20 minuten. ', '2017-07-12', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:21', 3365, '2017-08-09 07:11:03', NULL, NULL, 1, '19d0170c5a9f7120fdcb2c34e9373f68', 1, 0, '', '{"144":698912.16}', 0, 0, NULL, 1, '2017-07-12 06:20:28', '2017-07-12 06:22:55', '0000-00-00 00:00:00', '2017-07-12 06:25:02', '2017-07-12 07:31:58', '0000-00-00 00:00:00', NULL, '0-0', '2127-2807.6931915283', '00:20:02', 21333, '59505506344223796425733190617088', '80202252194029444375052179365188', '0', 0, 20, 8, '2010', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47179, 20258, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E01_da.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Birgitte Nyborg is de charismatische voorzitter van de ietwat saaie Deense centrumpartij De Gematigden. Kort voor de verkiezingen krijgt ze van haar PR-adviseur Kasper Juul compromitterende informatie over haar belangrijkste opponent: de zittende premier Lars Hesselboe. Juul heeft die informatie te pakken gekregen via zijn ex-vriendin, de journaliste en tv-presentatrice Katrine Fönsmark. Die heeft nu een relatie met Hasselboe\'s PR-man Ole Dahl. Nyborg wil het bezwarende nieuws niet gebruiken in haar campagne en daarom trekt Juul ermee naar Michael Laugesen, de leider van de socialistische oppositiepartij.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:21', NULL, '2017-07-11 10:58:21', NULL, NULL, 1, '46604b5a2dc5852fd0733df3fb8e88c7', 1, 0, '', '{"144":3043343.58}', 0, 0, NULL, 1, '2017-07-12 06:20:19', '2017-07-12 06:26:51', '0000-00-00 00:00:00', '2017-07-12 06:30:03', '2017-07-12 10:02:40', '0000-00-00 00:00:00', NULL, '0-0', '6163-8835.3331480026', '00:58:28', 21303, '37036223742140654933334791001474', '53965941091143233062109158451537', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47180, 20258, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E02_da.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Birgitte Nyborg heeft met haar gematigde partij de verkiezingen gewonnen en wordt aangeduid als \'koninklijk verkenner\' om een coalitie voor te bereiden. Spanningen, intriges en politieke spelletjes ondermijnen haar inspanningen en haar regering lijkt al tot mislukken gedoemd nog voor ze is samengesteld. Journaliste Katrine Fönsmark zit in zak en as na de dood van haar vriend, politiek adviseur Ole Dahl, en de verstrekkende gevolgen daarvan voor het politieke landschap in Denemarken. Toch blijft ze zich koppig vastbijten in haar werk. Kasper Juul, voormalig adviseur van Nyborg, dreigt na zijn werk ook zijn greep op de werkelijkheid te verliezen. De begrafenis van Ole Dahl kent een vreemd verloop.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:21', NULL, '2017-07-11 10:58:21', NULL, NULL, 1, 'f4bb62e0c04206fbb517a106e1357dd2', 1, 0, '', '{"144":3017078.04}', 0, 0, NULL, 1, '2017-07-12 06:20:48', '2017-07-12 06:26:57', '0000-00-00 00:00:00', '2017-07-12 06:30:03', '2017-07-12 10:09:13', '0000-00-00 00:00:00', NULL, '0-0', '6107-8790.0273160934', '00:57:59', 21304, '93268785373178416263322504691631', '28895411825640236453996794970640', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47181, 20258, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E03_da.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Birgitte Nyborg staat na enkele maanden als premier voor haar eerste grote test: de begroting door het parlement krijgen. Maar net voor de finale stemming trekken enkele linkse parlementsleden plots hun steun in. De kerstvakantie met de familie dreigt in het water te vallen. Ondertussen heeft Nyborgs vroegere tegenstander Laugesen een nieuwe job als hoofdredacteur van een tabloidkrant. Het geeft hem volop de gelegenheid om Birgitte het vuur aan de schenen te leggen en roddels te verspreiden. Birgitte staat machteloos en besluit raad te vragen aan haar voormalige adviseur Kasper Juul. Die heeft wel een plannetje klaar. Journaliste Katrine Fönsmark is nog niet bekomen van de dood van haar minnaar, maar krijgt al een nieuw shock te verwerken.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:22', NULL, '2017-07-11 10:58:22', NULL, NULL, 1, '0b2197e2d0e22854d80d72d110c22e5f', 1, 0, '', '{"144":3029684.14}', 0, 0, NULL, 1, '2017-07-12 06:21:02', '2017-07-12 06:27:54', '0000-00-00 00:00:00', '2017-07-12 06:30:04', '2017-07-12 10:07:07', '0000-00-00 00:00:00', NULL, '0-0', '6135-8789.3266487122', '00:58:14', 21305, '67379320416310768372853323755987', '71256427358107727724297684451246', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47182, 20258, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E04_da.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Birgitte Nyborgs regering is honderd dagen aan de macht, maar de wittebroodsweken zijn lang voorbij. Al helemaal wanneer uitlekt dat het Amerikaanse leger gebruik maakt van een basis op Groenland voor het transport van krijgsgevangen. Het is Katrine Fönsmark die het nieuws uitbrengt, nadat zij is gecontacteerd door een anonieme bron. Zij belandt prompt in een bijzonder lastige situatie en komt zelfs in conflict met haar eigen hoofdredacteur. Birgitte staat ook onder zware druk. Er wordt stevig op haar ingepraat om het onfrisse dossier snel en krachtdadig te sluiten en de Amerikaanse operatie verder in de doofpot te houden. Zij besluit echter haar eigen weg te gaan.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:22', NULL, '2017-07-11 10:58:22', NULL, NULL, 1, '993543ca441bef2395ed92533ad51f96', 1, 0, '', '{"144":3028401.95}', 0, 0, NULL, 1, '2017-07-12 06:21:20', '2017-07-12 06:29:11', '0000-00-00 00:00:00', '2017-07-12 06:30:05', '2017-07-12 10:04:27', '0000-00-00 00:00:00', NULL, '0-0', '6135-8242.1386003494', '00:58:14', 21306, '89222135630515737133393273879051', '66457920075430479946216077629582', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47183, 20258, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E05_da.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Met de hulp van haar minister van Handel en Industrie stelt Birgitte Nyborg een ophefmakend regeringsbesluit voor. Voortaan moeten er in de raad van bestuur van elk Deens bedrijf een welbepaald aantal vrouwen zetelen. Het voorstel stuit op veel verzet, zowel binnen als buiten de regering. De machtigste zakenman van het land stelt Birgitte een ultimatum dat zware gevolgen kan hebben. De media focussen intussen op haar privéleven. Zij krijgt af te rekenen met een moreel dilemma. Kiest zij voor haar regering, of voor haar echtgenoot? Ook haar adviseur, Kasper Juul, krijgt het moeilijk. Zijn turbulente liefdesleven lijkt hem dan toch zuur te gaan opbreken.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:22', NULL, '2017-07-11 10:58:22', NULL, NULL, 1, '43829cbde6a6862b0f13133736da5c0c', 1, 0, '', '{"144":3052368.02}', 0, 0, NULL, 1, '2017-07-12 06:21:35', '2017-07-12 06:29:56', '0000-00-00 00:00:00', '2017-07-12 06:30:05', '2017-07-12 10:08:48', '0000-00-00 00:00:00', NULL, '0-0', '6177-8231.0340270996', '00:58:37', 21307, '47159541729525237308246456491966', '62795849825755346764295354323018', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47184, 20258, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E06_da.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Birgitte Nyborg en haar regering maken zich op voor een staatsbezoek met een commercieel zeer belangrijke bonus. De president van een voormalige Sovjetrepubliek maakt zijn plannen bekend om volop te investeren in Deense windturbinetechnologie. Hij laat echter ook verstaan dat de deal enkel doorgaat als een tegenstander van zijn beleid gearresteerd wordt, die zich net dan in Denemarken bevindt. Eens te meer staat Birgitte voor een moreel dilemma. Thuis is haar al evenmin rust gegund. Haar vader komt zwaar in aanvaring met Phillip.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:23', NULL, '2017-07-11 10:58:23', NULL, NULL, 1, '4f7d9961def7929f575ad0b78fc17672', 1, 0, '', '{"144":3053463.74}', 0, 0, NULL, 1, '2017-07-12 06:21:54', '2017-07-12 06:30:52', '0000-00-00 00:00:00', '2017-07-12 06:35:02', '2017-07-12 10:17:31', '0000-00-00 00:00:00', NULL, '0-0', '6186-8372.6579437256', '00:58:40', 21308, '52638463897528593894575286908308', '58074077100579859257642924305510', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47185, 20258, NULL, 'Aflevering_7.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E07_da.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Er wordt afluisterapparatuur ontdekt in de kantoren van de extreemlinkse Solidariteitspartij. Een schandaal dat de vriendschap van Birgitte Nyborg met de voorzitster van die partij onder druk zet. Maar er is meer. Birgitte bijt zich vast in het dossier en is geschokt door wat zij ontdekt. Ze moet bovendien vaststellen dat haar minister van justitie, Troels Höxenhaven, heel andere ideeën heeft over hoe deze zaak moet worden aangepakt. Birgitte krijgt het ook steeds moeilijker om haar gezin tevreden te houden. Katrine Fönsmark staat voor een moeilijke beslissing.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:23', NULL, '2017-07-11 10:58:23', NULL, NULL, 1, '7d168049ed61786069c9849e44aa9699', 1, 0, '', '{"144":2877364.04}', 0, 0, NULL, 1, '2017-07-12 06:22:11', '2017-07-12 06:31:12', '0000-00-00 00:00:00', '2017-07-12 06:35:03', '2017-07-12 13:07:20', '0000-00-00 00:00:00', NULL, '0-0', '5836-8106.3822755814', '00:55:21', 21309, '50432308548156588497196376945670', '30257209155628255917295482350947', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47186, 20258, NULL, 'Aflevering_8.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E08_da.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'De rustige politieke zomer wordt lelijk verstoord wanneer de gewezen kandidaat-premier Michael Laugesen een spraakmakend boek publiceert. Over zijn leven in de politiek, maar ook over dat van anderen. En het beeld dat hij schetst, is niet altijd even fraai. Kasper Juul ontdekt intussen dat hij niet op de vlucht kan blijven voor zijn verleden en voor het geheim dat hem kwelt. Birgitte Nyborg probeert het goed te maken met haar gezin door Phillip en de kinderen te verrassen met een vakantie in het officiële buitenverblijf van de premier. Al haar goede bedoelingen worden echter al snel belemmerd door het beklemmende protocol.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:23', NULL, '2017-07-11 10:58:23', NULL, NULL, 1, 'baf0353461042119372ff1b4ec01cff6', 1, 0, '', '{"144":2961525.85}', 0, 0, NULL, 1, '2017-07-12 06:22:30', '2017-07-12 06:32:29', '0000-00-00 00:00:00', '2017-07-12 06:35:03', '2017-07-12 13:20:41', '0000-00-00 00:00:00', NULL, '0-0', '6004-8223.2733831406', '00:56:58', 21310, '89744539142893769733973577036229', '35077760137421945372514376136443', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47187, 20258, NULL, 'Aflevering_9.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E09_da.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Minister van Defensie Hans Christian Thorsen heeft een contract onderhandeld over de aankoop van nieuwe gevechtsvliegtuigen voor het Deense leger. Op het eerste gezicht lijkt het een waterdicht dossier, maar dan komen er details aan het licht die een aantal politici in nauwe schoentjes brengen. De media gaan er genadeloos op door en nemen ook de regering op de korrel. Birgitte Nyborg probeert alles persoonlijk onder controle te houden, zowel in haar regering als in haar gezin. Ze dreigt daarvoor een hoge prijs te moeten betalen. De vreugde om Phillips nieuwe baan als CEO van een belangrijk bedrijf slaat om in een crisissituatie wanneer blijkt dat het een tijdbom is onder Birgittes positie als eerste minister. Katrine Fönsmark komt opnieuw zwaar in aanvaring met haar hoofdredacteur bij TV1.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:24', NULL, '2017-07-11 10:58:24', NULL, NULL, 1, '7f6401a2da5927d2c2fe3b6b946a9f37', 1, 0, '', '{"144":3059292.35}', 0, 0, NULL, 1, '2017-07-12 06:22:53', '2017-07-12 06:32:18', '0000-00-00 00:00:00', '2017-07-12 06:35:04', '2017-07-12 13:32:36', '0000-00-00 00:00:00', NULL, '0-0', '6200-8453.8945178986', '00:58:49', 21311, '25856204885800388068333652406101', '59195251359637471070853734581984', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47188, 20258, NULL, 'Aflevering_10.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S01E10_da.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Bij het begin van het nieuwe politieke jaar komt premier Birgitte Nyborg zwaar onder druk te staan. De opiniepeilingen geven aan dat haar populariteit steeds verder daalt, de media spitten almaar dieper in haar privéleven en de Arbeiderspartij eist meer invloed in de regering. Haar premierschap is in gevaar, haar regering staat op springen en haar huwelijk hangt aan een zijden draadje. Hoe kan Birgitte zich hieruit redden? Kasper Juul moet zoveel bressen tegelijk dichten dat hij geen andere keuze heeft dan een deal te maken die grotere gevolgen heeft dan hij op dat moment kan vermoeden. Katrine krijgt de kans om haar oude job bij TV1 opnieuw op te nemen.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:24', NULL, '2017-07-11 10:58:24', NULL, NULL, 1, '9c1905521e41acf1fcb24a248447ed22', 1, 0, '', '{"144":3075569.49}', 0, 0, NULL, 1, '2017-07-12 06:23:12', '2017-07-12 06:34:17', '0000-00-00 00:00:00', '2017-07-12 06:35:05', '2017-07-12 13:32:04', '0000-00-00 00:00:00', NULL, '0-0', '6228-8438.8901329041', '00:59:07', 21312, '31982255659533598020757399019609', '39560118382669403720126441243456', '0', 0, 20, 8, '2010', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47189, 20258, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E01_da.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Na twee jaar aan het hoofd van de regering is het huwelijk van Nyborg op de klippen gelopen en moet ze het als alleenstaande moeder redden. Als politica heeft ze het respect van vriend en vijand gewonnen, maar de spanningen tussen de partijen nemen toe. Nyborg gaat op bezoek bij de Deense troepen in Afghanistan. Een incident daar brengt haar in een lastig parket. Katrine Fønsmark werkt ondertussen als sterjournalist voor de tabloid Ekspres, waar de hoofdredacteur Michael Laugesen haar journalistieke moraal op de proef stelt. De rusteloze Kasper Juul is nog altijd Nyborgs spindokter. Privé probeert hij zijn innerlijke demonen te bezweren en te verhinderen dat ze zijn relatie met zijn nieuwe vriendin Lotte hypothekeren.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:24', NULL, '2017-07-11 10:58:24', NULL, NULL, 1, 'de6ddd41822944b7a1c6f82769b53fa6', 1, 0, '', '{"144":3047875.21}', 0, 0, NULL, 1, '2017-07-12 06:23:37', '2017-07-12 06:33:58', '0000-00-00 00:00:00', '2017-07-12 06:35:06', '2017-07-12 13:35:06', '0000-00-00 00:00:00', NULL, '0-0', '6177-8915.3758029938', '00:58:39', 21313, '86722679384660984039560059826391', '59436413308962084466731748958761', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47190, 20258, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E02_da.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Minister Nyborg moet een nieuwe Europese Commissaris aanduiden. Haar vroegere mentor Sejrö is een voor de hand liggende keuze, maar de man weigert omdat hij voelt dat ze van hem af wil. Dat leidt tot een tactisch machtsspel met grote gevolgen. Kasper maakt zich klaar om met zijn vriendin Lotte in te trekken in zijn chique nieuwe appartement aan zee. Maar zijn verleden met Katrine blijft hem parten spelen.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:24', NULL, '2017-07-11 10:58:24', NULL, NULL, 1, '72abde3bc8e85397733b3f40f0bb3649', 1, 0, '', '{"144":2929852.37}', 0, 0, NULL, 1, '2017-07-12 06:24:12', '2017-07-12 06:34:54', '0000-00-00 00:00:00', '2017-07-12 06:35:06', '2017-07-12 13:36:42', '0000-00-00 00:00:00', NULL, '0-0', '5939-8515.2362794876', '00:56:21', 21314, '16444990167938965396350858134956', '77646267706623559588820641210958', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47191, 20258, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E03_da.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'De regering Nyborg bereidt een nieuw hervormingsplan voor: \'Een gezamenlijke toekomst\'. Het wordt voorgesteld op een politiek congres. Maar er groeit onrust bij de socialisten wanneer partijleider Björn Marrot onder vuur komt te liggen in de media. Birgitte voelt dat er een rebellie aan het broeien is en het congres eindigt in chaos. Ondertussen staat Birgitte ook op het thuisfront onder druk: Phillip heeft namelijk een nieuwe vriendin. Katrine volgt het congres voor Laugesen, die een eigen agenda heeft.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:25', NULL, '2017-07-11 10:58:25', NULL, NULL, 1, 'a727afed2900c4a8b9d5d393a691419a', 1, 0, '', '{"144":3007350.28}', 0, 0, NULL, 1, '2017-07-12 06:25:14', '2017-07-12 06:35:40', '0000-00-00 00:00:00', '2017-07-12 06:40:03', '2017-07-12 15:47:54', '0000-00-00 00:00:00', NULL, '0-0', '6093-8397.8872337341', '00:57:49', 21315, '80593459433353398166258564489553', '54447483271873717971057549872049', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47192, 20258, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E04_da.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Voor de kust van Somalië wordt een Deens schip gekaapt. Troels Höxenhaven, de nieuwe socialistische minister van Buitenlandse Zaken, maakt van het incident gebruik om zich volop te profileren. Kasper waarschuwt Birgitte dat ze zich het gras voor de voeten laat wegmaaien door Höxenhaven. Wat zelfs hij niet weet, is dat Expres compromitterende foto\'s van Höxenhaven in zijn bezit heeft. Hoofdredacteur Laugesen wil ze direct publiceren, maar Katrine vertrouwt het zaakje niet. Het persoonlijke leven van Birgitte ligt aan duigen en ze maakt een fout die haar carrière op het spel zet.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:25', NULL, '2017-07-11 10:58:25', NULL, NULL, 1, '86ccaeb1916edf1e0a6ef55a9165006b', 1, 0, '', '{"144":3076668.62}', 0, 0, NULL, 1, '2017-07-12 06:25:22', '2017-07-12 06:37:09', '0000-00-00 00:00:00', '2017-07-12 06:40:03', '2017-07-12 16:30:23', '0000-00-00 00:00:00', NULL, '0-0', '6233-8430.8218698502', '00:59:10', 21316, '80987645666370806494586962418786', '53980334944009685628524676266983', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47193, 20258, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E05_da.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Het kabinet Nyborg onderhandelt het milieuluik van zijn grote hervormingsplan \'Een gezamenlijke toekomst\'. Birgitte wil een algemeen akkoord over de partijen heen, maar moet vaststellen dat sommige partijen geen compromissen willen of kunnen sluiten. Kasper weet haar te overtuigen op een andere manier aan een meerderheid te geraken, maar dat heeft verstrekkende gevolgen voor de eenheid in de regering. Katrine krijgt een ongewone werkaanbieding die haar persoonlijke integriteit op de proef stelt. Birgittes familieleven lijdt onder haar werkstress. Vooral Laura worstelt met de afwezigheid van haar moeder.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:25', NULL, '2017-07-11 10:58:25', NULL, NULL, 1, 'de40ab56f135491a151137dacdbf5bd5', 1, 0, '', '{"144":3080950.79}', 0, 0, NULL, 1, '2017-07-12 06:25:30', '2017-07-12 06:37:37', '0000-00-00 00:00:00', '2017-07-12 06:40:04', '2017-07-12 17:03:06', '0000-00-00 00:00:00', NULL, '0-0', '6247-9057.9844751358', '00:59:16', 21317, '19105394865583612204149726417596', '15955884166572283765717597713647', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0);
