(47194, 20258, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E06_da.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'De regering Nyborg heeft de exit van de Groenen nog nauwelijks verwerkt en daar kondigen zich alweer nieuwe spanningen aan, deze keer aan de rechterzijde. Svend Åge Madsen dient een wetsvoorstel in om de leeftijd om criminele jongeren als volwassenen te berechten, van 14 te laten zakken tot 12. Het is een kwestie die een wig drijft tussen het hele politieke systeem, want ook een aantal socialisten steunen het voorstel. Ondertussen herstelt Laura van haar paniekaanval, maar Birgitte weigert onder ogen te zien dat haar dochter psychische problemen heeft.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:26', NULL, '2017-07-11 10:58:26', NULL, NULL, 1, 'eb83113e6503dd70bd02f04ce320abb5', 1, 0, '', '{"144":3031064.91}', 0, 0, NULL, 1, '2017-07-12 06:25:49', '2017-07-12 06:39:46', '0000-00-00 00:00:00', '2017-07-12 06:40:05', '2017-07-12 17:03:44', '0000-00-00 00:00:00', NULL, '0-0', '6121-8594.9882135391', '00:58:05', 21318, '56410369055866011477215211538791', '96044735329948914587686550836217', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47195, 20258, NULL, 'Aflevering_7.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E07_da.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Het kabinet Nyborg verliest aan slagkracht. De regering is verdeeld door interne twisten en slaagt er alleen nog in om compromismaatregelen te treffen. De opiniepeilingen staan op negatief voor de partij van Birgitte. Maar net op dat moment komt financier Joachim Crohne haar een voorstel doen om haar populariteit weer op te krikken en tegelijkertijd de reputatie van Denemarken in het buitenland te verbeteren. Maar is de man wel te vertrouwen? Ondertussen groeien Kasper en Katrine opnieuw naar elkaar toe. Maar professioneel hebben ze tegenstrijdige belangen: Katrine moet geheimen onthullen en Kasper moet ze verborgen houden.', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:26', NULL, '2017-07-11 10:58:26', NULL, NULL, 1, 'dabdf0d03b925257862f740c70d2f383', 1, 0, '', '{"144":3013204.01}', 0, 0, NULL, 1, '2017-07-12 06:25:57', '2017-07-12 06:39:50', '0000-00-00 00:00:00', '2017-07-12 06:40:05', '2017-07-12 17:01:00', '0000-00-00 00:00:00', NULL, '0-0', '6107-8638.3185119629', '00:57:58', 21319, '36947884404063647056137861847932', '22921600175846203293311943879449', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47196, 20258, NULL, 'Aflevering_8.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E08_da.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'De ogen van de wereld zijn op Kopenhagen en Birgitte Nyborg gericht tijdens de vredesgesprekken tussen Noord- en Zuid-Kharun. Iedereen werkt de klok rond en Kasper ziet Katrine nauwelijks, al wonen ze nu samen. Birgitte realiseert zich dat Denemarken maar een klein radertje is in het internationale machtsspel, maar zet alles op alles om tot een resultaat te komen. Kan zij een einde maken aan de bloedige burgeroorlog?', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:26', NULL, '2017-07-11 10:58:26', NULL, NULL, 1, 'fa4008c29cdee27e16c79c7a7e40ecd8', 1, 0, '', '{"144":2985552.82}', 0, 0, NULL, 1, '2017-07-12 06:26:06', '2017-07-12 06:41:51', '0000-00-00 00:00:00', '2017-07-12 06:45:03', '2017-07-12 16:53:36', '0000-00-00 00:00:00', NULL, '0-0', '6051-8237.0572910309', '00:57:27', 21320, '23770427321393964411126313612348', '39523153842441976727812249113997', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47197, 20258, NULL, 'Aflevering_9.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E09_da.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Laura\'s toestand is erg verslechterd in de voorbij maanden en Birgitte voelt zich schuldig omdat ze dat niet eens heeft gezien. Laura\'s psychiater stelt voor om haar te laten opnemen in een privékliniek. Birgitte en Phillip gaan daarmee akkoord. Maar het dreigt financieel een zware dobber te worden, want door de fiscale hervormingen die de Birgitte zelf heeft doorgevoerd, moet ze de volledige medische factuur zelf betalen. De problemen met Laura brengen Birgitte en Phillip weer dichter bij elkaar, ondanks Phillips relatie met Cecilie.\n', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:27', NULL, '2017-07-11 10:58:27', NULL, NULL, 1, '7a33a60c9b08b1ccb1864427d9d9af31', 1, 0, '', '{"144":3077233.28}', 0, 0, NULL, 1, '2017-07-12 06:26:58', '2017-07-12 06:42:55', '0000-00-00 00:00:00', '2017-07-12 06:45:04', '2017-07-12 18:53:30', '0000-00-00 00:00:00', NULL, '0-0', '6242-8812.4964380264', '00:59:14', 21321, '77250368526588103272192180962885', '22730362390960394329520723890305', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47198, 20258, NULL, 'Aflevering_10.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S02E10_da.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Birgitte heeft een maand vrijaf genomen als premier om zich helemaal aan haar familie te wijden. Hans-Christian Thorsen, de partijleider van de socialisten, brengt zichzelf in stelling als haar mogelijke opvolger. Birgitte twijfelt of ze al dan niet zal terugkeren. Kasper en Katrine zijn op huizenjacht, maar hun relatie dreigt te vertroebelen door een discussie over de vraag of ze al dan niet kinderen willen. Zal één van hen toegeven?', NULL, 1, 2, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:27', NULL, '2017-07-11 10:58:27', NULL, NULL, 1, 'd04beca1616f92edb95fe79c395756fa', 1, 0, '', '{"144":3028543.94}', 0, 0, NULL, 1, '2017-07-12 06:27:10', '2017-07-12 06:42:09', '0000-00-00 00:00:00', '2017-07-12 06:45:04', '2017-07-12 19:33:28', '0000-00-00 00:00:00', NULL, '0-0', '6135-8811.3061599731', '00:58:16', 21322, '78101090627916642127256391723447', '63266755729417119803469312299232', '0', 0, 20, 8, '2011', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47199, 20258, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E01_da.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'De voormalige Deense premier Birgitte Nyborg heeft de politiek verlaten en vertoeft nu in de hoogste zakelijke kringen. Toch stelt ze met pijn in het hart vast dat de huidige leider van de Gematigde Partij, haar vroegere kroonprins Jakob Kruse, steeds verder opschuift naar rechts en aanschurkt bij de conservatieve regeringspartij van premier Lars Hesselboe. Tijdens een toespraak voor een groep Deense zakenlui wordt het haar te veel en zegt ze wat ze denkt over die evolutie. En ze neemt meteen een belangrijk besluit: ze wil terugkeren naar de politiek. Birgitte contacteert Kruse, maar die ziet haar liever niet komen. Daarop vraagt ze aan journaliste Katrine Fønsmark om haar woordvoerster te worden.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:27', NULL, '2017-07-11 10:58:27', NULL, NULL, 1, '4434510da6f777ce53a98936d874b600', 1, 0, '', '{"144":2960001.33}', 0, 0, NULL, 1, '2017-07-12 06:27:46', '2017-07-12 06:42:40', '0000-00-00 00:00:00', '2017-07-12 06:45:05', '2017-07-12 20:04:13', '0000-00-00 00:00:00', NULL, '0-0', '6009-8358.9462852478', '00:57:01', 21323, '11620901748172330683912428877060', '40492466093716218454379840642553', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47200, 20258, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E02_da.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Na haar nederlaag in de verkiezingen voor het voorzitterschap van de partij, gaat Birgitte in het geheim door met haar nieuwe politieke project.  Ze is vooral boos omdat premier Lars Hasselboe de Deense immigratiewetten alweer strenger wil maken, mét de hulp van haar eigen vroegere partij. Katrine wordt uit onverwachte hoek gevraagd voor een nieuwe baan. Bij TV1 belooft Torben Friis zijn nieuwe baas, Alex Hjort, dat hij Katrine kan overtuigen om terug te keren als presentatrice, maar dat blijkt minder eenvoudig dan gedacht.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:28', NULL, '2017-07-11 10:58:28', NULL, NULL, 1, '702c7c3c2936d1b5a651c1cd184b2e7f', 1, 0, '', '{"144":3030479.69}', 0, 0, NULL, 1, '2017-07-12 06:29:04', '2017-07-12 06:44:13', '0000-00-00 00:00:00', '2017-07-12 06:45:05', '2017-07-12 20:20:51', '0000-00-00 00:00:00', NULL, '0-0', '6144-8396.8673801422', '00:58:20', 21324, '46405793311476106394763720395810', '58786377236272937572961185900301', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47201, 20258, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E03_da.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Birgitte stort zich volledig op haar werk bij de Nieuwe Democraten, een project waar nu ook Katrine bij betrokken is. Voor een debat bij TV1 over asiel en integratie gaan ze op zoek naar de juiste woordvoerder, bij voorkeur een moslim van een etnische minderheid. Bij TV1 wordt Torben Friis telkens weer op de proef gesteld door zijn nieuwe baas Alex Hjort, die een ontwikkelingsproces start om ervoor te zorgen dat TV1 meer positieve nieuwsberichten zal gaan brengen. Birgitte verhuist met de kinderen naar een andere, kleinere flat. Ze heeft een probleem met één van haar handen, die wat gevoelloos lijkt te worden.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:28', NULL, '2017-07-11 10:58:28', NULL, NULL, 1, 'b73ed4d64cca3fb0e022a0204ec16f4e', 1, 0, '', '{"144":3069767.61}', 0, 0, NULL, 1, '2017-07-12 06:29:14', '2017-07-12 06:44:04', '0000-00-00 00:00:00', '2017-07-12 06:45:06', '2017-07-12 20:25:11', '0000-00-00 00:00:00', NULL, '0-0', '6228-8432.1575565338', '00:59:05', 21325, '67364404832306396438931119680510', '98243936278340899099538945949952', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47202, 20258, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E04_da.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'De Nieuwe Democraten zijn dichter bij de formulering van hun politieke standpunt gekomen. Een intiem etentje van Birgitte en Jeremy heeft grote gevolgen voor de twee, maar blijkt voor de Nieuwe Democraten een uitgelezen kans om met een concrete politieke kwestie in het nieuws te treden. Het biedt Katrine de mogelijkheid haar partij erkend te krijgen door Christiansborg. Op persoonlijk vlak vecht ze met haar gevoelens voor Kasper en de zorg voor hun zoontje Gustav. Torben staat thuis én bij TV1 onder enorme druk en geeft toe aan een verleiding.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:28', NULL, '2017-07-11 10:58:28', NULL, NULL, 1, '3bd078bc98f2cc8083b6fd77dd5eb006', 1, 0, '', '{"144":2991034.19}', 0, 0, NULL, 1, '2017-07-12 06:29:23', '2017-07-12 06:46:12', '0000-00-00 00:00:00', '2017-07-12 06:50:02', '2017-07-12 20:23:55', '0000-00-00 00:00:00', NULL, '0-0', '6065-8716.0635652542', '00:57:34', 21326, '30188683346764408889721431407217', '79605582139201228663716539406004', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47203, 20258, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E05_da.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'De Nieuwe Democraten grijpen hun kans om een politiek statement te doen in een kwestie over prostitutie. Het thema leidt tot grote controverse, ook binnen de partij. Voor Birgitte en Katrine brengt het ook een discussie mee met de mannen in hun leven. Vooral Katrine ziet haar gevoelens voor Kasper in een heel nieuw licht. Torben zit nog altijd niet op één lijn met zijn baas Alex over de manier waarop TV1 het nieuws moet maken. Hij voelt zich ook gespannen omdat zijn vrouw Karoline hem thuis nodig heeft en zijn relatie met zijn collega Pia tegelijkertijd serieuzer wordt.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:29', NULL, '2017-07-11 10:58:29', NULL, NULL, 1, 'd5e9df2856562cedb1c8b1b9f0343a47', 1, 0, '', '{"144":3073868.93}', 0, 0, NULL, 1, '2017-07-12 06:30:57', '2017-07-12 06:46:44', '0000-00-00 00:00:00', '2017-07-12 06:50:03', '2017-07-12 21:54:10', '0000-00-00 00:00:00', NULL, '0-0', '6233-8247.7894382477', '00:59:08', 21327, '52153753807645233617018743177066', '44306569482615849053119176499184', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47204, 20258, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E06_da.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'De Nieuwe Democraten zijn erin geslaagd 20 000 handtekeningen te verzamelen, zodat ze mogen meedoen aan de landelijke verkiezingen. Birgitte heeft een nieuwe parlementskandidaat gevonden: Søren Ravn, een vooraanstaand econoom. Ravn gaat aan de slag bij de Nieuwe Democraten, maar al gauw raakt niet alleen hij, maar ook zijn partij in de problemen door zijn dubieuze verleden. Katrine staat erop dat Ravns geschiedenis wordt onderzocht en gaandeweg groeit ook bij haar de twijfel. De ziekte van Birgitte begint haar meer en meer parten spelen. Torben heeft nog altijd een relatie met Pia en voelt zich schuldig omdat zijn vrouw Karoline nog van niets weet.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:29', NULL, '2017-07-11 10:58:29', NULL, NULL, 1, '35633283e1256a047c9f7f1535469860', 1, 0, '', '{"144":3032726.04}', 0, 0, NULL, 1, '2017-07-12 06:31:08', '2017-07-12 06:46:59', '0000-00-00 00:00:00', '2017-07-12 06:50:04', '2017-07-12 22:28:33', '0000-00-00 00:00:00', NULL, '0-0', '6144-8341.780421257', '00:58:16', 21328, '62012005212346304828553152875356', '36332353043425480993988042388775', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47205, 20258, NULL, 'Aflevering_7.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E07_da.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Birgitte wordt behandeld voor haar ziekte en houdt dat voor de buitenwereld geheim - ook voor haar kinderen. Wanneer Hesselboe een opvallende politieke zet doet, wordt het voor iedereen duidelijk, ook voor Birgitte zelf, dat ze zieker is dan ze wil toegeven. Katrine is gefrustreerd dat Birgitte zo vaak afwezig is en voelt dat ze iets verborgen houdt. Ook bij TV1 zijn ze verrast door de mededeling van Hesselboe. Alle medewerkers komen onder druk te staan. Alex dwingt Torben ertoe grenzen te overschrijden om goede tv te maken.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:29', NULL, '2017-07-11 10:58:29', NULL, NULL, 1, '4502ce1cc7b543fc8c62d1f72a6e1d4c', 1, 0, '', '{"144":3073737.27}', 0, 0, NULL, 1, '2017-07-12 06:31:23', '2017-07-12 06:47:33', '0000-00-00 00:00:00', '2017-07-12 06:50:05', '2017-07-12 23:10:57', '0000-00-00 00:00:00', NULL, '0-0', '6228-8467.0363893509', '00:59:06', 21329, '30368463744986397685120832932936', '36034558719488905189975155994623', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47206, 20258, NULL, 'Aflevering_8.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E08_da.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'Birgitte en de Nieuwe Democraten zitten in de tweede week van de verkiezingscampagne. De Nieuwe Democraten en De Middenpartij strijden om dezelfde kiezers. Birgitte probeert haar partij duidelijker te profileren. Ze ziet zich ook genoodzaakt om haar naaste partijgenoten in te lichten over haar ziekte. Torbens vrouw Karoline dwingt hem een lastig besluit te nemen, wat gevolgen heeft voor zijn redactie. Torben en Alex verschillen steeds vaker van mening en Torben staat op het punt in te storten.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:30', NULL, '2017-07-11 10:58:30', NULL, NULL, 1, '3e2a61204a8c24cfcc6cb74bbac08068', 1, 0, '', '{"144":3027762.9}', 0, 0, NULL, 1, '2017-07-12 06:31:38', '2017-07-12 06:48:36', '0000-00-00 00:00:00', '2017-07-12 06:50:06', '2017-07-12 23:42:07', '0000-00-00 00:00:00', NULL, '0-0', '6144-8541.8490142822', '00:58:19', 21330, '13432993786182208548858531342924', '90172174012691191008689125886431', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47207, 20258, NULL, 'Aflevering_9.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E09_da.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'De verkiezingscampagne gaat haar derde en laatste week in. De Nieuwe Democraten strijden met Birgitte als partijleider nog steeds met de Middenpartij om dezelfde kiezers. Jacob Kruse scherpt in de eindfase van de verkiezingscampagne zijn retoriek aan, en Katrine en Birgitte staan voor de keuze of ze hetzelfde spel willen spelen als Kruse. Birgitte wordt in beslag genomen door de verkiezingen en ziet de bezorgdheid van haar kinderen over haar eigen gezondheid over het hoofd. In zijn drang naar hogere kijkcijfers zet Alex Torben onder druk om de verkiezingsuitzendingen grondig aan te passen.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:30', NULL, '2017-07-11 10:58:30', NULL, NULL, 1, 'b50b5a692bf4199456329af7b86c8e4b', 1, 0, '', '{"144":3046849.82}', 0, 0, NULL, 1, '2017-07-12 06:31:50', '2017-07-12 06:49:37', '0000-00-00 00:00:00', '2017-07-12 06:50:06', '2017-07-12 23:39:52', '0000-00-00 00:00:00', NULL, '0-0', '6172-8335.4227609634', '00:58:34', 21331, '30542337357097018483955002989816', '17893354333047029265413598753697', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47208, 20258, NULL, 'Aflevering_10.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Borgen_S03E10_da.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Het is verkiezingsdag in Denemarken. Het is een nek-aan-nekrace tussen het rode en het blauwe blok, maar geen van beide raakt voorlopig aan de benodigde 90 zetels. Birgitte, Katrine en hun partijgenoten wachten gespannen af of de Nieuwe Democraten voldoende stemmen binnenhalen om hun invloed te laten gelden. Birgitte en Katrine moeten allebei een belangrijke beslissing nemen over de man in hun leven. Alex gooit al zijn gewicht in de strijd tegen Torben, die zich moet bezinnen over zijn leven en zijn ambities.', NULL, 1, 3, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:30', NULL, '2017-07-11 10:58:30', NULL, NULL, 1, '94c72a6d91e030affb4a487c7c5ee8b9', 1, 0, '', '{"144":3050257.56}', 0, 0, NULL, 1, '2017-07-12 06:32:04', '2017-07-12 06:50:42', '0000-00-00 00:00:00', '2017-07-12 06:55:02', '2017-07-12 23:36:21', '0000-00-00 00:00:00', NULL, '0-0', '6186-8071.9946298599', '00:58:42', 21332, '15768293106376313291152744475685', '91145425246742746568474627759457', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
