(47211, 20259, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TopOfTheLake_S01E01_en.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Onderweg naar haar zieke moeder ziet inspectrice Robin Griffin een 12-jarig meisje in een ijskoud meer staan. Robin ontfermt zich over haar, maar nadat is gebleken dat ze zwanger is, verdwijnt het kind zonder enig spoor.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:31', NULL, '2017-07-11 10:58:31', NULL, NULL, 1, '3a28dcc6580b3c654621295e81a0f41a', 1, 0, '', '{"144":3056643}', 0, 0, NULL, 1, '2017-07-12 06:34:21', '2017-07-12 06:51:48', '0000-00-00 00:00:00', '2017-07-12 06:55:03', '2017-07-13 01:24:06', '0000-00-00 00:00:00', NULL, '0-0', '6191-9458.6173257828', '00:58:45', 21338, '57556553227010178809303880589884', '47430195357501167645559535795403', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47212, 20259, NULL, 'Aflevering_2.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TopOfTheLake_S01E02_en.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Robin is vastberaden om Tui op te sporen, niets zal haar tegenhouden, zelfs de ongerepte Nieuw-Zeelandse wildernis niet. Robins onderzoek brengt enkele gevoelige geheimen aan het licht, geheimen die in de kleine gemeenschap aan de rand van \'Paradise\' onrust zaaien.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:31', NULL, '2017-07-11 10:58:31', NULL, NULL, 1, '07b6beab22b3133a8aea3bb32c4bd8f1', 1, 0, '', '{"144":2950954.81}', 0, 0, NULL, 1, '2017-07-12 06:34:41', '2017-07-12 06:52:02', '0000-00-00 00:00:00', '2017-07-12 06:55:04', '2017-07-13 01:41:26', '0000-00-00 00:00:00', NULL, '0-0', '5976-8542.5816698074', '00:56:44', 21339, '36067753752829867976495689341986', '95533595574796756011176090216936', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47213, 20259, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TopOfTheLake_S01E03_en.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Het onderzoek van Robin bereikt eindelijk een doorbraak, maar Robin is zo verdiept in de zaak dat ze niet ziet dat haar eigen verleden haar oordeel kleurt. Tot hoofdinspecteur Al haar hiermee confronteert.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:31', NULL, '2017-07-11 10:58:31', NULL, NULL, 1, '496c8bef8a3f40de71a47b3509aada52', 1, 0, '', '{"144":3055899.49}', 0, 0, NULL, 1, '2017-07-12 06:34:56', '2017-07-12 06:52:17', '0000-00-00 00:00:00', '2017-07-12 06:55:05', '2017-07-13 02:22:53', '0000-00-00 00:00:00', NULL, '0-0', '6186-8943.8149499893', '00:58:44', 21340, '25915106555789832296767073418410', '33568902975863671940028894335928', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47214, 20259, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TopOfTheLake_S01E04_en.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Robin wordt, na een uitbarsting, van de zaak gehaald. Maar ze kan deze zaak niet zomaar naast zich neerleggen. Haar affaire met Johnno, Tui\'s halfbroer, maakt de zaak alleen maar gecompliceerder.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:31', NULL, '2017-07-11 10:58:31', NULL, NULL, 1, 'b90658ac073c1d522b88fe8d00ba799f', 1, 0, '', '{"144":3053746.17}', 0, 0, NULL, 1, '2017-07-12 06:35:07', '2017-07-12 06:53:28', '0000-00-00 00:00:00', '2017-07-12 06:55:05', '2017-07-13 02:36:44', '0000-00-00 00:00:00', NULL, '0-0', '6186-8701.0074033737', '00:58:42', 21341, '71755295570744123719993864234560', '82957158713050456972333076188104', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47215, 20259, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TopOfTheLake_S01E05_en.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Robins schorsing van de zaak bleek gelukkig van korte duur. Ondertussen heeft Tui\'s vader, Matt, zijn \'troepen\' bijeengeroepen om zijn dochter op te sporen en trekken Tui\'s vrienden de bergen in om haar verjaardag te vieren, met tragische gevolgen.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:31', NULL, '2017-07-11 10:58:31', NULL, NULL, 1, '450f494136d806344675040a107518cd', 1, 0, '', '{"144":3056088.5}', 0, 0, NULL, 1, '2017-07-12 06:35:19', '2017-07-12 06:54:01', '0000-00-00 00:00:00', '2017-07-12 06:55:06', '2017-07-13 02:43:17', '0000-00-00 00:00:00', NULL, '0-0', '6186-9694.549870491', '00:58:44', 21342, '78950724437482891863965518676667', '45431272577427632040741363901659', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47216, 20259, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/TopOfTheLake_S01E06_en.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Matt onthult een geheim waar Robin meer dan het hart van in is, terwijl haar onderzoek naar een choquerend einde leidt.', NULL, 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-07-11 10:58:31', NULL, '2017-07-11 10:58:31', NULL, NULL, 1, '403965e22c311cf3c37ebc98554b1ece', 1, 0, '', '{"144":3086282.77}', 0, 0, NULL, 1, '2017-07-12 06:35:29', '2017-07-12 06:56:06', '0000-00-00 00:00:00', '2017-07-12 07:00:03', '2017-07-13 02:39:27', '0000-00-00 00:00:00', NULL, '0-0', '6256-8712.9031000137', '00:59:21', 21343, '95765771683990345212224226480753', '77835672148449285382301828774786', '0', 0, 20, 8, '2013', NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 0, 0),
