(47546, 20292, NULL, 'SMURFS.mp4', NULL, '', 2782, 0, 0, 3, 'La mort fait partie du jeu', 'Quand Grant est accusé d\'un crime qu’il n’a pas commis, le petit groupe prend la pleine mesure du pouvoir de nuisance du network. Condamnés à la clandestinité, Wilson Wilson et Becky se rapprochent de Milner, une femme agent du mi5, mais ont-ils raison de lui faire confiance ?\r\n', '2017-08-23', 1, 1, 0, 0, 1, 1, NULL, 3279, '2017-08-23 00:00:00', 3279, '2017-08-23 04:45:44', NULL, NULL, 1, '6644eaf8176718ed4e1656418ab3628a', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:19:29', '2017-08-23 04:19:29', '0000-00-00 00:00:00', '2017-08-23 04:19:29', '2017-08-23 04:19:29', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21163, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 22, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47547, 20292, NULL, 'SMURFS.mp4', NULL, '', 2782, 0, 0, 4, 'Crimes et châtiments', 'Ayant échappé de justesse à Arby, le tueur du Network, les membres du groupe se réfugient dans un manoir abandonné où ils tentent de déchiffrer le sens secret du manuscrit. Découvrir l’identité de Mr Rabbit leur permettra-t-il de retrouver leur vie d’avant ?\r\n', '2017-08-23', 1, 1, 0, 0, 1, 1, NULL, 3279, '2017-08-23 00:00:00', 3279, '2017-08-23 04:45:37', NULL, NULL, 1, '0054c9f76e4f89e69f3cfbc10a5d7560', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:19:46', '2017-08-23 04:19:46', '0000-00-00 00:00:00', '2017-08-23 04:19:46', '2017-08-23 04:19:46', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21163, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 22, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47548, 20292, NULL, 'SMURFS.mp4', NULL, '', 2782, 0, 0, 5, 'Trahisons', 'Becky, Ian et Wilson Wilson interrogent le membre du network qu’ils retiennent en otage. La femme de Dugdale permet à ce dernier, de façon surprenante, de reprendre l’ascendant sur ses maîtres chanteurs. Quant à Jessica, elle est bouleversée par les confessions d’Arby.\r\n', '2017-08-23', 1, 1, 0, 0, 1, 1, NULL, 3279, '2017-08-23 00:00:00', 3279, '2017-08-23 04:45:29', NULL, NULL, 1, 'b47809bcb0c94b9c28871773f9aaa6f4', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:20:02', '2017-08-23 04:20:02', '0000-00-00 00:00:00', '2017-08-23 04:20:02', '2017-08-23 04:20:02', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21163, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 22, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
