(47627, 20454, NULL, 'Aflevering_1.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Kudamm_Ep1_2ch_de_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', '1956: Monika Schöllack wordt weggestuurd van de huishoudschool. Teleurgesteld en beschaamd keert ze terug naar haar zussen Helga en Eva en haar moeder Caterina – die een dansschool runt – op zoek naar zichzelf.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:19:31', NULL, NULL, 1, 'd4c5f5fe887b36aa026b4e454b057ecc', 1, 0, 'BEST,1210,480,317', '{"BEST":2343526}', 0, 0, NULL, 1, '2017-09-05 08:36:35', '2017-09-05 08:41:55', '0000-00-00 00:00:00', '2017-09-05 08:45:03', '2017-09-05 11:43:22', '0000-00-00 00:00:00', NULL, '0-0', '4752-8685.3706588745', '00:45:03', 21555, '58585426897331922734230276373022', '71266842001830112590262814510244', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
