(47630, 20454, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/Kudamm_Ep4_2ch_de_1080p25..mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Monika ontmoet Joachim bij de club. Ze is nog niet klaar om hem te vergeven – althans nu nog niet. Ondertussen twijfelt haar zus Eva steeds meer aan haar toekomst als de vrouw van professor Fassbender.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:20:44', NULL, NULL, 1, 'f6d454bdc87a16e0614ea35d9a737e72', 1, 0, 'BEST,1210,480,317', '{"BEST":2595775.86}', 0, 0, NULL, 1, '2017-09-11 08:26:09', '2017-09-11 08:31:38', '0000-00-00 00:00:00', '2017-09-11 08:35:02', '2017-09-11 09:27:12', '0000-00-00 00:00:00', NULL, '0-0', '5265-9187.7046470642', '00:49:52', 21567, '92193466567573017606768457696614', '18802421829698397490884798349953', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
