(47637, 20455, NULL, 'Aflevering_3.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/HollandsHoop-S001E003-V1_nl_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Fokke en Machteld lijken elkaar weer gevonden te hebben. Fokke is niet langer de enige man des huizes en alsof dat nog niet genoeg is, komt er ook nog een vrouw bij.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:31:35', NULL, NULL, 1, '4400cbff5fa6915bf0ffb2656bf96db2', 1, 0, 'BEST,1210,480,317', '{"BEST":2640006.36}', 0, 0, NULL, 1, '2017-09-12 11:58:06', '2017-09-12 12:06:12', '0000-00-00 00:00:00', '2017-09-12 12:10:04', '2017-09-12 15:36:49', '0000-00-00 00:00:00', NULL, '0-0', '5312-11227.428806305', '00:50:21', 21636, '92842217978645266201215093455825', '87195329863752787790456082496773', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47638, 20455, NULL, 'Aflevering_4.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/HollandsHoop-S001E004-V1_nl_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'De oogst moet worden verpakt en opgehaald. Fokke kan geen pottenkijkers gebruiken en moet Machteld en de kids van Hollands Hoop af zien te krijgen. Pepijn ziet zijn kans schoon om te laten zien dat hij zijn vader niet nodig heeft om zaken te doen. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:32:05', NULL, NULL, 1, 'ee338ab676be8a6e2f594382ee1d0e8c', 1, 0, 'BEST,1210,480,317', '{"BEST":2620174.94}', 0, 0, NULL, 1, '2017-09-13 06:27:40', '2017-09-13 06:32:28', '0000-00-00 00:00:00', '2017-09-13 06:35:02', '2017-09-13 10:01:56', '0000-00-00 00:00:00', NULL, '0-0', '5270-10188.617730141', '00:49:58', 21638, '23193082022480710293851773363523', '63351806173806816588395260484150', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47639, 20455, NULL, 'Aflevering_5.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/HollandsHoop-S001E005-V1_nl_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Fokke’s verdwenen geld en Machtelds pikante vondst doen het wantrouwen binnen het gezin toenemen. Pepijn komt erachter dat zijn rippers in de buurt zijn, op zoek naar meer. Hij verzwijgt dit voor zijn vader en roept de hulp in van de onberekenbare Bert, met alle gevolgen van dien.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:33:22', NULL, NULL, 1, 'cfa164636f332642bf8895b0c70f46ca', 1, 0, 'BEST,1210,480,317', '{"BEST":2594924.3}', 0, 0, NULL, 1, '2017-09-13 06:27:07', '2017-09-13 06:36:10', '0000-00-00 00:00:00', '2017-09-13 06:40:02', '2017-09-13 12:42:55', '0000-00-00 00:00:00', NULL, '0-0', '5223-9642.9516162872', '00:49:29', 21640, '63053494975133008503147586753106', '91681269285399177548266582406716', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47640, 20455, NULL, 'Aflevering_6.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/HollandsHoop-S001E006-V1_nl_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Fokke raakt steeds verder verstrikt in het web van zijn eigen leugens en ziet nog maar één uitweg: de waarheid vertellen. Maar welke waarheid vertelt hij aan wie? Pepijn raakt zwaar onder invloed van Bert, totdat hij diens andere kant te zien krijgt; een nieuw inzicht tot gevolg. Machteld heeft het helemaal gehad met Fokke’s leugens en probeert hem samen met Anna op heterdaad te betrappen. Zowel Fokke, Machteld en Pepijn komen tot dezelfde conclusie.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:34:25', NULL, NULL, 1, '4db7ccb92989c6ca0e98dadb5c784ba7', 1, 0, 'BEST,1210,480,317', '{"BEST":2613740.73}', 0, 0, NULL, 1, '2017-09-14 08:36:42', '2017-09-14 08:43:16', '0000-00-00 00:00:00', '2017-09-14 08:45:03', '2017-09-14 11:23:58', '0000-00-00 00:00:00', NULL, '0-0', '5256-9110.5658578873', '00:49:50', 21642, '59144956548662880953105085154897', '75117039141764602099820648445600', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47641, 20455, NULL, 'Aflevering_7.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/HollandsHoop-S001E007-V1_nl_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Pepijn heeft een oplossing bedacht, maar die is niet zonder risico. Fokke heeft een veiliger plan en voert deze succesvol uit. De tweespalt die hij daarmee weet te creëren tussen Sasha en Matthias brengt alles in een stroomversnelling, maar levert een nieuw,  dodelijker gevaar op. Dimitri voelt zich verraden door Fokke en wil een drastische daad stellen. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:34:54', NULL, NULL, 1, '28a2d6d5cd41ef32cab8e482a15fd5d7', 1, 0, 'BEST,1210,480,317', '{"BEST":2628291.28}', 0, 0, NULL, 1, '2017-09-12 11:58:45', '2017-09-12 12:10:26', '0000-00-00 00:00:00', '2017-09-12 12:15:03', '2017-09-12 18:14:43', '0000-00-00 00:00:00', NULL, '0-0', '5284-9948.0287160873', '00:50:07', 21644, '53345932298370040650903712749146', '52474315596153431943702840411975', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47642, 20455, NULL, 'Aflevering_8.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/HollandsHoop-S001E008-V1_nl_1080p25.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'In een race tegen de klok zet Fokke alles op alles om Pepijn te vinden, maar moet eerst langs Matthias die nu op zijn gevaarlijkst is. In de tussentijd moet hij Machteld zien te sussen maar die begint zo haar verbanden te leggen. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 09:35:17', NULL, NULL, 1, '545e76d68882bf371ee688264c083717', 1, 0, 'BEST,1210,480,317', '{"BEST":2496425}', 0, 0, NULL, 1, '2017-09-12 11:58:57', '2017-09-12 12:11:57', '0000-00-00 00:00:00', '2017-09-12 12:15:04', '2017-09-12 18:24:30', '0000-00-00 00:00:00', NULL, '0-0', '5032-10047.1115942', '00:47:40', 21646, '53490117663222866843518221711862', '15297975221619992596136415293078', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
