(47647, 20458, NULL, 'Oorlogskind.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/CamillaLackberg-S001E001-V1-Hidden_Child-FE-V1_SV_1080p25.mp4', '', 3060, 0, 0, 1, 'Oorlogskind', 'De succesvolle schrijfster Erica Falck verliest beide ouders in een auto-ongeluk. Wanneer een paar maanden later haar vermeende halfbroer vermoord wordt, gaat ze op onderzoek naar haar moeders oorlogsverleden. Dit zit echter vol duistere geheimen, die sommigen angstvallig verborgen proberen te houden. Erica raakt steeds meer verstrikt in een web van leugens en moord.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 10:06:54', NULL, NULL, 1, '23e6e4229ed905e071e1d4a82bb71743', 1, 0, 'BEST,1210,480,317', '{"BEST":4714436.13}', 0, 0, NULL, 1, '2017-09-13 12:35:40', '2017-09-13 12:44:16', '0000-00-00 00:00:00', '2017-09-13 12:45:02', '2017-09-13 15:49:28', '0000-00-00 00:00:00', NULL, '0-0', '9498-19147.17878437', '01:30:12', 21649, '17708750191498539166579043739034', '95736166525639141875557705503348', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47648, 20458, NULL, 'De_zee_geeft__de_zee_neemt.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/CamillaLackberg-S001E002-V1_Havet_ger_havet_tar_SV_1080p25.mp4', '', 3060, 0, 0, 2, 'De zee geeft, de zee neemt', 'Nadat Erica de lokale fotograaf Stigge dood aantreft in zijn studio, volgt ze het onderzoek op de voet. De politie stelt zich vragen bij de achtergrond van Stigge. Misschien zat er meer achter de façade dan gewoon de vriendelijke oude man die iedereen kende? Erica is al sneller tot die conclusie gekomen, zeker na de getuigenis van haar schoonmoeder die wist te vertellen dat Stigge haar chanteerde. Erica ontrafelt Stigge’s verleden en stelt vast dat een mens veel over heeft voor de liefde.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 10:08:19', NULL, NULL, 1, '77d3a7e7ef6967723e66a296bb94cc2e', 1, 0, 'BEST,1210,480,317', '[]', 0, 0, NULL, 1, '2017-09-13 12:59:09', '2017-09-13 13:03:23', '0000-00-00 00:00:00', '2017-09-13 13:05:02', '2017-09-13 15:55:33', '0000-00-00 00:00:00', NULL, '0-0', '9310-15418.05305481', '01:28:27', 21650, '83360016743366590325953567539636', '52873257726347690541529010470207', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47649, 20458, NULL, 'De_Kustrijder.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/CamillaLackberg-S001E003-V1_Strandridaren_SV_1080p25.mp4', '', 3060, 0, 0, 3, 'De Kustrijder', 'Jessica is pas bij de kustwacht wanneer ze na een storm twee gestorven duikers ontdekt. Haar oversten bestempelen dit als een ongeval maar Jessica is het daar niet mee eens en ze roept de hulp in van haar jeugdvriend Patrik. Patrik en Erica waren net vertrokken op wat een romantische vakantie moest worden, maar ze besluiten toch de hulpkreet te beantwoorden en maken een omweg. Aangekomen in Kungshamm raken ze al snel betrokken in de zaak. Erica wordt uitgenodigd om aanwezig te zijn op een vergadering, maar daar valt een derde slachtoffer. De drie sterfgevallen worden nu officieel onderzocht, maar de enige link tussen de 3 lijkt hun interesse te zijn in een scheepswrak uit 1820. Werd het wrak gevonden? En welke cargo was er aan boord? Waardoor is het schip destijds gezonken? De zaak roept heel wat vragen op.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 10:08:51', NULL, NULL, 1, 'ba3d4749adb913a6e08f4391e8d903ae', 1, 0, 'BEST,1210,480,317', '{"BEST":4629253.18}', 0, 0, NULL, 1, '2017-09-13 15:58:37', '2017-09-13 16:07:58', '0000-00-00 00:00:00', '2017-09-13 16:10:03', '2017-09-13 17:49:03', '0000-00-00 00:00:00', NULL, '0-0', '9325-18694.989910126', '01:28:35', 21651, '31224296201650338665529973630986', '87227018982418290808777232123810', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47650, 20458, NULL, 'De_koningin_van_het_licht.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/CamillaLackberg-S001E004-V1_Ljusets_drottning_SV_1080p25.mp4', '', 3060, 0, 0, 4, 'De koningin van het licht', 'Op een koude maar glasheldere winternacht wordt een vrouw gespot terwijl ze al huilend over het ijs loopt in een traditioneel wit \'Lucia\' gewaad. Wanneer ze struikelt laat ze haar kaarsen-kroon in de sneeuw vallen, om daarna zichzelf in het ijskoude water te storten en te verdwijnen. Erica en Patrik zijn volop bezig met de voorbereidingen voor de eerste kerst in hun eigen huis. Maar wanneer Erica en Patrik op 13 september in de kerk de Lucia ceremonie willen bijwonen, vernemen ze dat de Lucia vermist is. In de kerk ontstaat commotie. Erica wil er meer over te weten komen. Erica\'s ontdekkingen leiden naar de verdwenen Lucia, een geheime liefdesrelatie en een zoon die wraak zoekt voor zijn moeder.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 10:09:12', NULL, NULL, 1, 'b82cb0dd23dd23b2412b2f2604f2a9cf', 1, 0, 'BEST,1210,480,317', '{"BEST":4666481.46}', 0, 0, NULL, 1, '2017-09-12 11:51:28', '2017-09-12 12:18:12', '0000-00-00 00:00:00', '2017-09-12 12:20:02', '2017-09-13 00:00:45', '0000-00-00 00:00:00', NULL, '0-0', '9400-18119.505523682', '01:29:18', 21652, '83591464637901533915259084934828', '18068681324335587411222765393223', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47651, 20458, NULL, 'Vrienden_voor_het_leven.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/CamillaLackberg-S001E005-V1_Vanner_for_livet_SV_1080p25.mp4', '', 3060, 0, 0, 5, 'Vrienden voor het leven', 'Erica Falck is een gevierd detective-auteur die niet stil zit. Momenteel werkt ze aan haar volgend boek en ze denkt eraan om dit te baseren op waargebeurde feiten uit haar jeugd. Toen Erica amper 13 was, werd Peter, haar klasgenootje en beste vriend, nooit meer gezien nadat hij op een bus stapte. Een tragische gebeurtenis die Erica nooit heeft los gelaten. Ze besluit de zaak alsnog uit te spitten, maar zonder het goed te beseffen maakt ze hierdoor slapende honden wakker. Erica\'s enige link met Peter, zijn broer Ivan, wordt vermoord terwijl hij op weg is naar haar. Dit maakt Erica vastberaden om niet alleen het mysterie rond Peter op te lossen maar ook de moordenaar van Ivan te klissen. Haar onderzoek lijkt een hoogtepunt te bereiken op een reünie van de middelbare school. Tina, de mysterieuze zus van Peter en Ivan, duikt plots op, net op dezelfde avond dat er nog een derde slachtoffer valt. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 10:19:33', NULL, NULL, 1, '5dc0c484dcdd755feb20642f2a182a95', 1, 0, 'BEST,1210,480,317', '{"BEST":4709954.85}', 0, 0, NULL, 1, '2017-09-12 11:51:08', '2017-09-12 12:16:48', '0000-00-00 00:00:00', '2017-09-12 12:20:03', '2017-09-13 00:27:22', '0000-00-00 00:00:00', NULL, '0-0', '9493-18830.49893856', '01:30:09', 21653, '71093372526449096181424199511917', '36593064705424878791601865615271', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(47652, 20458, NULL, 'Kunst__kitsch_en_kenners.mp4', 'http://d2685ys9aufw68.cloudfront.net/videogallery/CamillaLackberg-S001E006-V1_Betraktarens_oga_SV_1080p25.mp4', '', 3060, 0, 0, 6, 'Kunst, kitsch en kenners', 'Anna, de zus van Erica, is bij haar op bezoek. Net op hetzelfde moment dat ook het Tv-programma "Antiques cubed" neergestreken is in het dorp om opnames te maken in het kasteel van Fjällbacka. Na een toevallige ontmoeting tussen Anna en de presentator van het programma slaat er een vonk over bij hen. Anna wordt uitgenodigd op de set en het is ook Anna die de bewusteloze Linda Hamrin ontdekt. Het gerucht doet de ronde dat Linda\'s overdosis een gevolg was van haar affaire. Hasse Wennerman wordt de dag daarna vermoord terug gevonden. En het oude schilderij dat hij had meegebracht naar het programma, lijkt gestolen te zijn.  Erica en Patrik raken  bij de zaak betrokken, en wanneer het schilderij teruggevonden wordt tussen de persoonlijke spullen van Anna, moet Erica alles uit de kast halen om de onschuld van haar zus te bewijzen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-08-29 00:00:00', NULL, '2017-08-29 10:20:06', NULL, NULL, 1, '424b300d70a3a4bdbc959dacdd5d77f9', 1, 0, 'BEST,1210,480,317', '{"BEST":4621201.16}', 0, 0, NULL, 1, '2017-09-12 12:07:56', '2017-09-12 12:20:45', '0000-00-00 00:00:00', '2017-09-12 12:25:03', '2017-09-13 00:47:43', '0000-00-00 00:00:00', NULL, '0-0', '9311-19812.125579834', '01:28:27', 21654, '63221205369706993651763639492533', '93866294449704128108657862009957', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
