(47762, 20486, NULL, 'I_AM_WRATH.mp4', NULL, '', 3069, 0, 0, NULL, 'Où est Jessica Hyde ?', 'Sur un forum, un lecteur de la bande dessinée culte “utopia” annonce à quatre autres fans qu\'il est en possession du manuscrit original d\'un deuxième tome. Il leur donne rendez-vous dans un pub mais est assassiné avant de pouvoir s\'y rendre. Derrière ce crime, une organisation secrète, le network, qui tient à récupérer le manuscrit, coûte que coûte.\r\n', '2017-09-05', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-08-31 00:00:00', 3407, '2017-09-05 13:38:55', NULL, NULL, 1, 'ad2dfdb554f9fbb617da35daa2eb1ce8', 0, 0, 'BEST,1920,1210,900,317,242,108', '{"BEST":1508791.02,"144":137376.27,"720":708311.71,"1080":1508791.02,"240":195857.63,"360":285720.87,"640":598231.83}', 0, 0, NULL, 1, '2017-08-08 10:16:24', '2017-08-08 10:16:24', '0000-00-00 00:00:00', '2017-08-08 10:16:24', '2017-08-08 10:16:24', '0000-00-00 00:00:00', NULL, '0-0', '8-9754.8070878983', '01:25:20', 21543, '31295024271990820583559341826817', '59871767507788374380143553050868', '0', 0, 20, 47, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47763, 20486, NULL, 'SMURFS.mp4', NULL, '', 3069, 0, 0, 2, 'Le manuscrit', 'Rien ne sera jamais plus comme avant pour Ian et Becky, condamnés à fuir sans fin. Une mystérieuse jeune femme, Jessica Hyde, leur offre son aide. Pendant ce temps, Michael Dugdale, haut fonctionnaire au ministère de la santé, fait l\'objet de pressions de la part du Network.\r\n', '2013-01-22', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-08-31 00:00:00', 3407, '2017-09-05 12:56:57', NULL, NULL, 1, '1768ecf0f13ea66dd212015af8e6d6b4', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:35:04', '2017-08-23 04:35:04', '0000-00-00 00:00:00', '2017-08-23 04:35:04', '2017-08-23 04:35:04', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21544, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 47, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47764, 20486, NULL, 'SMURFS.mp4', NULL, '', 3069, 0, 0, NULL, 'La mort fait partie du jeu', 'Quand Grant est accusé d\'un crime qu’il n’a pas commis, le petit groupe prend la pleine mesure du pouvoir de nuisance du network. Condamnés à la clandestinité, Wilson Wilson et Becky se rapprochent de Milner, une femme agent du mi5, mais ont-ils raison de lui faire confiance ?\r\n', '2017-09-05', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-08-31 00:00:00', 3407, '2017-09-05 13:37:51', NULL, NULL, 1, 'e5cdd46d6146abca7afa2ce7b1b3c4ef', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:19:29', '2017-08-23 04:19:29', '0000-00-00 00:00:00', '2017-08-23 04:19:29', '2017-08-23 04:19:29', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21544, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 47, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47765, 20486, NULL, 'SMURFS.mp4', NULL, '', 3069, 0, 0, NULL, 'Crimes et châtiments', 'Ayant échappé de justesse à Arby, le tueur du Network, les membres du groupe se réfugient dans un manoir abandonné où ils tentent de déchiffrer le sens secret du manuscrit. Découvrir l’identité de Mr Rabbit leur permettra-t-il de retrouver leur vie d’avant ?\r\n', '2017-09-05', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-08-31 00:00:00', 3407, '2017-09-05 13:36:59', NULL, NULL, 1, '3acba2462aedc96a84aa63c995f13572', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:19:46', '2017-08-23 04:19:46', '0000-00-00 00:00:00', '2017-08-23 04:19:46', '2017-08-23 04:19:46', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21544, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 47, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47766, 20486, NULL, 'SMURFS.mp4', NULL, '', 3069, 0, 0, NULL, 'Trahisons', 'Becky, Ian et Wilson Wilson interrogent le membre du network qu’ils retiennent en otage. La femme de Dugdale permet à ce dernier, de façon surprenante, de reprendre l’ascendant sur ses maîtres chanteurs. Quant à Jessica, elle est bouleversée par les confessions d’Arby.\r\n', '2017-09-05', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-08-31 00:00:00', 3407, '2017-09-05 13:34:36', NULL, NULL, 1, 'd5665a79cd42495a010cece99e7de6fe', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:20:02', '2017-08-23 04:20:02', '0000-00-00 00:00:00', '2017-08-23 04:20:02', '2017-08-23 04:20:02', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21544, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 47, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
(47767, 20486, NULL, 'SMURFS.mp4', NULL, '', 3069, 0, 0, 6, 'Fin de missions', 'Le temps presse. La bande doit trouver Mr Rabbit et donner un coup d’arrêt à la mise en oeuvre du plan Janus par le Network. Piégé par le réseau, Grant est quant à lui tenté par les promesses qui lui sont faites… une question demeure : les vrais secrets d’Utopia seront-ils enfin révélés ?\r\n', '2017-08-23', 1, 1, 0, 0, 1, 1, NULL, NULL, '2017-08-31 00:00:00', 3407, '2017-09-05 12:55:46', NULL, NULL, 1, 'e888d54c6981b4e7e92bbd874655a3bf', 0, 0, '', '{"144":136064.78}', 0, 0, NULL, 1, '2017-08-23 04:20:18', '2017-08-23 04:20:18', '0000-00-00 00:00:00', '2017-08-23 04:20:18', '2017-08-23 04:20:18', '0000-00-00 00:00:00', NULL, '0-0', '265-424.32298564911', '00:02:19', 21544, '22099396345597910522016934625321', '43601703333641209937271720627795', '0', 0, 20, 47, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 0, 0),
