(48786, 20599, NULL, 'Snabba_Cash_I.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/SnabbaCash-FE-V1_sv_FullMix_1080p25.mp4', '', 3060, 0, 0, 1, 'Snabba Cash I', 'n Stockholm, waar de decadente bovenwereld en de rauwe onderwereld nauw met elkaar verbonden zijn, zwichten drie mannen voor de destructieve lokroep van de cocaïnehandel. De ambitieuze student JW (Joel Kinnaman – Johan Falk), de Servische moordmachine Mrado en de Chileense drugsdealer Jorge dromen van een beter leven. Maar dan hebben ze wel geld nodig. Veel geld. En snel.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-09-27 00:00:00', NULL, '2017-09-27 07:11:52', NULL, NULL, 1, '7d66788d9bbbdc992995a492075269a5', 1, 0, 'BEST,1210,480,317', '{"BEST":6056395.19}', 0, 0, NULL, 1, '2017-09-27 08:32:04', '2017-09-27 08:42:51', '0000-00-00 00:00:00', '2017-09-27 08:45:04', '2017-09-27 15:21:31', '0000-00-00 00:00:00', NULL, '0-0', '12545-25279.881357193', '01:59:15', 21824, '52883541312726202985554062255771', '21136943151810478394207737955740', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48787, 20599, NULL, 'Snabba_Cash_II.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/SnabbaCashII-FE-V1_sv_FullMix_1080p25.mp4', '', 3060, 0, 0, 2, 'Snabba Cash II', 'Johan “JW” Westlund was ooit een veelbelovende student bedrijfskunde, maar zit nu vast na zijn veroordeling voor grootschalige drugssmokkel. Wanneer tijdens zijn opsluiting blijkt dat niemand van zijn oude vrienden nog iets met hem te maken wil hebben, besluit JW geen minuut langer achter de tralies door te brengen en zich volledig op een leven in de misdaad te storten.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-09-27 00:00:00', NULL, '2017-09-27 07:12:50', NULL, NULL, 1, '0393fd2841dfe1554d7e1b4803d2890f', 1, 0, 'BEST,1210,480,317', '{"BEST":4812315.4}', 0, 0, NULL, 1, '2017-09-27 08:32:13', '2017-09-27 08:42:08', '0000-00-00 00:00:00', '2017-09-27 12:25:02', '2017-09-27 18:16:09', '0000-00-00 00:00:00', NULL, '0-0', '10100-16331.323822021', '01:35:59', 21826, '72850667256822066330868519324268', '48919843369104090427982536667622', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
