(48869, 20652, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E001-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Een paar weken voor de algemene verkiezingen verdwijnt Sarah Farzin, het hoofd van personeel bij het Departement Justitie, zonder enig spoor. De Minister van Justitie, Gunnar Ljunghed, vervangt haar door zijn voormalige protegé Elin Hammar. Elin ontdekt al snel dat iemand Sarah’s mysterieuze verdwijningen probeert toe te dekken; belangrijke documenten zijn verdwenen en anderen vervalst. Op hetzelfde moment wordt in het kleine dorp Ludvika een lokale vertegenwoordiger van de extreem- rechtse partij Trygghetspartiet, brutaal vermoord nadat ze een controversiële speech had gehouden op het stadsplein.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 08:21:46', NULL, NULL, 1, '4298f09989a95e881dd3c59e8e9adbe1', 1, 0, 'BEST,1210,480,317', '{"BEST":2982499.14}', 0, 0, NULL, 1, '2017-10-18 08:56:10', '2017-10-18 09:02:38', '0000-00-00 00:00:00', '2017-10-18 09:05:02', '2017-10-18 16:38:30', '0000-00-00 00:00:00', NULL, '0-0', '6035-10299.698539734', '00:57:14', 21883, '70276717492566003144546911113239', '88128396812521599982168282666457', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48870, 20652, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E002-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Hoe meer Elin Sarah’s verdwijning onderzoekt hoe meer ze overtuigd geraakt dat er iets verschrikkelijks is gebeurd. Trygghetspartiet ziet Annika’s moord als een gouden kans om nieuwe stemmen en sympathieën te winnen. Ze geven hun woordvoerder, Olle Nordlöf, de taak om Annika’s kinderen, Sofia en Simon, te rekruteren. Ondertussen komt de Nazi terroristencel Veritas terug uit de duisternis en voeren ze hun eerste afgrijselijke aanval uit die de hele natie angst aanjaagt.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 08:22:13', NULL, NULL, 1, '9af7ea3259a69623a41b6e8bf98a52b4', 1, 0, 'BEST,1210,480,317', '{"BEST":3015663.21}', 0, 0, NULL, 1, '2017-10-18 08:56:22', '2017-10-18 09:03:44', '0000-00-00 00:00:00', '2017-10-18 17:35:03', '2017-10-19 12:18:06', '0000-00-00 00:00:00', NULL, '0-0', '6096-9717.264131546', '00:57:49', 21884, '11781877546063102844876998986871', '58621874384505626371103424265821', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48871, 20652, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E003-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Annika’s moord en de terroristische aanvallen van Veritas plaatsen de overheid in een crisis – hoe zullen ze omgaan met de terroristenbedreigingen van Veritas? Olle rijkt uit naar Sofia en Simon en biedt aan om te betalen voor hun moeders begrafenis zonder in zijn politieke agenda te laten zien. Elin ontdekt dat Sarah’s aanvraag voor vakantie vervalst is en de sporen leiden terug naar het Departement van Justitie. Sofia zoekt comfort en zondebokken op het internet en stuit op een xenofobe chatforum waar de immigranten worden beschuldigd van Annika’s moord.\r\n', '2017-10-14', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', 3365, '2017-10-14 08:25:42', NULL, NULL, 1, 'f86194e5108223325e2c43aa0997bb80', 1, 0, 'BEST,1210,480,317', '{"BEST":3055624.55}', 0, 0, NULL, 1, '2017-10-18 08:56:31', '2017-10-18 09:04:37', '0000-00-00 00:00:00', '2017-10-18 19:35:02', '2017-10-19 14:25:04', '0000-00-00 00:00:00', NULL, '0-0', '6175-10020.307723999', '00:58:35', 21885, '15490256125876345856658891286352', '59972991652358545462921069306364', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48872, 20652, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E004-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Plots krijgt Elin telefoon en verandert alles – een doodsbange Sarah wil een geheime afspraak. Janina confronteert Olle en Kristoffer want een groot aandeel van de campagnefondsen zijn verdwenen. Olle liegt en ontkent dat hij iets weet over het verdwenen geld. In Ludvika spendeert Sofia meer en meer tijd op het xenofobe chatforum, waarbij ze vertrouwelijke informatie over de Veritas terrorisme aanvallen, die Mathias haar in vertrouwen vertelde, lekt. Dit gebeurt niet ongezien en Sofia wordt een serieus probleem voor Veritas.\r\n', '2017-10-14', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', 3365, '2017-10-14 08:25:58', NULL, NULL, 1, '3a019cd8c7a1346a415470e8717f0da2', 1, 0, 'BEST,1210,480,317', '{"BEST":2991999.58}', 0, 0, NULL, 1, '2017-10-18 08:56:45', '2017-10-18 09:05:30', '0000-00-00 00:00:00', '2017-10-18 09:10:02', '2017-10-18 20:12:02', '0000-00-00 00:00:00', NULL, '0-0', '6049-10004.276103973', '00:57:23', 21886, '53958114839530580940172854566171', '60466168059842551811746309853285', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48873, 20652, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E005-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Simon realiseert zich dat verhuizen naar Stockholm niet de nieuwe start is die Sofia hem beloofde. Hij geraakt onherroepelijk en tegen zijn wil in betrokken bij Veritas. Elin is gechoqueerd wanneer ze ontdekt dat haar vriend Max waarschijnlijk medeplichtig is aan de verdwijning van Sarah. Veritas ontvoert een directrice van een privaat gezondheidsbedrijf terwijl ze onderweg naar huis is. Een video toont deze kidnapping en wordt door Veritas op het internet geplaatst. In dezelfde video profileert Veritas zich als de voorvechter van Zweden in de oorlog om Zwedens waarden te beschermen. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 08:25:10', NULL, NULL, 1, 'be5701ad6a0f85ad1ddca69370aac3a3', 1, 0, 'BEST,1210,480,317', '{"BEST":3074033.66}', 0, 0, NULL, 1, '2017-10-18 08:56:54', '2017-10-18 09:07:31', '0000-00-00 00:00:00', '2017-10-18 21:05:02', '2017-10-19 15:59:04', '0000-00-00 00:00:00', NULL, '0-0', '6217-10596.968630791', '00:58:57', 21887, '56962096977818362122743503938337', '34236023144586971605052181562592', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48874, 20652, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E006-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'De verschrikkelijke executie van de gezondheidsdirecteur stuurt enorme schokgevoelens naar de hele natie. Wanneer Matthias en Sofia het lichaam proberen te dumpen worden ze opgemerkt door de geheime politie en de jacht op Matthias begint. Olle bekent aan Janina dat hij Sofia geld heeft gegeven en uit zijn bezorgdheid over Sofia’s lidmaatschap bij Veritas. Er word ingebroken bij Elin. Ze denkt dat de daders zochten naar haar controversieel uranium document. Tegelijkertijd krijgt ze een telefoon van de Minister van Milieu, hij heeft het CCTV beeldmateriaal gevonden van de onbekende persoon die Sarah’s valse vakantieaanvraag tekende. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 08:27:40', NULL, NULL, 1, '0f73cec4e9f890d78002e10615c2d7f9', 1, 0, 'BEST,1210,480,317', '{"BEST":3062948.77}', 0, 0, NULL, 1, '2017-10-18 08:57:06', '2017-10-18 09:07:47', '0000-00-00 00:00:00', '2017-10-18 21:35:02', '2017-10-19 17:22:28', '0000-00-00 00:00:00', NULL, '0-0', '6189-11896.705493927', '00:58:40', 21888, '67666411134723989775936901080798', '16730491998187639256379326374731', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0);
