(48875, 20652, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E007-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Met nog maar enkele dagen voor de verkiezingen heeft de politie sterke vermoedens dat Veritas een grote aanval beraamt. Maar waar en wanneer? Ondertussen worstelt Elin met het feit dat Gunnar tegen haar liegt en waarom hij bewijs over Sarah’s verdwijning achterhoudt.  Gustav is razend over alle media-en politieaandacht die Matthias heeft aangetrokken. Dit is een serieuze bedreiging voor hun plannen. Olle verschijnt onverwachts op de schuilplaats van Veritas zoekend naar Sofia. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 08:28:31', NULL, NULL, 1, '3d325e5d106e2b7b882160098c982aeb', 1, 0, 'BEST,1210,480,317', '{"BEST":3058844.34}', 0, 0, NULL, 1, '2017-10-18 08:57:19', '2017-10-18 09:08:24', '0000-00-00 00:00:00', '2017-10-18 21:30:03', '2017-10-19 16:06:09', '0000-00-00 00:00:00', NULL, '0-0', '6180-10141.052019119', '00:58:40', 21889, '34666367204565006198253539918927', '61487513051990332998799659129486', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48876, 20652, NULL, 'Aflevering_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E008-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'Middenin de persconferentie, gehouden op de Overheidsbureaus, rinkelen alle telefoons van de journalisten simultaan. In een paar seconden blijkt dat Veritas een nieuwe terroristische aanval heeft uitgevoerd. Wat is het doel van de aanval? Is deze gelinkt aan de kidnapping van de vijfjarige zoon van Magnus, hoofd van veiligheid van de Stockholm Stock Exchange, eerder die dag?  \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 08:57:29', NULL, NULL, 1, 'e2c5889335b1a8988442b4a53af56d0c', 1, 0, 'BEST,1210,480,317', '{"BEST":3047102.65}', 0, 0, NULL, 1, '2017-10-18 08:57:53', '2017-10-18 09:08:33', '0000-00-00 00:00:00', '2017-10-18 22:30:03', '2017-10-19 17:51:54', '0000-00-00 00:00:00', NULL, '0-0', '6161-10368.538282394', '00:58:27', 21890, '26331040308676402733841067602483', '90051372143816851236626326400661', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48877, 20652, NULL, 'Aflevering_9.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E009-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Samen opgesloten in de schuilplaats van Veritas verzorgt Sofia de wonden van Matthias. Een verontrustend gevoel kwelt haar. Simon en zijn zoon, Love, zouden al lang hier moeten zijn. Zou het kunnen dat de rest van de groep zaken weet die zij niet weet. Elin is gecontacteerd door een onverwachte partij die een samenwerking voorstelt die hen beide ten goede zou komen. Kan hij deze nieuwe bondgenoot vertrouwen? De politie identificeert Gustav in de CCTV beelden van de Stock Exchange. Hij is nu de meest gezochte man in Zweden.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:04:20', NULL, NULL, 1, '81dca4685df88246bea643bd5bc88fab', 1, 0, 'BEST,1210,480,317', '{"BEST":3056833.1}', 0, 0, NULL, 1, '2017-10-18 08:58:10', '2017-10-18 09:08:57', '0000-00-00 00:00:00', '2017-10-18 23:20:03', '2017-10-19 18:04:22', '0000-00-00 00:00:00', NULL, '0-0', '6180-10508.883408546', '00:58:37', 21891, '39855265731264307545298777314239', '53493641135567355349609976529256', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48878, 20652, NULL, 'Aflevering_10.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/BlueEyes-S001E010-V1_sv-sv_51-20_FullMix-FullMix_169-178_1080p25.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Na de aanval op de Stock Exchange en de koelbloedige moord op Rebecca gaat een aangeslagen natie stemmen. Zowel de conservatieve partij als Trygghetspartiet zijn bezorgd over de uitslag van de verkiezingen. Elin en Gunnar worstelen met de laatste puzzelstukjes en zitten op het spoor van één van de meest corrupte en schandalige politieke samenzweringen die de natie ooit heeft gekend. Simon probeert naar zijn leven in Ludvika terug te keren, maar het verleden achtervolgt hem wanneer Sofia opdaagt. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:04:48', NULL, NULL, 1, '8047b03d52384ba8b0f9680baacddcf7', 1, 0, 'BEST,1210,480,317', '{"BEST":3065709.59}', 0, 0, NULL, 1, '2017-10-18 08:58:21', '2017-10-18 09:10:03', '0000-00-00 00:00:00', '2017-10-18 09:15:03', '2017-10-19 00:19:09', '0000-00-00 00:00:00', NULL, '0-0', '6203-10429.615926743', '00:58:48', 21892, '88720348361800940413070176062125', '19767352449175993726838319038453', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
