(48881, 20653, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E001-V1_da_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Norskov is een noodlijdende havenplaats waar drugs voor grote problemen zorgt maar burgemeester Martin Kierkegaard is vastbesloten om de toekomst van zijn dorp te redden. Tom Noack, ooit inwoner van Norskov en nu rechercheur, wordt gevraagd terug te keren naar zijn geboorteplaats om de overheersende drugscriminaliteit terug te dringen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:13:15', NULL, NULL, 1, '349495688c536b6a7a4bf026ad76dc42', 1, 0, 'BEST,1210,480,317', '{"BEST":2181315.71}', 0, 0, NULL, 1, '2017-10-18 09:00:39', '2017-10-18 09:10:50', '0000-00-00 00:00:00', '2017-10-19 00:00:51', '2017-10-19 18:44:20', '0000-00-00 00:00:00', NULL, '0-0', '4402-9670.5523252487', '00:41:42', 21905, '85445577678270705247846925328663', '57902052598809805842971944161610', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48882, 20653, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E002-V1_da_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Het tragische ongeluk zorgt voor een hernieuwde band tussen Tom en zijn oude vriend Bondy maar de tiener Oliver is nog steeds even onbereikbaar. Intussen levert Toms onderzoek aanwijzingen naar een gevaarlijke drugsdealer op. En aangezien hij weet dat de cocaïne die in de stad wordt verhandeld onversneden is, ziet hij een verband.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:13:47', NULL, NULL, 1, '984381c0f2f6388d272227375ac5c373', 1, 0, 'BEST,1210,480,317', '{"BEST":2161675.71}', 0, 0, NULL, 1, '2017-10-18 09:00:58', '2017-10-18 09:10:52', '0000-00-00 00:00:00', '2017-10-19 00:15:03', '2017-10-19 18:48:32', '0000-00-00 00:00:00', NULL, '0-0', '4360-9388.6263275146', '00:41:20', 21906, '61783439908205480800779881817118', '92294122364741309238619752068342', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48883, 20653, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E003-V1_da_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Oliver heeft de grootste moeite om niet van het padje af te gaan maar Tom is vastbesloten hem te blijven steunen. Ondertussen zorgt Bondy ervoor dat het grote havenproject weer doorloopt, waar burgemeester Martin hem zeer dankbaar voor is. Uit Toms onderzoek blijkt dat er een interessante verdachte in Norskov is komen wonen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:14:12', NULL, NULL, 1, '4a26b01e8ed9cfb40bfedc7e0a5f0c25', 1, 0, 'BEST,1210,480,317', '{"BEST":2152037.99}', 0, 0, NULL, 1, '2017-10-18 09:01:29', '2017-10-18 09:11:44', '0000-00-00 00:00:00', '2017-10-19 00:20:03', '2017-10-19 20:13:01', '0000-00-00 00:00:00', NULL, '0-0', '4346-10084.224557877', '00:41:09', 21907, '88612721546138866315038045263882', '97364694489312798068509316712479', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48884, 20653, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E004-V1_da_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Een geheim zorgt voor veel conflict voor Tom terwijl tegelijk lijkt alsof zijn zaak veel verder reikt dan gedacht. Intussen staat het huwelijk tussen Jackie en Martin op springen nadat hun verleden hen inhaalt. De Deense Minister van Onderwijs komt naar Norskov om Martins plannen het groene licht te geven.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:14:36', NULL, NULL, 1, '5d8297e451a0e650c38252a91bcc88ef', 1, 0, 'BEST,1210,480,317', '{"BEST":2163480.79}', 0, 0, NULL, 1, '2017-10-18 09:01:39', '2017-10-18 09:12:43', '0000-00-00 00:00:00', '2017-10-19 01:20:02', '2017-10-19 20:27:05', '0000-00-00 00:00:00', NULL, '0-0', '4369-10325.974003792', '00:41:22', 21908, '11354824745751038362350573804730', '98356549399594542322326586450082', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48885, 20653, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E005-V1_da_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Martin deelt zijn geheim met Oliver terwijl Tom iets ziet waar hij spijt van krijgt. Met nog een maand voor zijn onderzoek, besluit Tom achter dé vermoedelijke drugskingpin aan te gaan. Martins project is een groot succes en de hele stad is erbij als de eerste schep de grond in gaat.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:17:52', NULL, NULL, 1, '3c841cee5b2497ea9617f7e630b8ead1', 1, 0, 'BEST,1210,480,317', '{"BEST":2196346.01}', 0, 0, NULL, 1, '2017-10-18 09:01:48', '2017-10-18 09:14:05', '0000-00-00 00:00:00', '2017-10-19 02:10:02', '2017-10-19 20:48:58', '0000-00-00 00:00:00', NULL, '0-0', '4430-10383.199543953', '00:41:59', 21909, '31513281310207052707866812772933', '14663612473746220247135758113692', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48886, 20653, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E006-V1_da_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Het verhaal over Olivers echte vader staat in alle kranten en daar heeft hij het binnen en buiten de ijshockeyring erg moeilijk mee. Jackie heeft het op haar beurt zwaar met de stopgezette adoptie. Tom denkt ondertussen dat een bekende uit de stad de kingpin kan zijn.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:19:32', NULL, NULL, 1, 'ce3d226887027ea7af2f10710f221588', 1, 0, 'BEST,1210,480,317', '{"BEST":2201377.97}', 0, 0, NULL, 1, '2017-10-18 09:02:05', '2017-10-18 09:15:01', '0000-00-00 00:00:00', '2017-10-19 02:50:02', '2017-10-19 20:59:48', '0000-00-00 00:00:00', NULL, '0-0', '4444-10479.473723412', '00:42:05', 21910, '57465952239560653077610395307566', '53400314948221893417377419446284', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48887, 20653, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E007-V1_da_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Toms onderzoek lijkt op niets uit te lopen totdat een afluisteropname nieuwe aanwijzingen biedt. Oliver is school zat en vindt een plek als stagiair. Martin woont inmiddels alleen en op zijn werk gaat het niet veel beter.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:20:10', NULL, NULL, 1, '708748bbc20fcc6211b94ccd0592b4bf', 1, 0, 'BEST,1210,480,317', '{"BEST":2206251.31}', 0, 0, NULL, 1, '2017-10-18 09:02:18', '2017-10-18 09:15:54', '0000-00-00 00:00:00', '2017-10-18 09:20:03', '2017-10-19 04:22:24', '0000-00-00 00:00:00', NULL, '0-0', '4453-10124.378885269', '00:42:10', 21911, '43658963710031936937194298295946', '38032856136054040766904509962974', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48888, 20653, NULL, 'Aflevering_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E008-V1_da_1080p25.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'Oliver krijgt dubieuze informatie te zien met mogelijk desastreuze gevolgen. Toms onderzoek begint tot zijn grote opluchting eindelijk wat resultaat op te leveren. Intussen biedt de onbetrouwbare Bondy zijn hulp aan Martin waardoor de kloof tussen hem en Jackie nog groter wordt.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:20:43', NULL, NULL, 1, '222ac746d4f76b4741704d9c615dd2b6', 1, 0, 'BEST,1210,480,317', '{"BEST":2147179.27}', 0, 0, NULL, 1, '2017-10-18 12:05:22', '2017-10-18 12:10:13', '0000-00-00 00:00:00', '2017-10-18 12:15:02', '2017-10-19 08:22:36', '0000-00-00 00:00:00', NULL, '0-0', '4332-10358.955731392', '00:41:03', 21922, '34825421957064118569518656851948', '18920475591055094091368735811252', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48889, 20653, NULL, 'Aflevering_9.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov-S001E009-V1_da_1080p25.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'De drugs staan op het punt verscheept te worden en Tom wacht het juiste moment af om toe te slaan. Oliver twijfelt nog steeds of hij de dubieuze informatie met Tom moet delen. Martins energiecentrale gaat eindelijk draaien en Jackie moet beslissen aan wiens kant ze staat.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:21:19', NULL, NULL, 1, '0f85fd68cf09bd99f827750fb8deddbc', 1, 0, 'BEST,1210,480,317', '{"BEST":2202464.33}', 0, 0, NULL, 1, '2017-10-18 12:05:07', '2017-10-18 12:11:23', '0000-00-00 00:00:00', '2017-10-18 12:15:03', '2017-10-19 08:28:49', '0000-00-00 00:00:00', NULL, '0-0', '4444-9873.7774944305', '00:42:06', 21923, '77453851948117487658496635197547', '44532410291757925246132993107064', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
