(48893, 20654, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E001_V1_sv_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Inger Johanna Vik heeft gewerkt bij de FBI om profielen op te maken van daders, maar is nu terug in Zweden met haar twee dochters. Ze heeft besloten haar kinderen boven haar werk te plaatsen. Wanneer haar oudste dochter Stina, met autisme, getuige was van een brutale moord wil ze haar oude leven absoluut niet meer terug. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:52:34', NULL, NULL, 1, '5dd6e129b5884dc2ecc98e8e24aa5b6a', 1, 0, 'BEST,1210,480,317', '{"BEST":2318548.88}', 0, 0, NULL, 1, '2017-10-18 08:58:53', '2017-10-18 09:12:44', '0000-00-00 00:00:00', '2017-10-19 02:55:02', '2017-10-19 21:23:27', '0000-00-00 00:00:00', NULL, '0-0', '4677-7780.5304441452', '00:44:16', 21897, '74143645910398710015946592282843', '92272705289729344225622765512535', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48894, 20654, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E002_V1_sv_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Inger Johanne begint te realiseren wat haar dochter heeft meegemaakt. Ingvar gaat naar Uppsala om de moord op bisschop Elisabeth Lindgren te onderzoeken. Deze nam plaats op kerstavond. Het is duidelijk dat er geheimen rondzwerven in Uppsala.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:53:04', NULL, NULL, 1, 'dbe5b26b5ed29d8c0e1daa96f2a92370', 1, 0, 'BEST,1210,480,317', '{"BEST":2287204.3}', 0, 0, NULL, 1, '2017-10-18 08:59:06', '2017-10-18 09:13:31', '0000-00-00 00:00:00', '2017-10-19 02:50:03', '2017-10-19 21:11:59', '0000-00-00 00:00:00', NULL, '0-0', '4607-7388.1981992722', '00:43:38', 21898, '28170518214714169250659661683563', '55794229202768696030917297590821', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48895, 20654, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E003_V1_sv_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Na lang twijfelen stemt Inger Johanne toe om deel uit te maken van het onderzoek. Tegelijkertijd probeert ze te begrijpen hoe de informatie die ze van haar dochter krijgt in relatie staat met  deze zaak. Is er een verband? Rolf verdenkt zijn man van een affaire en bedenkt een plan om hem te betrappen\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:53:30', NULL, NULL, 1, '20540c599746e70d0787f05c42f002bb', 1, 0, 'BEST,1210,480,317', '{"BEST":2324100.55}', 0, 0, NULL, 1, '2017-10-20 07:37:58', '2017-10-20 07:41:49', '0000-00-00 00:00:00', '2017-10-20 07:45:04', '2017-10-20 08:24:46', '0000-00-00 00:00:00', NULL, '0-0', '4677-8043.53307724', '00:44:19', 21899, '48067695705086695497829580080938', '10477925784804633616455277916413', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48896, 20654, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E004_V1_sv_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Wanneer Lennart Carlsson wordt opgeroepen voor een ondervraging bij de politie ontdekt Inger Johanne een connectie met haar eigen leven en Carlssons. Hoe is haar familie verbonden met het onderzoek? Erik gaat op bezoek bij de vrouw van de foto. Inger Johanne ontdekt een link tussen de moorden.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:53:57', NULL, NULL, 1, 'fa4a7618f1125230594d90002a267e66', 1, 0, 'BEST,1210,480,317', '{"BEST":2242559.25}', 0, 0, NULL, 1, '2017-10-18 08:59:30', '2017-10-18 09:15:53', '0000-00-00 00:00:00', '2017-10-19 04:35:03', '2017-10-19 22:54:16', '0000-00-00 00:00:00', NULL, '0-0', '4514-7702.4965105057', '00:42:46', 21900, '36367446201676251829543157562662', '33902724363850863875901822514924', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48897, 20654, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E005_V1_sv_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Ingvar vindt een spoor dat Inger Johanne’s theorie over het motief van de moorden ondersteunt. Inger Johanne herinnert zich iets uit haar FBI-tijd en misschien kan de FBI haar een verdere uitleg geven? De bisschops zoon komt naar Ingvar met een raar vermoeden.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:56:59', NULL, NULL, 1, 'd72fc7120e28e5a50fbe5c27f5f9c80b', 1, 0, 'BEST,1210,480,317', '{"BEST":2260896.37}', 0, 0, NULL, 1, '2017-10-18 08:59:39', '2017-10-18 09:16:55', '0000-00-00 00:00:00', '2017-10-19 05:20:02', '2017-10-19 23:23:32', '0000-00-00 00:00:00', NULL, '0-0', '4551-7327.6763515472', '00:43:07', 21901, '98204964736536762225699872813425', '52288224370747105250404718244610', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48898, 20654, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E006_V1_sv_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'De strop zit strakker dan ooit rond de nek van Marc Ståhl en hij bevindt zich in een zeer fragiele situatie. Wat verbergt hij? In het midden van de uitleg van de aanklagers M.O., ontdekt Inger Johanne een verschrikkelijke connectie tussen het profiel van de moordenaars en haar eigen dochter.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:57:42', NULL, NULL, 1, '0564d287d61cdb0c9870a405e34a5e82', 1, 0, 'BEST,1210,480,317', '{"BEST":2261275.15}', 0, 0, NULL, 1, '2017-10-18 08:59:47', '2017-10-18 09:17:27', '0000-00-00 00:00:00', '2017-10-19 05:25:02', '2017-10-19 23:42:33', '0000-00-00 00:00:00', NULL, '0-0', '4551-8417.7200946808', '00:43:07', 21902, '42074085707622716923011779613802', '70828178110092456734832951413783', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48899, 20654, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus-S001E007_V1_sv_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Inger Johanne komt dichter en dichter bij het onthullen van de moorden, ze ontdekt een gruwelijk bericht achtergelaten in haar huis. Ze is overtuigd dat de sleutel om dit op te lossen onder de zwarte kleur op de muur zit. Marcus Ståhl bereikt een punt waarop hij de waarheid niet langer meer kan achterhouden.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 09:58:28', NULL, NULL, 1, 'd018331995be0ba663136e08ed26a40d', 1, 0, 'BEST,1210,480,317', '{"BEST":2272499.56}', 0, 0, NULL, 1, '2017-10-18 08:59:55', '2017-10-18 09:17:50', '0000-00-00 00:00:00', '2017-10-19 05:25:03', '2017-10-19 23:48:43', '0000-00-00 00:00:00', NULL, '0-0', '4570-7711.4330635071', '00:43:20', 21903, '57461928117842613444932372380928', '92890881621061745892708877754809', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
