(48903, 20655, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/HeavyWaterWar_Ep1_8ch_no_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Nobelprijswinnaar Werner Heisenberg wordt door de Nazi-regering overgehaald om de eerste atoombom te produceren. Maar hiervoor hebben ze zwaar water nodig, dat alleen wordt gemaakt in Rjukan in Noorwegen. De Fransen en de Britten willen dit koste wat kost zien te voorkomen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 10:08:54', NULL, NULL, 1, '5fee73752ea487e464e6d547c7697f15', 1, 0, 'BEST,1210,480,317', '{"BEST":2340674.52}', 0, 0, NULL, 1, '2017-11-10 07:09:22', '2017-11-10 07:13:03', '0000-00-00 00:00:00', '2017-11-10 10:20:02', '2017-11-10 13:08:14', '0000-00-00 00:00:00', NULL, '0-0', '4761-9304.7280473709', '00:45:05', 22004, '69201174602354013005432454586499', '54663782222782625334839737558853', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48904, 20655, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/HeavyWaterWar_Ep2_8ch_no_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Terwijl de Nazi\'s werken aan de eerste atoombom, wordt de sabotagegroep Grouse opgericht om lokaal verzet te bieden. Grouse werkt samen met het Britse leger om de zwaar water fabriek op te blazen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 10:09:11', NULL, NULL, 1, '56f2eaa35dee4797dc86b2c6e1bbfacc', 1, 0, 'BEST,1210,480,317', '{"BEST":2292687.39}', 0, 0, NULL, 1, '2017-11-10 07:09:32', '2017-11-10 07:15:01', '0000-00-00 00:00:00', '2017-11-10 10:15:02', '2017-11-10 12:57:52', '0000-00-00 00:00:00', NULL, '0-0', '4663-8880.0989055634', '00:44:11', 22005, '61089460696706573934817303782602', '41780751922112072726806750424312', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48905, 20655, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/HeavyWaterWar_Ep3_8ch_no_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'De Britse missie faalt wanneer beide vliegtuigen neerstorten en de overlevenden worden gedood door de Nazi\'s. Leif Tronstad overtuigt de geallieerden ervan om een lokale eenheid in te zetten om de Vemork zwaar water fabriek te bombarderen. Deze eenheid krijgt de naam Gunnerside.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 10:09:31', NULL, NULL, 1, '93eeb56ae2930647f2a428006b81d7ec', 1, 0, 'BEST,1210,480,317', '{"BEST":2345301.03}', 0, 0, NULL, 1, '2017-11-10 07:09:41', '2017-11-10 07:15:09', '0000-00-00 00:00:00', '2017-11-10 07:20:03', '2017-11-10 10:33:34', '0000-00-00 00:00:00', NULL, '0-0', '4775-8950.4875659943', '00:45:12', 22006, '16959327769395857713919820641005', '64452144251231616408550430281682', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48906, 20655, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/HeavyWaterWar_Ep4_8ch_no_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'De beroemdste van de vier sabotage acties tijdens de Heavy Water War is die van een groep lokale saboteurs die in Engeland zijn opgeleid. Ze besloten om de Vemork fabriek in Rjukan te bombarderen. Maar eerst moeten ze over een brug zien te komen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 10:09:51', NULL, NULL, 1, '6e217b33f06c363aaca7dfd937b8fb89', 1, 0, 'BEST,1210,480,317', '{"BEST":2346561.99}', 0, 0, NULL, 1, '2017-11-10 07:09:49', '2017-11-10 07:15:43', '0000-00-00 00:00:00', '2017-11-10 10:15:03', '2017-11-10 12:57:09', '0000-00-00 00:00:00', NULL, '0-0', '4775-8087.0241746902', '00:45:12', 22007, '49116882921382299556328177665501', '19520813665339298377816373940222', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48907, 20655, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/HeavyWaterWar_Ep5_8ch_no_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'De Nazi\'s bouwen de zwaar water fabriek na het bombardement in recordtempo weer op. De directeur van de fabriek wordt nu gezien als een oorlogsmisdadiger. In Engeland besluiten de Amerikanen om Rjukan en de fabriek te bombarderen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 10:10:07', NULL, NULL, 1, '302810c531dc591423c0ab6271fdc1ec', 1, 0, 'BEST,1210,480,317', '{"BEST":2285289.72}', 0, 0, NULL, 1, '2017-11-10 07:09:58', '2017-11-10 07:15:56', '0000-00-00 00:00:00', '2017-11-10 10:25:02', '2017-11-10 13:08:25', '0000-00-00 00:00:00', NULL, '0-0', '4649-8829.3018817902', '00:44:02', 22008, '24487089943617496093400740680968', '14520083872670802609133907897191', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48908, 20655, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/HeavyWaterWar_Ep6_8ch_no_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Het Amerikaanse bombardement heeft voor vele burgerslachtoffers gezorgd, maar de productie van zwaar water kan gewoon doorgaan. De Nazi\'s besluiten de machines en al het zware water naar Duitsland te verplaatsen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-10-14 00:00:00', NULL, '2017-10-14 10:10:23', NULL, NULL, 1, '2c81a094d632c8b510c6c676eec4c358', 1, 0, 'BEST,1210,480,317', '{"BEST":2278772.31}', 0, 0, NULL, 1, '2017-11-10 07:10:08', '2017-11-10 07:17:15', '0000-00-00 00:00:00', '2017-11-10 11:05:02', '2017-11-10 13:15:55', '0000-00-00 00:00:00', NULL, '0-0', '4635-8593.2313175201', '00:43:54', 22009, '95575608139798099652950013221802', '99939846750375596876859201816255', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
