(48994, 20703, NULL, 'Episode_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep01_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Wanneer Roland Hassels baas en mentor, Yngve Ruda, brutaal vermoord wordt in Stockholm, gaat Hassel, overmand door emotie, resoluut op zoek naar de dader. Uit op wraak stelt hij, samen met enkel naaste collega’s, het ‘Triton’ team samen om Ruda’s moordenaar te vinden.\r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:43:28', NULL, NULL, 1, '646693b3e96e707e8062b42a83b1fe9d', 1, 0, 'BEST,1210,480,317', '{"BEST":2219972.54}', 0, 0, NULL, 1, '2017-11-06 06:12:02', '2017-11-06 06:15:04', '0000-00-00 00:00:00', '2017-11-06 06:20:02', '2017-11-06 08:49:56', '0000-00-00 00:00:00', NULL, '0-0', '4514-6840.6751327515', '00:42:46', 21955, '36326845329857619781462491342656', '77649503490601970187140304844155', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48995, 20703, NULL, 'Episode_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep02_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Hassels obsessieve zoektocht naar de moordenaar beïnvloedt zijn familie – zijn vriendin Daniela, en haar 14-jarige dochter Vida. Sporen leiden naar politie informant Petri Mikkola. En Fatima Nidal van Interne Zaken krijgt steeds meer interesse in Hassel en zijn team. \r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:43:45', NULL, NULL, 1, 'd858f4749c9c5a0c6801f706c5f45d2c', 1, 0, 'BEST,1210,480,317', '{"BEST":2216367.02}', 0, 0, NULL, 1, '2017-11-06 06:12:26', '2017-11-06 06:16:03', '0000-00-00 00:00:00', '2017-11-06 08:55:03', '2017-11-06 11:39:03', '0000-00-00 00:00:00', NULL, '0-0', '4495-7367.7330522537', '00:42:35', 21956, '55729697010622470568448845616565', '46869806192019752796727553456626', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48996, 20703, NULL, 'Episode_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep03_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Wanhoop en paranoia maken zich meester over Hassel – niets is nog wat het lijkt. Hassel weet niet langer wie hij kan vertrouwen, en aan wiens kant hij werkelijk staat. Hij besluit Leon Forsberg op te zoeken in de gevangenis, een crimineel én Vida’s biologische vader.\r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:43:54', NULL, NULL, 1, '8bd1189eabd85baf05782c2e1c463672', 1, 0, 'BEST,1210,480,317', '{"BEST":2201408.58}', 0, 0, NULL, 1, '2017-11-06 06:12:35', '2017-11-06 06:17:12', '0000-00-00 00:00:00', '2017-11-06 09:00:03', '2017-11-06 13:53:45', '0000-00-00 00:00:00', NULL, '0-0', '4472-7498.9350585938', '00:42:21', 21957, '47867623387010529864034217542409', '96865077651521989947357533676444', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48997, 20703, NULL, 'Episode_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep04_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Hassel en zijn collega’s blijven de criminele wereld afschuimen op zoek naar de waarheid over Ruda’s moord. Het spoor leidt nu naar Jovan ‘Bosco” Boscovic, een beruchte nachtclubeigenaar uit de Balkan, en er duiken compromitterende foto’s op. Vida onthult aan haar moeder dat Hassel één van de belangrijkste beloftes aan Daniela heeft verbroken, wat hun relatie nog meer onder druk zet.\r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:02', NULL, NULL, 1, 'b8452233eebd35855adbe28b8599f7ea', 1, 0, 'BEST,1210,480,317', '{"BEST":2253045.01}', 0, 0, NULL, 1, '2017-11-06 06:12:43', '2017-11-06 06:17:53', '0000-00-00 00:00:00', '2017-11-06 09:00:03', '2017-11-06 13:55:38', '0000-00-00 00:00:00', NULL, '0-0', '4565-7641.4574670792', '00:43:13', 21958, '75505165043243745936102213674244', '14317582239838215748270603446961', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48998, 20703, NULL, 'Episode_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep05_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Fatima Nidal brengt Daniela een stiekem bezoekje op haar werk. Bosco is terug in Zweden, en zijn ex-vriendin Andra Lovrén lijkt een belangrijk puzzelstuk in het onderzoek te hebben. Intussen brengt Fatima Nidals intern onderzoek Hassel in nauwe schoentjes. Alles lijkt verband te houden.\r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:11', NULL, NULL, 1, 'b6f9dfbe88322f142c6e8a9dfe10cec8', 1, 0, 'BEST,1210,480,317', '{"BEST":2205325.57}', 0, 0, NULL, 1, '2017-11-07 08:41:42', '2017-11-07 08:45:01', '0000-00-00 00:00:00', '2017-11-07 08:45:04', '2017-11-07 09:46:05', '0000-00-00 00:00:00', NULL, '0-0', '4467-7091.9057149887', '00:42:19', 21959, '89016359753222992941603398922435', '15560959991331482326976591710901', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(48999, 20703, NULL, 'Episode_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep06_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Fatima Nidal wil Hassel laten arresteren en het Triton team ondervragen. Maar het lijkt of iemand Nidals intern onderzoek tegenwerkt. Vida’s vader, Leon Forsberg, komt vrij en Daniela ontmoet hem buiten de gevangenis. Bosco en Hassel bevinden zich in verschillende werelden, maar begrijpen elkaar beter dan ze zouden willen toegeven. Wie voert er eigenlijk onderzoek naar wie?\r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:22', NULL, NULL, 1, 'bcd1dc951e61dbafd497a31d6d574fe5', 1, 0, 'BEST,1210,480,317', '{"BEST":2300706.51}', 0, 0, NULL, 1, '2017-11-07 08:41:54', '2017-11-07 08:46:11', '0000-00-00 00:00:00', '2017-11-07 08:50:02', '2017-11-07 09:50:16', '0000-00-00 00:00:00', NULL, '0-0', '4663-7133.8642864227', '00:44:08', 21960, '53573986835686082618963861696866', '25731110156890536877253334406026', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49000, 20703, NULL, 'Episode_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep07_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Johannes Frank grijpt weer naar de fles en brengt het hele Triton team in gevaar. Hassel ziet in dat hij via Leon Forsberg moet gaan om Bosco te bereiken. Intussen voelt Daniela zich bedreigd door Leon en ze vraagt aan Fatima Nidal om een contactverbod uit te vaardigen, maar Vida is het hier niet mee eens. De jacht op Ruda’s moordenaar neemt een volledig andere richting en omvang. \r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:28', NULL, NULL, 1, '327cee8c73c4f192d62bd6e49d529c71', 1, 0, 'BEST,1210,480,317', '{"BEST":2273417.6}', 0, 0, NULL, 1, '2017-11-06 06:13:17', '2017-11-06 06:19:19', '0000-00-00 00:00:00', '2017-11-06 11:30:02', '2017-11-06 14:50:51', '0000-00-00 00:00:00', NULL, '0-0', '4598-8253.4298391342', '00:43:35', 21961, '46830986739580932831962143147444', '16276261964599759390122257504685', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49001, 20703, NULL, 'Episode_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep08_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'Bosco wordt onder druk gezet om het onderzoek naar Ruda’s moordenaar te dwarsbomen. De paranoia binnen Triton neemt toe nu ze doorhebben dat iemand hen in de gaten houdt. Hassel en Meyer bezoeken Johannes Frank in zijn zomerhuisje maar worden in de val gelokt. Hassel en Nidal beseffen dat ze moeten samenwerken om de moordzaak op te lossen, aangezien het bewijs naar de overheid lijkt te leiden… En dan wordt Vida ontvoerd… \r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:39', NULL, NULL, 1, '053126ddfffc6ab775ef39662e12cf52', 1, 0, 'BEST,1210,480,317', '{"BEST":2214654.16}', 0, 0, NULL, 1, '2017-11-06 06:13:31', '2017-11-06 06:19:57', '0000-00-00 00:00:00', '2017-11-06 11:20:02', '2017-11-06 14:13:38', '0000-00-00 00:00:00', NULL, '0-0', '4486-7382.8474645615', '00:42:30', 21962, '17585374831537454585622653152506', '78331165147278077515368664563495', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49002, 20703, NULL, 'Episode_9.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep09_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Hassel en Meyer reizen naar Brussel om Vida terug te vinden. Plots bevinden ze zcih temidden van politieke corruptie. Wat had Ruda te maken met de Zweedse minister van Buitenlandse Zaken, Hans Rhenström? En hoe ver zijn Hassel en Daniela bereid te gaan om Vida terug te krijgen? \r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:53', NULL, NULL, 1, 'dd9a886385800d4bc50d7614d8f30b4e', 1, 0, 'BEST,1210,480,317', '{"BEST":2276707.13}', 0, 0, NULL, 1, '2017-11-06 06:13:42', '2017-11-06 06:20:33', '0000-00-00 00:00:00', '2017-11-06 06:25:02', '2017-11-06 11:32:45', '0000-00-00 00:00:00', NULL, '0-0', '4612-6822.4710941315', '00:43:40', 21963, '82584003105007761211197297599995', '87986386772430410208124192411746', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49003, 20703, NULL, 'Episode_10.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Hassel_S1_Ep10_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Hassel, Daniela en Meyer beseffen dat ze Vida enkel kunnen vinden op onconventionele manieren. Ze besluiten Hans Rehnström te ontvoeren. Hassel wordt meegezogen in een politiek spelletje, waar internationale belangen en geld heersen. Maar voor Hassel en Daniela geldt maar één ding: Vida thuisbrengen, ongeacht de prijs. \r\n', '2017-11-07', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-06 00:00:00', 3365, '2017-11-07 08:44:58', NULL, NULL, 1, '182f8293cae1335760d41293823dfe4f', 1, 0, 'BEST,1210,480,317', '{"BEST":2258660.72}', 0, 0, NULL, 1, '2017-11-06 06:13:53', '2017-11-06 06:21:00', '0000-00-00 00:00:00', '2017-11-06 11:25:04', '2017-11-06 14:39:43', '0000-00-00 00:00:00', NULL, '0-0', '4579-7066.8650388718', '00:43:21', 21964, '40180173527217198522175457539356', '70617818665909916284274323666354', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
