(49028, 20724, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep01_no_1080p25_V1.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Een jongeman wordt dood aangetroffen en Helle wordt aangewezen om het onderzoek te leiden in afwachting van versterking van buiten de stad. Onderzoekers Dreyer en Jacobi arriveren in Nemesoara en maken duidelijk dat ze geen verdere hulp van Helle nodig hebben. Tot grote irritatie van Dreyer, weigert Helle uit het onderzoek te blijven.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 08:56:54', NULL, NULL, 1, 'b0c1e089efc6e1ea96b709748b7b9596', 1, 0, 'BEST,1210,480,317', '{"BEST":2870612.84}', 0, 0, NULL, 1, '2017-11-08 09:01:26', '2017-11-08 09:06:13', '0000-00-00 00:00:00', '2017-11-08 12:00:56', '2017-11-08 15:04:41', '0000-00-00 00:00:00', NULL, '0-0', '5839-8502.5238037109', '00:55:22', 21984, '19224500451735124323317622314551', '22797132193682063519038906711758', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49029, 20724, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep03_no_1080p25_V1.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'De politie onderzoekt nu Andrea\'s moord tot wanhoop van Dreyer. Hij doet wat hij kan om het onderzoek te saboteren, zodat er geen aanwijzingen naar hem leiden. Hij verdedigt zichzelf door Helle te beschuldigen van het rampzalige resultaat van hun achtervolging. Helle wordt gedwongen zich terug te trekken uit het politieonderzoek, maar gaat op eigen houtje verder.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 08:57:17', NULL, NULL, 1, '6ec00eeb639d309bafaeb0a3ea24fb3c', 1, 0, 'BEST,1210,480,317', '{"BEST":2866406.85}', 0, 0, NULL, 1, '2017-11-08 09:05:59', '2017-11-08 09:09:54', '0000-00-00 00:00:00', '2017-11-08 12:15:03', '2017-11-08 15:23:59', '0000-00-00 00:00:00', NULL, '0-0', '5839-9031.4859647751', '00:55:24', 21986, '59753810307055210287945098199177', '60302419966824637878824049577934', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49030, 20724, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep04_no_1080p25_V1.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Kritsjon is nog steeds op vrije voeten en Jani verdwijnt. Helle en Dreyer zijn bang dat hun kansen om haar levend te vinden klein zijn. Ze hebben bijna geen tijd meer. Dreyer ontdekt dat Helle vooruitgang boekt in haar eigen onderzoek en beseft dat hij nu afhankelijk is van haar.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 08:57:43', NULL, NULL, 1, 'da0c44a0f2442bf0f6402b4e71f21cfe', 1, 0, 'BEST,1210,480,317', '{"BEST":2852360.35}', 0, 0, NULL, 1, '2017-11-08 09:06:28', '2017-11-08 09:10:54', '0000-00-00 00:00:00', '2017-11-08 09:15:02', '2017-11-08 12:29:52', '0000-00-00 00:00:00', NULL, '0-0', '5783-9102.2830104828', '00:54:51', 21987, '32149638581973655924342358658155', '96809959355586925317218723005930', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0);
