(49031, 20724, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep05_no_1080p25_V1.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Helle\'s toestand verslechtert en ze weet dat de onschuldige broer van Jani in coma ligt door haar toedoen. De politie-oversten twijfelen nog meer aan haar capaciteiten, maar Dreyer helpt haar om te maskeren wat ze heeft gedaan.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 08:58:32', NULL, NULL, 1, '7e17d1a0db048c466ba0a15fffaaa247', 1, 0, 'BEST,1210,480,317', '{"BEST":2869707.47}', 0, 0, NULL, 1, '2017-11-08 09:06:42', '2017-11-08 09:13:06', '0000-00-00 00:00:00', '2017-11-08 12:15:04', '2017-11-08 15:27:36', '0000-00-00 00:00:00', NULL, '0-0', '5825-8721.2138147354', '00:55:15', 21988, '65669996815159616152012597664869', '69462618726877921708763826939660', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49032, 20724, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep06_no_1080p25_V1.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Helle wordt geprezen als een held voor het redden van Jani en het oplossen van de drie decennia oude moorden, maar wordt nog steeds achtervolgd door schuldgevoelens. Tyra\'s moord is nog steeds niet opgelost en het onderzoek gaat verder.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 08:59:03', NULL, NULL, 1, '3b0399840bb107f5895b874334708610', 1, 0, 'BEST,1210,480,317', '{"BEST":2765111.38}', 0, 0, NULL, 1, '2017-11-08 09:06:55', '2017-11-08 09:12:42', '0000-00-00 00:00:00', '2017-11-08 12:10:03', '2017-11-08 15:08:55', '0000-00-00 00:00:00', NULL, '0-0', '5643-8082.9933023453', '00:53:31', 21989, '54686990801349250259389773463915', '26485344827489322819205187210466', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49033, 20724, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep07_no_1080p25_V1.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'De winter heeft Nemesoara nu stevig in zijn greep en de Arctische nacht is op zijn donkerst. Helle en Dreyer worden uit het onderzoek geschorst en hun methodes worden intens geïnspecteerd. Helle en Dreyer geven nog steeds niet op en besluiten het onderzoek voort te zetten, ondanks dat ze zijn geschorst.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 08:59:27', NULL, NULL, 1, 'd64d8db365e7a0f663896871ecf242ce', 1, 0, 'BEST,1210,480,317', '{"BEST":2871189.35}', 0, 0, NULL, 1, '2017-11-08 09:07:13', '2017-11-08 09:14:00', '0000-00-00 00:00:00', '2017-11-08 13:05:02', '2017-11-08 15:40:30', '0000-00-00 00:00:00', NULL, '0-0', '5867-8712.1490526199', '00:55:39', 21990, '44038136333864147803967491176297', '72090735297717745450067513075353', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49034, 20724, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Monster_S1_Ep02_no_1080p25_V1.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Helle informeert haar oversten over de staat van Dreyer de avond ervoor, maar die lijken meer geïnteresseerd in haar eigen mentale en fysieke gezondheid. Dreyer vermoedt dat ze misschien wat details hebben over het hoofd gezien op de plaats delict, en beveelt een opgraving van het gebied waar Tyra werd gevonden.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-08 00:00:00', NULL, '2017-11-08 09:02:38', NULL, NULL, 1, '098a6aed49855ca1259b9d49647da2f1', 1, 0, 'BEST,1210,480,317', '{"BEST":2752106.73}', 0, 0, NULL, 1, '2017-11-08 09:05:42', '2017-11-08 09:12:37', '0000-00-00 00:00:00', '2017-11-08 14:50:02', '2017-11-08 15:56:34', '0000-00-00 00:00:00', NULL, '0-0', '5601-8592.259762764', '00:53:06', 21985, '46649483283038114928102344091156', '93138057734179231862595961864755', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
