(49057, 20738, NULL, 'Thursday.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Trailer_FollowTheMoney.mp4', '', 3060, 0, 0, 7, 'Thursday', 'Thursday', '2017-11-16', 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-14 00:00:00', 3365, '2017-11-21 08:27:10', NULL, NULL, 1, 'f45441ae6bc4a14109990b452feea703', 1, 0, 'BEST,1210,480,317', '{"BEST":150921.56}', 0, 0, NULL, 1, '2017-11-14 14:31:40', '2017-11-14 14:33:13', '0000-00-00 00:00:00', '2017-11-14 14:35:02', '2017-11-14 14:39:22', '0000-00-00 00:00:00', '2017-11-30 10:00:00', '0-0', '301-457.35779094696', '00:02:37', 20806, '26448277147275892833495352166118', '10755071899658219156774067792819', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49071, 20125, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep01_it_1080p25_V1.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'We zijn slechts enkele minuten sinds de dood van Don Pietro. Iedereen weet dat het Ciro hem heeft vermoord, maar de vraag is: hoe is dit kunnen gebeuren? Malamo en Genny verwijten elkaar, maar ze moeten samenwerken, want het gaat erom de Onsterfelijke te vinden en de dood van hun baas te wreken.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:13:52', NULL, NULL, 1, '4072c1d979190d2cd781f241908d3a73', 1, 0, 'BEST,1210,480,317', '{"BEST":2378915.79}', 0, 0, NULL, 1, '2017-11-15 07:41:22', '2017-11-15 07:45:15', '0000-00-00 00:00:00', '2017-11-15 07:50:02', '2017-11-15 08:51:09', '0000-00-00 00:00:00', '2017-11-17 22:05:00', '0-0', '4794-8007.5012903214', '00:45:26', 22013, '52706222053982024812751186987100', '27295621508739730997764785866536', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49072, 20125, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep02_it_1080p25_V1.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Het is een jaar geleden. Genny bleef bij zijn familie in Rome, waar hij de macht overerfde van zijn schoonvader die nog steeds in de gevangenis zit. Patrizia waarschuwt hem dat Scianel uit de gevangenis tracht te raken en enkele rekeningen wil vereffenen.\r\n', '2017-11-17', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:13:42', NULL, NULL, 1, '0ab0715caf15031f9116c01a81ce9760', 1, 0, 'BEST,1210,480,317', '{"BEST":2679512.28}', 0, 0, NULL, 1, '2017-11-15 07:41:57', '2017-11-15 07:46:27', '0000-00-00 00:00:00', '2017-11-15 07:50:03', '2017-11-15 08:56:21', '0000-00-00 00:00:00', '2017-11-17 22:05:00', '0-0', '5396-8697.1827983856', '00:51:10', 22014, '32333668410459230887262705562233', '55919823185695826351256641954080', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49073, 20125, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep03_it_1080p25_V1.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Ciro is een nieuw leven begonnen in Bulgarije, waar hij de rechterhand werd van drugshandelaar Valentin. Mladen, zoon van Valentin, heeft een troebele relatie met zijn vader. Om hem in de problemen te brengen, beraamt hij een plan dat Ciro met zijn verleden confronteert.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:42:29', NULL, NULL, 1, '828cd6ab1ee35cb91f8456953faab8c5', 1, 0, 'BEST,1210,480,317', '{"BEST":2725238.9}', 0, 0, NULL, 1, '2017-11-21 08:37:16', '2017-11-21 08:41:41', '0000-00-00 00:00:00', '2017-11-21 08:45:02', '2017-11-21 10:19:08', '0000-00-00 00:00:00', '2017-11-24 22:05:00', '0-0', '5494-9141.8668079376', '00:52:04', 22015, '25117860459935022187798738275562', '60198436112920933794712433211798', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49074, 20125, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep04_it_1080p25_V1.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Scianel is terug op vrije voeten, Genny weet dat hij moet reageren om Patrizia te helpen. In Rome bereidt Avitabile een tegenaanval voor door gebruik te maken van de mensen die het dichtst bij hem staan. Ondertussen houdt iemand in de schaduw een kleine groep jongeren die geen plaats hebben in de maatschappij in de gaten…\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:42:44', NULL, NULL, 1, '6e44a15980d1d21fcbc528c9cc30556d', 1, 0, 'BEST,1210,480,317', '{"BEST":2848292.49}', 0, 0, NULL, 1, '2017-11-21 08:37:30', '2017-11-21 08:43:00', '0000-00-00 00:00:00', '2017-11-21 08:45:03', '2017-11-21 10:25:48', '0000-00-00 00:00:00', '2017-11-24 22:05:00', '0-0', '5741-9707.2097167969', '00:54:24', 22025, '13541627909597446956640216768387', '55940087280961202934101387072741', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49075, 20125, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep05_it_1080p25_V1.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Enzo en zijn kameraden maken indruk op Ciro met hun diefstal van smokkelwaar. Genny zoekt noodgedwongen een nieuwe cocaïneleverancier.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:48:53', NULL, NULL, 1, 'c6ba435478e7da7125a35825d2ab5a3c', 1, 0, 'BEST,1210,480,317', '{"BEST":2380789.12}', 0, 0, NULL, 1, '2017-11-21 08:37:39', '2017-11-21 08:43:23', '0000-00-00 00:00:00', '2017-11-21 10:10:03', '2017-11-21 10:52:26', '0000-00-00 00:00:00', '2017-12-01 22:05:00', '0-0', '4817-8425.3359489441', '00:45:39', 22026, '33082624205364129017863835932619', '22256218849023100035724473031667', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49076, 20125, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep06_it_1080p25_V1.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Dankzij de opbrengsten van de nieuwe drugskanalen, zet Genny Sistema aan het werk om afpersingspraktijken te starten binnen enkele bedrijven in moeilijkheden. Genny staat sterk in zijn nieuwe positie, sluit een overeenkomst met Scianel en overtuigt hem van de noodzaak om nieuwe territoria te veroveren.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:49:05', NULL, NULL, 1, 'b13c53eb9a69352f5ce4e2a65046158d', 1, 0, 'BEST,1210,480,317', '{"BEST":2538153.41}', 0, 0, NULL, 1, '2017-11-24 16:13:34', '2017-11-24 16:17:43', '0000-00-00 00:00:00', '2017-11-24 16:20:03', '2017-11-24 17:00:43', '0000-00-00 00:00:00', '2017-12-01 22:05:00', '0-0', '5116-8446.1068716049', '00:48:29', 22037, '43754643919760251886324143719013', '39873427149477878534460654197976', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49077, 20125, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep07_it_1080p25_V1.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Dankzij het advies van Ciro en de contacten van Valerio opent Enzo nieuwe distributiekanalen in het centrum van Napels. Maar hun handel blijft niet lang onopgemerkt; de bazen van het centrum willen graag hard reageren, maar besluiten uiteindelijk tijd te nemen: voor ze handelen moeten ze precies begrijpen met wie ze te maken hebben…\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:49:36', NULL, NULL, 1, '39fd0bb6df13c8e89bbf7db0372df7ea', 1, 0, 'BEST,1210,480,317', '{"BEST":2276931.09}', 0, 0, NULL, 1, '2017-11-30 12:58:48', '2017-11-30 13:02:40', '0000-00-00 00:00:00', '2017-11-30 13:05:02', '2017-11-30 13:41:34', '0000-00-00 00:00:00', '2017-12-08 22:05:00', '0-0', '4607-7167.3003835678', '00:43:36', 22049, '64968176330681962236381333957254', '20150542868290443043629544282406', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49078, 20125, NULL, 'Aflevering_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep08_it_1080p25_V1.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'Enzo wordt aangevallen. Hij wil onmiddellijk reageren, maar Ciro weet hem te bedaren. Een tegenaanval moet goed voorbereid zijn, gebruikmakend van de zwakheden van de tegenstanders…\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:49:45', NULL, NULL, 1, '68453fe4a8fe4478c75986c5da65af22', 1, 0, 'BEST,1210,480,317', '{"BEST":2448275.46}', 0, 0, NULL, 1, '2017-12-01 15:26:13', '2017-12-01 15:30:13', '0000-00-00 00:00:00', '2017-12-01 15:35:02', '2017-12-01 16:14:00', '0000-00-00 00:00:00', '2017-12-08 22:05:00', '0-0', '4920-8070.4847021103', '00:46:36', 22050, '32348923527699531183873866641682', '65024118649904074991253933265515', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49079, 20125, NULL, 'Aflevering_9.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep09_it_1080p25_V1.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Ciro gaat met O\'Stregone naar het parlement voor een wapenstilstand. De Confederati zijn gedwongen toe te geven maar stellen zelf ook een pak eisen. Enzo is eindelijk vrij om te vieren wat hij heeft bereikt. De vreugde duurt echter niet lang, want de moeizaam verkregen vrede wordt onmiddellijk verbroken.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:50:09', NULL, NULL, 1, 'f819f4ad5ee255b25df6d5418b8f9f6a', 1, 0, 'BEST,1210,480,317', '{"BEST":2195494.69}', 0, 0, NULL, 1, '2017-12-12 09:59:02', '2017-12-12 10:02:24', '0000-00-00 00:00:00', '2017-12-12 10:05:02', '2017-12-12 11:00:39', '0000-00-00 00:00:00', '2017-12-15 22:05:00', '0-0', '4411-7260.5181751251', '00:41:47', 22075, '55651053880635882428741663412414', '48798879622542305921217348427050', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49080, 20125, NULL, 'Aflevering_10.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep10_it_1080p25_V1.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Genny staat onder arrest. Hij steunt op Patrizia om te begrijpen hoe de toestand bij de Confederati is. Hij aanvaardt terugtrekking en overtuigt zijn medestanders hetzelfde te doen. Enzo wordt ook overtuigd: wie zich niet aan de nieuwe overeenkomst houdt, zal betalen met zijn leven.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:50:18', NULL, NULL, 1, '26f17e8dbf8c2c06485d08cb0bd067e3', 1, 0, 'BEST,1210,480,317', '{"BEST":2291407.17}', 0, 0, NULL, 1, '2017-12-12 09:59:44', '2017-12-12 10:03:08', '0000-00-00 00:00:00', '2017-12-12 10:05:03', '2017-12-12 11:03:33', '0000-00-00 00:00:00', '2017-12-15 22:05:00', '0-0', '4598-7790.8931818008', '00:43:35', 22076, '12720727420857855333010828534265', '96588175883976533182639416937452', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49081, 20125, NULL, 'Aflevering_11.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep11_it_1080p25_V1.mp4', '', 3060, 0, 0, 11, 'Aflevering 11', 'Azzurra en Pietrino komen in het vizier van de Confederati. Om hen te redden moet GEnny een plan ontwikkelen waarvan de variabelen niet te overzien zijn. Als iets fout loopt, zou Genny alles verliezen wat hem aanbelangt: zijn macht en zijn familie.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:50:51', NULL, NULL, 1, 'f1282bc2b5490a62a0efc75c6da1353e', 1, 0, 'BEST,1210,480,317', '{"BEST":2256947.42}', 0, 0, NULL, 1, '2017-12-21 17:06:08', '2017-12-21 17:10:18', '0000-00-00 00:00:00', '2017-12-21 17:15:02', '2017-12-21 18:13:06', '0000-00-00 00:00:00', '2017-12-22 22:05:00', '0-0', '4537-8634.7035512924', '00:42:59', 22288, '21470837587013617785227162324358', '10734512855166023675917608359381', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49082, 20125, NULL, 'Aflevering_12.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Gomorra_S3_Ep12_it_1080p25_V1.mp4', '', 3060, 0, 0, 12, 'Aflevering 12', 'Ciro, Genny en Enzo sluiten vrede met de Confederati en winnen zo enkele van de territoria van het centrum van Napels. Maar terwijl het verbond gesloten wordt, wil iemand vanuit de schaduw alles terug opblazen.\r\n', '2017-11-15', 1, 3, 0, 0, 1, 1, NULL, 3365, '2017-11-15 00:00:00', 3365, '2017-11-17 15:51:03', NULL, NULL, 1, 'f463656da1addb7faaecce7bbf074054', 1, 0, 'BEST,1210,480,317', '{"BEST":2224454.27}', 0, 0, NULL, 1, '2017-12-21 17:06:23', '2017-12-21 17:11:32', '0000-00-00 00:00:00', '2017-12-21 17:15:03', '2017-12-21 18:13:40', '0000-00-00 00:00:00', '2017-12-22 22:05:00', '0-0', '4677-7047.1404838562', '00:44:20', 22289, '97372464671029304925749552878125', '52375448905791228345069912575528', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
