(49105, 20761, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Alex_S1_Ep1_2ch_sv_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Tijdens een vuurgevecht vermoordt de louche agent Alex Leko per ongeluk zijn partner en beste vriend Martin. Overmand door schuldgevoelens, besluit Alex zijn banden met de plaatselijke misdaadbaas BG door te knippen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-11-21 00:00:00', NULL, '2017-11-21 10:58:27', NULL, NULL, 1, '8cbf80b9807fe5a9303612d700338aba', 1, 0, 'BEST,1210,480,317', '{"BEST":2497010.99}', 0, 0, NULL, 1, '2017-11-21 11:07:26', '2017-11-21 11:12:57', '0000-00-00 00:00:00', '2017-11-21 14:55:03', '2017-11-21 21:44:28', '0000-00-00 00:00:00', NULL, '0-0', '5074-10089.466300964', '00:48:05', 22019, '69655369243449618463099584318196', '65787481857865458734131076282572', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
