(49194, 20233, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep01_sv_1080p25_V1.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Bijna twee jaar later zit Saga Norén in de vrouwengevangenis haar straf uit. Intussen moet Henrik Sabroe zonder haar hulp de moordenaar van een gestenigde vrouw zien op te sporen. Ook de hopeloze zoektocht naar zijn twee vermiste dochters blijft vruchteloos. \r\n', '2017-12-06', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:54:40', NULL, NULL, 1, '1e4be82281a54a839c8849d1e7440d32', 1, 0, 'BEST,1210,480,317', '{"BEST":3024565.4}', 0, 0, NULL, 1, '2017-12-27 09:19:33', '2017-12-27 09:24:38', '0000-00-00 00:00:00', '2017-12-27 09:25:02', '2017-12-27 13:31:22', '0000-00-00 00:00:00', '2018-01-01 22:05:00', '0-0', '6091-7988.2313270569', '00:57:44', 22290, '25640624086548142091452966642939', '12248149197957123843154140716981', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49195, 20233, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep02_sv_1080p25_V1.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Het onderzoek naar de moordenaar vertakt zich in twee verrassend richtingen. Intussen wordt het voor Saga toch mogelijk deel uit te maken van het onderzoek, waarbij ze niet alleen connecties vindt met een andere moord maar ook informatie te weten komt over Henriks vrouw.', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:55:06', NULL, NULL, 1, 'a26c96613b3f59a7e192d47aab21f457', 1, 0, 'BEST,1210,480,317', '{"BEST":3036154.54}', 0, 0, NULL, 1, '2017-12-27 09:19:43', '2017-12-27 09:25:19', '0000-00-00 00:00:00', '2017-12-27 09:30:03', '2017-12-27 13:52:29', '0000-00-00 00:00:00', '2018-01-07 22:05:00', '0-0', '6110-8380.9931182861', '00:57:57', 22291, '46937291159996544454798680690358', '88756617586681130136526998926397', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49196, 20233, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep03_sv_1080p25_V1.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Het is moeilijk vat te krijgen op de wispelturige verdachten, maar dan vinden Saga en Henrik informatie die hen op een nieuw spoor brengt. Saga heeft psychologische hulp nodig en is het bovendien niet altijd eens met Henriks werkwijze… ', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:55:28', NULL, NULL, 1, 'f611d5fbcb1d365a6e4ff6dcd52296f6', 1, 0, 'BEST,1210,480,317', '{"BEST":3047609.09}', 0, 0, NULL, 1, '2018-01-04 13:17:58', '2018-01-04 13:21:37', '0000-00-00 00:00:00', '2018-01-04 13:25:02', '2018-01-04 14:42:27', '0000-00-00 00:00:00', '2018-01-14 23:55:00', '0-0', '6133-8182.1840782166', '00:58:10', 22309, '82144260471462522036084668411764', '23578631138648474139744459857215', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49197, 20233, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep04_sv_1080p25_V1.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Net nu de hoofdverdachte op vrije voeten is, doet er zich nóg een moord voor. Saga legt eindelijk de puzzelstukjes bij elkaar en beseft dat deze moord niet de laatste zal zijn. Intussen blijft ze sceptisch tegenover haar therapeutische sessies. ', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:55:40', NULL, NULL, 1, '7c1abf44854fdd13b61dc6f183ce60f8', 1, 0, 'BEST,1210,480,317', '{"BEST":3074608.99}', 0, 0, NULL, 1, '2018-01-04 13:18:06', '2018-01-04 13:23:05', '0000-00-00 00:00:00', '2018-01-04 13:25:03', '2018-01-04 14:44:54', '0000-00-00 00:00:00', '2018-01-21 23:55:00', '0-0', '6189-8516.9876670837', '00:58:41', 22310, '92376955365758952268174020470813', '81117532099695083663213670895962', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49198, 20233, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep05_sv_1080p25_V1.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Het aantal verdachten groeit. Taxichauffeur Dan Brolund wordt naar voren gebracht voor ondervraging. Tegelijkertijd groeien er vermoedens over het Sonning-paar. En de echtgenoot van de broer van Morgan maakt zich ook verdacht. De leiding bij de Deense politie wil zo snel mogelijk een arrestatie zien.', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:55:54', NULL, NULL, 1, 'ca6127525a83011e6a686a3e49cad955', 1, 0, 'BEST,1210,480,317', '{"BEST":3075121.46}', 0, 0, NULL, 1, '2018-01-23 13:16:04', '2018-01-23 13:20:28', '0000-00-00 00:00:00', '2018-01-23 13:25:03', '2018-01-23 17:47:17', '0000-00-00 00:00:00', '2018-01-28 23:55:00', '0-0', '6189-8778.5364055634', '00:58:42', 22386, '89700161679091823451287733627104', '95730060319019286445319974387703', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49199, 20233, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep06_sv_1080p25_V1.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Henrik denkt dat hij de connectie tussen alle slachtoffers heeft gevonden. Er komt een diepe kloof tussen hem en Saga. Saga probeert het uit te leggen en geeft toe dat ze denkt dat ze verliefd op hem is. Maar Henrik voelt geen begrip en drijft haar het huis uit. Ze beslist onderzoek te doen naar zijn verdwenen dochters om zo terug dichter bij hem te raken.', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:55:58', NULL, NULL, 1, '94e5334342049bf8fc3c617362be2304', 1, 0, 'BEST,1210,480,317', '{"BEST":3073547.48}', 0, 0, NULL, 1, '2018-01-23 13:17:14', '2018-01-23 13:22:24', '0000-00-00 00:00:00', '2018-01-23 17:55:02', '2018-01-23 20:39:26', '0000-00-00 00:00:00', '2018-02-04 23:55:00', '0-0', '6180-8573.0650777817', '00:58:39', 22387, '53062403499633462862223511631025', '55169136392004539926342484852566', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49200, 20233, NULL, 'Aflevering_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep08_sv_1080p25_V1.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'De dakloze meisjes weten nu wie de moordenaar is. Ze proberen Henrik te bereiken, terwijl de moordenaar hen op de hielen zit. In tussentijd leiden vingerafdrukken naar een spoor. Een klein detail zet het hele onderzoek weer op losse schroeven…', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:56:04', NULL, NULL, 1, 'bc5cbed16977e921c857898f3754ca5c', 1, 0, 'BEST,1210,480,317', '{"BEST":3060289.63}', 0, 0, NULL, 1, '2018-01-23 13:17:28', '2018-01-23 13:23:37', '0000-00-00 00:00:00', '2018-01-23 17:50:02', '2018-01-23 20:34:00', '0000-00-00 00:00:00', '2018-02-18 23:55:00', '0-0', '6180-8390.8705377579', '00:58:39', 22389, '70601865858447740553895985303506', '26909440060709947872446538346872', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49201, 20233, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/TheBridge_S4_Ep07_sv_1080p25_V1.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Het onderzoek over Tommy gaat verder. Lillian staat onder grote druk om de zaak op te lossen en ze heeft een vermoeden dat iemand van het team informatie lekt. Een onaangename verrassing wacht haar op bij thuiskomt. Een jongeman wil de moord op zijn vader opbiechten. Saga beseft dat dit verhaal in verband staat met Henriks familie. ', '2017-12-21', 1, 4, 0, 0, 1, 1, NULL, 3365, '2017-12-06 00:00:00', 3365, '2018-01-30 05:56:11', NULL, NULL, 1, '80c713ef32f2cb8ae3361dbd27a9c81b', 1, 0, 'BEST,1210,480,317', '{"BEST":3066394}', 0, 0, NULL, 1, '2018-01-23 13:17:43', '2018-01-23 13:24:45', '0000-00-00 00:00:00', '2018-01-23 18:05:02', '2018-01-23 20:40:33', '0000-00-00 00:00:00', '2018-02-11 23:55:00', '0-0', '6166-8058.1236591339', '00:58:31', 22388, '77554193742738298834619241591078', '27779583756758127427901803727778', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
