(49229, 20812, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/LizaMarklundsAnnikaBengtzon-S001E001-V1_sv_20_FullMix.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Als misdaadverslaggeefster Annika Bengtzon voor de Zweedse tabloid Kvällspressen het Nobelprijsgala verslaat, is ze getuige van een spectaculaire moord die vlak voor haar ogen wordt gepleegd. Er worden twee mensen neergeschoten: de controversiële winnaar van de Nobelprijs voor de Geneeskunde Aaron Wiesel, en Caroline von Behring, voorzitter van het Nobelcomité. Annika is de belangrijkste getuige en mag van de politie niets loslaten over wat ze heeft gezien. Een ware ramp voor haar. Zo’n belangrijk verhaal, en ze mag er niks over schrijven. De internationale pers en de politie zitten erbovenop. Iedereen denkt dat het een terroristische aanslag was, gericht tegen de Israëlische hoogleraar Wiesel. Annika raakt er echter van overtuigd dat Caroline von Behring het eigenlijke doelwit was. Om dit na te trekken doet Annika onderzoek naar de geheimzinnige werkwijze en de machtsstrijd binnen het gesloten bolwerk van het Nobelcomité. Als Annika de waarheid dreigt te ontdekken en ze haar verhaal bijna rond heeft, wordt het voor haar pas echt gevaarlijk. Ze komt er al snel achter hoe ver sommige mensen bereid zijn te gaan om de prijs der prijzen te krijgen…\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-07 00:00:00', NULL, '2017-12-07 13:01:42', NULL, NULL, 1, '77397971db7cfab9633924c13050bf62', 1, 0, 'BEST,1210,480,317', '{"BEST":4612281.46}', 0, 0, NULL, 1, '2017-12-07 13:07:07', '2017-12-07 13:13:32', '0000-00-00 00:00:00', '2017-12-07 13:15:03', '2017-12-07 18:46:08', '0000-00-00 00:00:00', NULL, '0-0', '9395-16715.435697556', '01:29:12', 21856, '41244808661248963294026719902551', '79490244327992816569717468316008', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0);
