(49230, 20812, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/LizaMarklundsAnnikaBengtzon-S001E002-V1_sv_20_FullMix.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Vlak voordat ze naar een familiefeestje zullen vertrekken, laat Annika haar vriend Thomas en hun twee kinderen achter om de moord op de beroemde tv-presentatrice Michelle Carlsson te verslaan. De moord is gepleegd in een slot buiten Stockholm, het decor voor een tv-programma met Michelle. Tien mensen hebben daar de nacht doorgebracht en de politie vermoedt dat een van hen de dader is. Annika’s wereld staat op zijn kop als ze ontdekt dat haar beste vriendin Anne de hoofdverdachte is. Uiteindelijk vinden Anne en Annika bewijsmateriaal dat Anne vrijpleit en waaruit blijkt wie de werkelijke moordenaar is. Annika keert overwerkt en vermoeid terug bij haar gezin. Ze verzoent zich met Thomas en in een moment van tederheid beseffen ze allebei dat ze willen trouwen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-07 00:00:00', NULL, '2017-12-07 13:02:14', NULL, NULL, 1, 'eef3298c9cda3e9623ea25d2230ec88e', 1, 0, 'BEST,1210,480,317', '{"BEST":4673486.94}', 0, 0, NULL, 1, '2017-12-07 13:07:20', '2017-12-07 13:14:38', '0000-00-00 00:00:00', '2017-12-07 18:55:04', '2017-12-07 23:04:58', '0000-00-00 00:00:00', NULL, '0-0', '9437-18406.402261734', '01:29:36', 21858, '48153208648944321177753833102153', '13839210511621997534153674157621', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49231, 20812, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/LizaMarklundsAnnikaBengtzon-S001E003-V1_sv_20_FullMix.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Een jonge vrouw, een stripper in een club die Studio Sex heet, wordt vermoord. De zaak blijkt politiek gevoelig te liggen als de politie ontdekt dat de minister van Handel de club de nacht voor de moord heeft bezocht. Annika verslaat de zaak en vindt bewijs dat de minister die nacht elders was. Hij kan alleen niet vertellen waar, omdat dat een enorm schandaal aan het licht zou brengen. In plaats daarvan biedt hij zijn ontslag aan. De politie en Annika zijn ervan overtuigd dat de vriend van het slachtoffer de moordenaar is, maar dat kunnen ze niet bewijzen. De situatie doet Annika denken aan haar eigen traumatische verleden, waarin ze een relatie had met een gewelddadige man. Gefrustreerd en gekweld gaat Annika over haar professionele grenzen heen, en zet ze haar leven op het spel om te zorgen dat de vriend van de vermoorde vrouw wordt veroordeeld.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-07 00:00:00', NULL, '2017-12-07 13:02:25', NULL, NULL, 1, 'b47ea67781941189af94d2e217161684', 1, 0, 'BEST,1210,480,317', '{"BEST":4654060.76}', 0, 0, NULL, 1, '2017-12-07 13:07:28', '2017-12-07 13:15:36', '0000-00-00 00:00:00', '2017-12-07 13:20:02', '2017-12-07 19:18:50', '0000-00-00 00:00:00', NULL, '0-0', '9442-17544.499856949', '01:29:42', 21860, '68858737275531447933911103972671', '29534269862741770211155060322045', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49232, 20812, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/LizaMarklundsAnnikaBengtzon-S001E004-V1_sv_20_FullMix.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'In de donkere winter van Noord-Zweden wordt een journalist vermoord. Annika beseft dat de moord verband houdt met een terroristische aanslag van veertig jaar geleden; een aanslag waarvan de journalist te veel afwist. Annika gaat op zoek naar de moordenaar, waarbij ze in een web van terrorisme en oude connecties belandt dat is ontstaan in een extreem linkse beweging in de jaren ’60, en zich uitstrekt tot in de huidige liberale regering. Ondertussen komt Annika er tot haar schrik achter dat haar man Thomas haar bedriegt met een collega. Boos en gekwetst gebruikt ze de Kvällspressen om de minnares in de problemen te brengen. De hele situatie keert zich tegen Annika als Thomas doorkrijgt wat ze heeft gedaan. Ze voelen zich allebei verraden. Thomas vertrekt, en is het duidelijk dat hun huwelijk niet meer te redden is.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-07 00:00:00', NULL, '2017-12-07 13:02:37', NULL, NULL, 1, '44b169b864f2beeb97b1d5b282a3ca93', 1, 0, 'BEST,1210,480,317', '{"BEST":4612868.69}', 0, 0, NULL, 1, '2017-12-07 13:07:39', '2017-12-07 13:16:24', '0000-00-00 00:00:00', '2017-12-07 18:40:02', '2017-12-07 22:58:00', '0000-00-00 00:00:00', NULL, '0-0', '9358-16158.856599808', '01:28:52', 21862, '38496103207737063090312484322425', '48093970391672674165846172436432', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49233, 20812, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/LizaMarklundsAnnikaBengtzon-S001E005-V1_sv_20_FullMix.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Annika is eenzaam en gescheiden. Ze brengt veel tijd door op haar werk om haar ellende te vergeten. Ze verslaat een vreemde moord: een jonge politieagente wordt ervan beschuldigd dat ze haar man, een politieagent, heeft vermoord en haar zoon verborgen houdt. Annika vermoedt dat er meer aan de hand is, omdat er aanwijzingen zijn dat de vermoorde agent corrupt en gewelddadig was. Het wordt nog spannender wanneer iemand dreigt Annika te vermoorden als ze deze zaak niet laat rusten. Annika is niet zo snel bang, en dankzij haar vasthoudendheid weet de politie uiteindelijk de echte dader te pakken en de vermiste jongen te vinden. \r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-07 00:00:00', NULL, '2017-12-07 13:02:51', NULL, NULL, 1, '874d0049df81546e041a1d82a75f5046', 1, 0, 'BEST,1210,480,317', '{"BEST":4611199.36}', 0, 0, NULL, 1, '2017-12-07 13:07:52', '2017-12-07 13:17:52', '0000-00-00 00:00:00', '2017-12-07 18:45:02', '2017-12-07 22:59:12', '0000-00-00 00:00:00', NULL, '0-0', '9339-16223.465986252', '01:28:43', 21864, '26436153109788711420035817818562', '79619814094622455965395214532022', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49234, 20812, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/LizaMarklundsAnnikaBengtzon-S001E006-V1_sv_20_FullMix.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Aan de Costa del Sol in Spanje wordt een Zweeds gezin vermoord bij een inbraak. Annika gaat erheen om het misdrijf te verslaan en ontdekt dat een dochter uit het gezin spoorloos is verdwenen. Als Annika onderzoekt wat er met de dochter is gebeurd, wordt duidelijk dat de moorden verband houden met de handel in hasjiesj, die afkomstig is van kwekerijen in Marokko en op straat in Zweden wordt verkocht. Toevallig zit Thomas ook voor zijn werk aan de Costa del Sol als Annika daar is. De twee gaan samen uit eten en kunnen ineens met elkaar praten zonder elkaar te beschuldigen en zonder ruzie te maken. Als ze elkaar in Stockholm opnieuw ontmoeten, is er een sprankje hoop dat de liefde tussen hen nog niet helemaal is verdwenen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-07 00:00:00', NULL, '2017-12-07 13:03:03', NULL, NULL, 1, '19bc302af9c5056c233dc2305619041d', 1, 0, 'BEST,1210,480,317', '{"BEST":4661312.7}', 0, 0, NULL, 1, '2017-12-11 07:01:35', '2017-12-11 07:06:53', '0000-00-00 00:00:00', '2017-12-11 07:10:02', '2017-12-11 08:28:24', '0000-00-00 00:00:00', NULL, '0-0', '9423-16159.184365273', '01:29:29', 21866, '11412028749794225134963316546463', '15441469651306100773902783670402', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
