(49255, 20823, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/RideUponTheStorm_S1_Ep01_da_1080p25.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Denemarken, 2017. De Krogh-familie brengt al 250 jaar priesters voort. Johannes, het huidige hoofd van het gezin, is op weg naar de absolute top als bisschop van Kopenhagen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-12 00:00:00', NULL, '2017-12-12 12:17:14', NULL, NULL, 1, 'aaf511de2b8a34a8da04758826d1abb3', 1, 0, 'BEST,1210,480,317', '{"BEST":3096572.28}', 0, 0, NULL, 1, '2017-12-12 12:34:17', '2017-12-12 12:40:36', '0000-00-00 00:00:00', '2017-12-12 12:45:02', '2017-12-12 17:30:38', '0000-00-00 00:00:00', NULL, '0-0', '6287-12907.246294022', '00:59:38', 22077, '92355583302428272008224576552446', '59185518536342353902382675522163', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49256, 20823, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/RideUponTheStorm_S1_Ep02_da_1080p25.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Johannes realiseert zich dat zijn gevoel voor dramatiek in zijn functie als priester niet echt past in de plannen van de bisschop. Dat zit hem zwaar en creëert wrijving in de relatie tussen Johannes en Elisabeth.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-12 00:00:00', NULL, '2017-12-12 12:17:23', NULL, NULL, 1, 'e34be3aba22acfd0538e4b0fd963ed0d', 1, 0, 'BEST,1210,480,317', '{"BEST":3041609.29}', 0, 0, NULL, 1, '2017-12-12 12:34:26', '2017-12-12 12:40:21', '0000-00-00 00:00:00', '2017-12-12 12:45:03', '2017-12-12 17:37:27', '0000-00-00 00:00:00', NULL, '0-0', '6180-13319.862440109', '00:58:37', 22078, '13115732277631057229053347507052', '38694356168436029888556589694304', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
