(49262, 20823, NULL, 'Aflevering_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/RideUponTheStorm_S1_Ep08_da_1080p25.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'August begint te werken als straatpastor, waar hij terechtkomt in een zaak van twee broers die illegaal in Denemarken verblijven - beiden zijn afgewezen asielzoekers. Hij raakt dieper en dieper betrokken bij het lot van de broers en doet er alles aan om hen te helpen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-12 00:00:00', NULL, '2017-12-12 12:19:02', NULL, NULL, 1, 'a3f0bf3bab7b197f173b2fc81a275eae', 1, 0, 'BEST,1210,480,317', '{"BEST":3046190.01}', 0, 0, NULL, 1, '2017-12-12 12:35:19', '2017-12-12 12:44:22', '0000-00-00 00:00:00', '2017-12-12 21:05:02', '2017-12-12 23:13:28', '0000-00-00 00:00:00', NULL, '0-0', '6189-12460.516695023', '00:58:42', 22084, '78805845806341467019157058196271', '38773455225997286419153210175361', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49263, 20823, NULL, 'Aflevering_9.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/RideUponTheStorm_S1_Ep09_da_1080p25.mp4', '', 3060, 0, 0, 9, 'Aflevering 9', 'Met Amira\'s hulp koopt Christian zijn eigen appartement. Zijn grote, jeugdliefde Nanna, vertelt een verhaal dat de sowieso al slechte relatie tussen Johannes en Christian verder er niet beter op maakt. De relatie tussen Christian met Amira wordt ook op de proef gesteld.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-12 00:00:00', NULL, '2017-12-12 12:19:10', NULL, NULL, 1, '4ffd6130f73d7f56bbb4945039a91131', 1, 0, 'BEST,1210,480,317', '{"BEST":2963762.16}', 0, 0, NULL, 1, '2017-12-12 12:35:29', '2017-12-12 12:44:12', '0000-00-00 00:00:00', '2017-12-12 21:10:02', '2017-12-12 23:10:36', '0000-00-00 00:00:00', NULL, '0-0', '6021-11282.890524864', '00:57:05', 22085, '65858247648520284938390546126169', '51396578382449342126379125871357', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49264, 20823, NULL, 'Aflevering_10.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/RideUponTheStorm_S1_Ep10_da_1080p25.mp4', '', 3060, 0, 0, 10, 'Aflevering 10', 'Dit jaar wordt de grootse traditionele Pinksterdienst in de Johannes Lindegard-kerk bijgewoond door een belangrijke gast, de bisschop van Kopenhagen, evenals een reeks priesters waar Johannes hoofd van is. Het lijkt er uiteindelijk op dat Johannes zijn relatie met de bisschop en zijn collega\'s heeft genormaliseerd.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2017-12-12 00:00:00', NULL, '2017-12-12 12:19:18', NULL, NULL, 1, '772b0baed68e072715d9958602a7a8c3', 1, 0, 'BEST,1210,480,317', '{"BEST":3044452.74}', 0, 0, NULL, 1, '2017-12-12 12:35:39', '2017-12-12 12:45:48', '0000-00-00 00:00:00', '2017-12-12 12:50:02', '2017-12-12 21:47:36', '0000-00-00 00:00:00', NULL, '0-0', '6189-12794.999520302', '00:58:42', 22086, '26197408780901432449239180372047', '54801770335313139796878938962787', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
