(49358, 20653, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov_S2_Ep01_da_1080p25_V1.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Bonden\'s bouwbedrijf gaat failliet wanneer hij wordt veroordeeld tot 14 jaar celstraf voor drugshandel. Zijn vrouw Claudia zet alles in het werk om de toekomst van haar dochter desondanks veilig te stellen. Ondertussen moet Tom leven met het feit dat hij zijn jeugdvriend achter de tralies heeft gestopt, en Claudia is niet van plan te vergeven.\r\n', '2018-01-12', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-12 00:00:00', 3365, '2018-01-12 06:04:06', NULL, NULL, 1, 'bfaac30872cb86835b1fd11b4e4129d8', 1, 0, 'BEST,1210,480,317', '{"BEST":2110858.75}', 0, 0, NULL, 1, '2018-01-12 06:02:24', '2018-01-12 06:05:40', '0000-00-00 00:00:00', '2018-01-12 06:10:02', '2018-01-12 08:32:21', '0000-00-00 00:00:00', '2018-01-16 00:00:00', '0-0', '4248-6831.422700882', '00:40:15', 22315, '90658128216723107231349833483874', '23553169490049424184036924538756', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49359, 20653, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov_S2_Ep02_da_1080p25_V1.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'Het gerucht gaat dat Olivers grootvader misschien wel zijn vader is, terwijl Klemme en Simone hem trachten te overhalen tot een overval. Jackie kan het niet meer aan met hem wanneer ze zijn illegale pillen vindt. Claudia wordt voor verhoor naar het politiebureau gebracht en Tom en Brammer onderzoeken het toenemende aantal inbraken. Bondesen Byg heeft al zijn klanten verloren, maar Claudia weigert op te geven en bedenkt een plan om het bedrijf te redden.\r\n', '2018-01-12', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-12 00:00:00', 3365, '2018-01-12 06:04:16', NULL, NULL, 1, 'af5ed76b466a037cd7b9b1cefef578ba', 1, 0, 'BEST,1210,480,317', '{"BEST":1918740.62}', 0, 0, NULL, 1, '2018-01-12 06:02:39', '2018-01-12 06:07:23', '0000-00-00 00:00:00', '2018-01-12 08:20:02', '2018-01-12 16:38:38', '0000-00-00 00:00:00', '2018-01-16 00:00:00', '0-0', '3865-6270.263543129', '00:36:35', 22316, '17060438374459260515482616040038', '51931854122668357378213659387003', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0);
