(49360, 20653, NULL, 'Aflevering_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov_S2_Ep03_da_1080p25_V1.mp4', '', 3060, 0, 0, 3, 'Aflevering 3', 'Martin staat zowel thuis als op het werk voor een uitdaging. Oliver heeft een DNA-test besteld, maar Martin vindt het onnodig en is ook bang voor het antwoord. Terwijl Jackie op zakenreis is, probeert hij zijn relatie met Oliver te versterken door hem te betrekken bij de groene plannen voor de haven. Het conflict met de vissers escaleert wanneer Martin een halve ton visafval vindt voor Waves Energy, en dingen nemen een wending wanneer Claudia bondgenoten wordt met de visserijvoorzitter, HC.\r\n', '2018-01-12', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-12 00:00:00', 3365, '2018-01-12 06:04:26', NULL, NULL, 1, '48a52d5cf371cff4f7f3988a5b577780', 1, 0, 'BEST,1210,480,317', '{"BEST":2010716.21}', 0, 0, NULL, 1, '2018-01-12 06:02:53', '2018-01-12 06:07:19', '0000-00-00 00:00:00', '2018-01-12 08:25:03', '2018-01-12 18:43:13', '0000-00-00 00:00:00', '2018-01-16 00:00:00', '0-0', '4052-6533.0370531082', '00:38:21', 22317, '67416319483328575093065070534814', '95860900522126912140284326362338', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49361, 20653, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov_S2_Ep04_da_1080p25_V1.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Het begint er voor Bondesen Byg beter uit te zien, terwijl Martins plannen mislukken. Jackie wordt zwaar getroffen door Martins neergang en het verlies van Oliver, die slaagt in zijn criminele onderneming. Hij vindt een ervaren mentor in zijn grote broer Bonden, maar Bonden heeft ook zijn eigen plannen waarin hij Oliver wil inzetten. Tom probeert nog steeds een brug te slaan tussen Claudia en zichzelf, maar weet hij wel wat hij doet?\r\n', '2018-01-12', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-12 00:00:00', 3365, '2018-01-12 06:04:39', NULL, NULL, 1, 'b856bd4b563970cc99208b7be3f74bf9', 1, 0, 'BEST,1210,480,317', '{"BEST":2003006.66}', 0, 0, NULL, 1, '2018-01-12 06:03:04', '2018-01-12 06:07:45', '0000-00-00 00:00:00', '2018-01-12 08:30:02', '2018-01-12 18:55:24', '0000-00-00 00:00:00', '2018-01-16 00:00:00', '0-0', '4038-6980.6964015961', '00:38:12', 22318, '88065795019514893562123166816322', '25442615067402321297376077924474', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49362, 20653, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov_S2_Ep05_da_1080p25_V1.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Tom is verliefd en zijn nieuwe toestand blijft niet onopgemerkt op het politiebureau. Tom en het team maken een doorbraak met de inbraken, maar als het geval persoonlijk wordt voor Tom, ontstaat er een nieuw dilemma. Jackie worstelt met een persoonlijke crisis en Martin gooit alles in de strijd voor Waves Energy. Bonden heeft plannen voor zijn en zijn families toekomst, waarbij Oliver een trouwe helper is. Maar wanneer Bonden ontdekt dat Claudia hem ontglipt, moet hij ingrijpen.\r\n', '2018-01-12', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-12 00:00:00', 3365, '2018-01-12 06:04:47', NULL, NULL, 1, '77fec91772e29a92c267237b080fbc82', 1, 0, 'BEST,1210,480,317', '{"BEST":2139337.81}', 0, 0, NULL, 1, '2018-01-12 06:03:12', '2018-01-12 06:08:58', '0000-00-00 00:00:00', '2018-01-12 08:35:02', '2018-01-12 19:28:55', '0000-00-00 00:00:00', '2018-01-16 00:00:00', '0-0', '4313-7028.2164354324', '00:40:48', 22319, '19506546137539615513630397770874', '24125902659987872751216203975265', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49363, 20653, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Norskov_S2_Ep06_da_1080p25_V1.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Wanneer ze er eindelijk achter komen wie al die tijd achter de inbraken heeft gezeten, wordt het heet onder Toms voeten. De strijd om Waves Energy kent een hoogtepunt, terwijl Jackie haar eigen demonen onder ogen moet komen. Bondens toekomstige geluk kan almaar minder verzekerd worden…\r\n', '2018-01-12', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-12 00:00:00', 3365, '2018-01-12 06:05:01', NULL, NULL, 1, '915dec2be7f609c9b0944089d14361de', 1, 0, 'BEST,1210,480,317', '{"BEST":2212992.28}', 0, 0, NULL, 1, '2018-01-12 06:03:23', '2018-01-12 06:09:20', '0000-00-00 00:00:00', '2018-01-12 08:45:03', '2018-01-12 20:53:49', '0000-00-00 00:00:00', '2018-01-16 00:00:00', '0-0', '4458-7961.4162340164', '00:42:12', 22320, '47486158384531279724544385044926', '64773894456432500644110149022900', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
