(49378, 20654, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep01_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'Inger Johanne en Ingvar krijgen snel een baby. Ingvar en de Zweedse politie bereiden zich voor op het staatsbezoek van de Amerikaanse president Helen Tyler. Maar de vreugde van het ontvangen van de nieuwgekozen president in Stockholm is van korte duur, wanneer Helen Tyler op mysterieuze wijze verdwijnt.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:06:16', NULL, NULL, 1, 'f2f3317a5ab09cfc369091bf08f239a4', 1, 0, 'BEST,1210,480,317', '{"BEST":2357997.09}', 0, 0, NULL, 1, '2018-01-23 09:29:37', '2018-01-23 09:34:09', '0000-00-00 00:00:00', '2018-01-23 12:00:11', '2018-01-23 14:50:59', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4789-7555.322892189', '00:45:21', 22378, '64704751880841708597055270589071', '38980206632212381467722375485536', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49379, 20654, NULL, 'Aflevering_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep02_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 2, 'Aflevering 2', 'De Zweedse politie zet al hun middelen in op de zoektocht naar de Amerikaanse president. Inger Johanne beseft dat haar verleden haar inhaalt wanneer duidelijk wordt dat Ingvar het Zweedse contact zal zijn voor Warren Schifford.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:06:22', NULL, NULL, 1, '57cc530f74e4507c2c21808dfb840ae4', 1, 0, 'BEST,1210,480,317', '{"BEST":2358005.46}', 0, 0, NULL, 1, '2018-01-23 09:29:51', '2018-01-23 09:35:04', '0000-00-00 00:00:00', '2018-01-23 09:40:03', '2018-01-23 12:32:45', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4789-8340.000954628', '00:45:21', 22379, '65491439738385458159130609399311', '31618860157510786077686441675894', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49380, 20654, NULL, 'Aflevering_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep04_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 4, 'Aflevering 4', 'Het lek binnen de de Zweedse politie blijkt iemand van de Task Force te zijn. Ingvar en Inger Johanne bepalen dat ze niemand anders dan elkaar kunnen vertrouwen. Tegelijkertijd wordt hun privé-leven echt op de proef gesteld, terwijl Warren zich opnieuw de weg baant naar het leven van Inger Johanne.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:06:39', NULL, NULL, 1, 'c56202b66d431a16fbc0260c3d2bd1f6', 1, 0, 'BEST,1210,480,317', '{"BEST":2365377.01}', 0, 0, NULL, 1, '2018-01-23 09:30:01', '2018-01-23 09:35:07', '0000-00-00 00:00:00', '2018-01-23 12:20:02', '2018-01-23 15:16:02', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4803-7675.602145195', '00:45:28', 22381, '56009105669083337825174960854211', '62293184878999013870870561985186', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49381, 20654, NULL, 'Aflevering_5.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep05_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 5, 'Aflevering 5', 'Inger Johanne ontdekt dat ze wordt geschaduwd en gaat naar Hedvig om hulp. De puzzelstukjes beginnen langzaam op hun plaats te vallen en Inger Johanne krijgt een idee waardoor ze besluit het heft in eigen hand te nemen.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:06:43', NULL, NULL, 1, '373e6ed5a7f859820f6a6be334a8208c', 1, 0, 'BEST,1210,480,317', '{"BEST":2277893.63}', 0, 0, NULL, 1, '2018-01-23 09:30:10', '2018-01-23 09:36:07', '0000-00-00 00:00:00', '2018-01-23 12:15:03', '2018-01-23 14:54:13', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4621-7151.8219680786', '00:43:47', 22382, '84723484769749540195986063732707', '21078956178382935416346579902376', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49382, 20654, NULL, 'Aflevering_6.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep06_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 6, 'Aflevering 6', 'Warren heeft moeite om de rest van de FBI te laten luisteren naar zijn theorie over wat er achter de verdwijning van de president zit. Inger Johanne belandt in een zeer conflictueuze situatie wanneer Helen Tyler niet door de buitenwereld wil worden gevonden.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:06:47', NULL, NULL, 1, '47cd9b242ad7a8e2ebc41a4ea69d2ca9', 1, 0, 'BEST,1210,480,317', '{"BEST":2313473.75}', 0, 0, NULL, 1, '2018-01-24 08:27:10', '2018-01-24 08:31:13', '0000-00-00 00:00:00', '2018-01-24 11:25:03', '2018-01-24 12:03:57', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4696-7139.2404079437', '00:44:30', 22383, '12743822317620721687071383356224', '76371802798742525061599732624992', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49383, 20654, NULL, 'Aflevering_7.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep07_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 7, 'Aflevering 7', 'Ingvar is gedwongen, tegen zijn wil, samen te werken met Warren om een ​​kans te hebben om Inger Johanne en Helen Tyler te vinden. Inger Johanne begint te begrijpen wat er achter de verdwijning van de president zit en dat er nog heel gevaarlijke krachten naar hem op zoek zijn.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:06:55', NULL, NULL, 1, 'c224804e65abe77279510813d927b2fe', 1, 0, 'BEST,1210,480,317', '{"BEST":2242915.72}', 0, 0, NULL, 1, '2018-01-23 09:30:29', '2018-01-23 09:38:50', '0000-00-00 00:00:00', '2018-01-23 14:20:02', '2018-01-23 19:06:05', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4551-6664.1353435516', '00:43:06', 22384, '46138085226763935116743214885048', '41015323184575767057657171954505', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49384, 20654, NULL, 'Aflevering_8.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Modus_S2_Ep08_8ch_sv_1080p25_V1.mp4', '', 3060, 0, 0, 8, 'Aflevering 8', 'De Zweedse politie en de FBI weten nu waar Helen Tyler is, maar komen ze er op tijd? De dochter van de president, Zoë, komt een geheim te weten dat haar ertoe aanzet haast te maken.\r\n', '2018-01-17', 1, 2, 0, 0, 1, 1, NULL, 3365, '2018-01-17 00:00:00', 3365, '2018-01-23 09:07:06', NULL, NULL, 1, 'ff25dda1634e5b39b2f536788affb4ab', 1, 0, 'BEST,1210,480,317', '{"BEST":2291929.52}', 0, 0, NULL, 1, '2018-01-23 09:30:39', '2018-01-23 09:37:14', '0000-00-00 00:00:00', '2018-01-23 14:45:02', '2018-01-23 20:12:06', '0000-00-00 00:00:00', '2018-01-24 00:00:00', '0-0', '4654-7372.8230514526', '00:44:06', 22385, '50199228901913763137635186254280', '68408730544995832428056349780469', '', 0, 20, 8, '', '', '', '', '', '', 1, 0, 1, 0, 0, 0, 0, 1, 0),
