(49386, 20907, NULL, 'Episode_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3080/RawVideo/videogallery/testvideo.mp4', '', 3080, 0, 0, 1, 'Episode 1', 'Weit hinten, hinter den Wortbergen, fern der Länder Vokalien und Konsonantien leben die Blindtexte. Abgeschieden wohnen sie in Buchstabhausen an der Küste des Semantik, eines großen Sprachozeans. Ein kleines Bächlein namens Duden fließt durch ihren Ort und versorgt sie mit den nötigen Regelialien.', NULL, 1, 1, 0, 0, 1, 1, NULL, 3474, '2018-01-19 00:00:00', NULL, '2018-01-19 12:21:20', NULL, NULL, 1, 'f546530f9d36ecd8a57b56c5f8bd98e8', 1, 0, 'BEST,1210,480,317', '{"BEST":132240.29}', 0, 0, NULL, 1, '2018-01-19 12:23:25', '2018-01-19 12:25:17', '0000-00-00 00:00:00', '2018-01-19 12:30:02', '2018-01-19 17:02:25', '0000-00-00 00:00:00', NULL, '0-0', '259-511.42174053192', '00:02:13', 22344, '10222436460160314491630934824275', '72813454172939318189799897043885', '', 0, 20, 22, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49387, 20907, NULL, 'Episode_2.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3080/RawVideo/videogallery/testvideo.mp4', '', 3080, 0, 0, 2, 'Episode 2', 'Es ist ein paradiesmatisches Land, in dem einem gebratene Satzteile in den Mund fliegen. Nicht einmal von der allmächtigen Interpunktion werden die Blindtexte beherrscht – ein geradezu unorthographisches Leben. Eines Tages aber beschloß eine kleine Zeile Blindtext, ihr Name war Lorem Ipsum, hinaus zu gehen in die weite Grammatik.', NULL, 1, 1, 0, 0, 1, 1, NULL, 3474, '2018-01-19 00:00:00', NULL, '2018-01-19 12:21:47', NULL, NULL, 1, '10acafbe80055fee601cb0244efcb4ac', 1, 0, 'BEST,1210,480,317', '{"BEST":132240.29}', 0, 0, NULL, 1, '2018-01-19 12:23:21', '2018-01-19 12:25:29', '0000-00-00 00:00:00', '2018-01-19 17:10:02', '2018-01-19 18:40:52', '0000-00-00 00:00:00', NULL, '0-0', '259-511.42174053192', '00:02:13', 22344, '74576006146257293110806291644923', '31842404748293065063928400902987', '', 0, 20, 22, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49388, 20907, NULL, 'Episode_3.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3080/RawVideo/videogallery/testvideo.mp4', '', 3080, 0, 0, 3, 'Episode 3', 'Der große Oxmox riet ihr davon ab, da es dort wimmele von bösen Kommata, wilden Fragezeichen und hinterhältigen Semikoli, doch das Blindtextchen ließ sich nicht beirren. Es packte seine sieben Versalien, schob sich sein Initial in den Gürtel und machte sich auf den Weg.', NULL, 1, 1, 0, 0, 1, 1, NULL, 3474, '2018-01-19 00:00:00', NULL, '2018-01-19 12:22:21', NULL, NULL, 1, 'c89b5884687b685381f10c700062f70d', 1, 0, 'BEST,1210,480,317', '{"BEST":132240.29}', 0, 0, NULL, 1, '2018-01-19 12:23:16', '2018-01-19 12:25:41', '0000-00-00 00:00:00', '2018-01-19 17:20:03', '2018-01-19 18:48:13', '0000-00-00 00:00:00', NULL, '0-0', '259-511.42174053192', '00:02:13', 22344, '94660038201683442233748561617412', '94561943540405458935481673459737', '', 0, 20, 22, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
(49389, 20907, NULL, 'Episode_4.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3080/RawVideo/videogallery/testvideo.mp4', '', 3080, 0, 0, 4, 'Episode 4', 'Als es die ersten Hügel des Kursivgebirges erklommen hatte, warf es einen letzten Blick zurück auf die Skyline seiner Heimatstadt Buchstabhausen, die Headline von Alphabetdorf und die Subline seiner eigenen Straße, der Zeilengasse. Wehmütig lief ihm eine rhetorische Frage über die Wange, dann setzte es seinen Weg fort. ', NULL, 1, 1, 0, 0, 1, 1, NULL, 3474, '2018-01-19 00:00:00', NULL, '2018-01-19 12:23:02', NULL, NULL, 1, '58b1a71381e0d7e6c599ef6e5cd10a69', 1, 0, 'BEST,1210,480,317', '{"BEST":132240.29}', 0, 0, NULL, 1, '2018-01-19 12:23:12', '2018-01-19 12:25:50', '0000-00-00 00:00:00', '2018-01-19 17:25:02', '2018-01-19 18:55:18', '0000-00-00 00:00:00', NULL, '0-0', '259-511.42174053192', '00:02:13', 22344, '37777766464214954516996883239637', '47525264490887930778805562826480', '', 0, 20, 22, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
