(49447, 20960, NULL, 'Aflevering_1.mp4', 'http://dadc-muvi.s3-eu-west-1.amazonaws.com/3060/RawVideo/videogallery/Tellus_S1_Ep1_fi_1080i50.mp4', '', 3060, 0, 0, 1, 'Aflevering 1', 'In Helsinki pleegt een groep milieu-activisten onder de naam Tellus al een aantal jaar sabotage aanslagen tegen de maatschappij. Als er per ongeluk een persoon de dood vindt, intensiveert de politie de jacht op de groep. Tegelijkertijd beseft de groep dat de campagnes tot nog toe weinig effect hebben gehad, en daarom moeten ze een beslissing nemen: ermee stoppen of de strijd opvoeren: aanslagen gaan plegen op mensen die een grote bedreiging voor het milieu vormen.\r\n', NULL, 1, 1, 0, 0, 1, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 11:30:28', NULL, NULL, 1, '180d5b138f018c3988da2e15f68510e4', 1, 0, 'BEST,1210,480,317', '{"BEST":2632274.62}', 0, 0, NULL, 1, '2018-02-02 06:16:31', '2018-02-02 06:20:42', '0000-00-00 00:00:00', '2018-02-02 06:25:03', '2018-02-02 15:21:21', '0000-00-00 00:00:00', NULL, '0-0', '5293-9121.5884838104', '00:50:12', 22467, '84573471306067026187403493811540', '23472890440849356557103119133311', '', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 0, 0, 0, 0, 1, 0),
