(49456, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 1, 'Aflevering 1', 'De schoolpsycholoog dreigt ermee Thomas’ zoontje Niklas bij hem weg te halen, terwijl Thomas’ jeugdvriend Dion vrijkomt uit de gevangenis. De Tandenfee zit hem echter meteen op de hielen. Dion benadert Thomas om samen een restaurant te beginnen.\r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:17:34', NULL, NULL, 0, '04cb0e2cc8dadd4281c8b4895cdfb0e1', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49457, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 2, 'Aflevering 2', 'Thomas leert Hannah kennen in de rouwgroep. Dion nodigt een mogelijke investeerder uit om zijn kookkunsten te tonen, maar Thomas blijkt de investeerder te kennen. De reünie is geen succes…\r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:17:40', NULL, NULL, 0, 'd123b6b2512bacadbbf91f08ce7a2912', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49458, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 3, 'Aflevering 3', 'Dion komt onder druk te staan van zowel de Tandenfee als de politie, wat hij geheim moet zien te houden voor Thomas. Dion vraagt Hannah een contractvoorstel na te lezen, maar ondanks haar waarschuwingen moet hij het toch tekenen zoals het is. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:17:48', NULL, NULL, 0, '453e31a59edb5760c7426b7bdc4027c4', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49459, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 4, 'Aflevering 4', ' Thomas wordt verrast door de aankomst van goedkope werkkrachten. Dion wint tijd bij de schoolpsycholoog en stort in door alle leugens die circuleren in zijn oude buurt. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:17:56', NULL, NULL, 0, '0f34a4c0589f4ee5af9859b8791bbb8d', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49460, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 5, 'Aflevering 5', 'Thomas moet op zoek naar geld, maar zijn vader snoert hem de mond met een heerlijk wijnassortiment, dat Thomas en Hannah in een romantische bui maar al te graag uitproberen. Kisser kondigt aan dat ze zwanger is terwijl de Tandenfee Dion dwingt om zijn illegale goederen op te slaan. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:18:02', NULL, NULL, 0, '74cf913a33fe1d080242b6e7bd726dc6', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49461, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 6, 'Aflevering 6', 'Thomas en Dion maken ruzie bij het graf van Rie. Dion probeert tevergeefs van de Tandenfees cocaïne af te geraken. Hannah voelt zich genegeerd en verliest ineens het inkomen van haar job die ze zonder kwalificaties uitvoert. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:18:09', NULL, NULL, 0, '22efb6d4ecbb2cf63db38e41ed5cabc6', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49462, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 7, 'Aflevering 7', 'De schoolpsycholoog is blij dat Dion erkend wordt als vertrouwenspersoon, wat Thomas enkel maar jaloerser maakt. Hannah voelt zich onder druk gezet omdat haar moeder haar niet wil helpen, maar leert iemand kennen die haar wel tips kan geven, zodat ze manager van het restaurant kan blijven. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:18:17', NULL, NULL, 0, 'ff3dda21a6ab217995b68d5bd7cfb98f', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
(49463, 20962, NULL, NULL, NULL, '', 3060, 0, 0, 8, 'Aflevering 8', 'De Tandenfee biedt Dion een glamoureuze samenwerking aan. Hannah onthult Dions geknoei met kasticketjes maar wanneer ze hem ermee confronteert, draait het anders uit dan verwacht. Vader stuurt Thomas, Dion en Niklas weg voor een overnachting in een hotel waar de waarheid onthuld wordt, terwijl iemand met vuur speelt…\r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:18:23', NULL, NULL, 0, '8dca44f3a109c7bc781b867eab04f406', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
