(49465, 20963, NULL, NULL, NULL, '', 3060, 0, 0, 6, 'Aflevering 6', 'Stella wordt gechanteerd om een verzameling filmpjes te overhandigen die regeringsleden en machtige zakenmannen in uiterst compromitterende omstandigheden tonen. Guo Dai, een medewerker van de Chinese ambassade en een heel gevaarlijk man met een duister verleden, zet Stella onder de druk door de mensen om wie ze geeft te bedreigen. Wanneer Guo vermoord wordt tijdens een staatsdiner, is Stella de enige verdachte. Ze heeft geen andere keus dan op de vlucht te slaan om bewijzen te verzamelen van haar onschuld.\r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:32:09', NULL, NULL, 0, '9d9830e3ef04be8704bab8d814efa4c7', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
