(49467, 20963, NULL, NULL, NULL, '', 3060, 0, 0, 4, 'Aflevering 4', 'In een vakantiehuis in een van IJslands meest pittoreske nationale parken slaat het noodlot toe. Regina, een machtige fondsbeheerder en adviseur van de regering, komt tot een verschrikkelijk einde in een sauna. De politie verdenkt haar tienernichtje, die echter vasthoudt aan haar onschuld. Stella gaat op onderzoek uit in haar geheimzinnige vriendengroep. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:32:54', NULL, NULL, 0, '7c222b87ce098f011e37bd46735fe13d', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
