(49469, 20963, NULL, NULL, NULL, '', 3060, 0, 0, 2, 'Aflevering 2', 'In alle vroegte wordt Stella Blómkvist opgebeld om een oude cliënt te verdedigen. Saemi is een derderangse drugsdealer die er nu van verdacht wordt Halla vermoord te hebben, de assistente van de IJslandse premier. Hij stond immers over haar lijk gebogen, bedekt met bloed. Toch is Stella niet zeker van zijn schuld, zeker wanneer een mysterieuze vreemde haar gevoelige informatie doorspeelt. Daaruit blijkt dat Halla een gevaarlijk spel speelde met heel invloedrijke, machtige mensen. Al snel wil iedereen de kwestie zo snel mogelijk in de doofpot steken, maar dat is buiten Stella gerekend. Ze graaft dieper en dieper en botst op een kluwen van sekstapes, drugs en moord in het kloppende hart van de regering. \r\n', NULL, 1, 1, 0, 0, 0, 1, NULL, 3365, '2018-01-25 00:00:00', NULL, '2018-01-25 12:33:07', NULL, NULL, 0, '4482a06f2fe2d42539c64b05eabc4f5a', 0, 0, NULL, NULL, 0, 0, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, '', '', '0', 0, 20, 8, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 1, 0, 0, 0, 0, 0, 0),
